    t[233] = "\u0639\u0646\u062f \u0627\u0644\u062a\u0639\u064a\u064a\u0646 \u0639\u0644\u0649 \"\u0635\u062d\u064a\u062d\"\u060c \u0633\u064a\u0642\u0648\u0645 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0628\u062a\u063a\u064a\u064a\u0631 \u0647\u0648\u064a\u062a\u0647 \u0648\u0645\u0646\u0641\u0630 UDP \u0641\u064a \u0643\u0644 \u0645\u0631\u0629 \u064a\u062a\u0645 \u0641\u064a\u0647\u0627 \u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647. ";
