    t[286] = "Note that there can only be a single reference to the <i class=example>default</i> keyword in a filter file. If unstated, all connections are permitted unless explicitly forbidden. Errors in the filter file will prevent a stopped tunnel from starting, so be sure to double check the syntax before deployment.";
    t[287] = "\u064a\u062c\u0628 \u0645\u0644\u0627\u062d\u0638\u0629 \u0623\u0646\u0647 \u0644\u0627 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0643\u0648\u0646 \u0647\u0646\u0627\u0643 \u0625\u0644\u0627 \u0645\u0631\u062c\u0639 \u0648\u0627\u062d\u062f \u0641\u0642\u0637 \u0644\u0645\u0641\u062a\u0627\u062d <i class=example>default</i> \u0641\u064a \u0645\u0644\u0641 \u0627\u0644\u0645\u0635\u0641\u064a. \u0625\u0630\u0627 \u0644\u0645 \u064a\u0630\u0643\u0631 \u0634\u064a\u0621\u060c \u064a\u062a\u0645 \u0627\u0644\u0633\u0645\u0627\u062d \u0628\u062c\u0645\u064a\u0639 \u0627\u0644\u0627\u062a\u0635\u0627\u0644\u0627\u062a \u0645\u0627 \u0644\u0645 \u064a\u062a\u0645 \u062d\u0638\u0631\u0647\u0627 \u0635\u0631\u0627\u062d\u0629. \u0633\u0648\u0641 \u062a\u0645\u0646\u0639 \u0627\u0644\u0623\u062e\u0637\u0627\u0621 \u0641\u064a \u0645\u0644\u0641 \u0627\u0644\u0645\u0635\u0641\u064a \u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0646\u0641\u0642 \u0627\u0644\u0645\u062a\u0648\u0642\u0641\u060c \u0644\u0630\u0644\u0643 \u062a\u0623\u0643\u062f \u0645\u0646 \u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0627\u0644\u0642\u0648\u0627\u0639\u062f \u0627\u0644\u0646\u062d\u0648\u064a\u0629 \u0642\u0628\u0644 \u0627\u0644\u0646\u0634\u0631.";
