    t[353] = "\u0639\u0646\u0648\u0627\u0646 IP";
    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "\u0639\u0646\u062f\u0645\u0627 \u064a\u062a\u0645 \u0625\u0646\u0634\u0627\u0621 \u0646\u0641\u0642 \u062e\u062f\u0645\u0629 \u062c\u062f\u064a\u062f \u0623\u0648 \u062a\u0634\u063a\u064a\u0644 \u062e\u062f\u0645\u0629 \u0644\u0623\u0648\u0644 \u0645\u0631\u0629 (\u0645\u062b\u0644 \u0645\u062e\u062f\u0645 \u0648\u064a\u0628 \u062c\u064a\u062a\u064a \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u060c \u0627\u0644\u0625\u0636\u0627\u0641\u0627\u062a)\u060c \u064a\u062a\u0645 \u0625\u0646\u0634\u0627\u0621 \u0645\u0641\u062a\u0627\u062d \u062a\u0634\u0641\u064a\u0631 \u062e\u0627\u0635 \u064a\u0633\u064a\u0637\u0631 \u0623\u0633\u0627\u0633\u064b\u0627 \u0639\u0644\u0649 \u0645\u0644\u0643\u064a\u0629 \u0627\u0644\u0639\u0646\u0648\u0627\u0646. \u064a\u062a\u0645 \u062a\u0633\u0645\u064a\u062a\u0647\u0627 \u0639\u0627\u062f\u0629 <code>&hellip;privKey.dat</code> \u060c \u0623\u0648 <code>eepPriv.dat</code>\u060c \u0639\u0644\u0649 \u0627\u0644\u0631\u063a\u0645 \u0645\u0646 \u0623\u0646\u0647 \u0645\u0646 \u0627\u0644\u062c\u064a\u062f \u062a\u063a\u064a\u064a\u0631 \u0627\u0644\u0627\u0633\u0645 \u0644\u0644\u062f\u0644\u0627\u0644\u0629 \u0639\u0644\u0649 \u0627\u0644\u062e\u062f\u0645\u0629 \u0627\u0644\u062a\u064a \u064a\u0646\u062a\u0645\u064a \u0625\u0644\u064a\u0647\u0627 \u062b\u0645 \u0625\u0639\u0627\u062f\u0629 \u062a\u062d\u062f\u064a\u062f\u0647 \u0641\u064a \u0625\u0639\u062f\u0627\u062f\u0627\u062a \u062e\u0627\u062f\u0645 \u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642. \u064a\u062c\u0628 \u0625\u0646\u0642\u0627\u0630 \u0647\u0630\u0627 \u0627\u0644\u0645\u0644\u0641 .dat \u0628\u0623\u0645\u0627\u0646\u061b \u0641\u0642\u062f\u0627\u0646\u0647 \u0633\u064a\u0624\u062f\u064a \u0625\u0644\u0649 \u0641\u0642\u062f\u0627\u0646 \u0645\u0644\u0643\u064a\u0629 \u0648\u0633\u064a\u0637\u0631\u062a\u0643 \u0639\u0644\u0649 \u0627\u0633\u0645 \u0627\u0644\u0645\u0636\u064a\u0641!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "\u064a\u0633\u0645\u062d \u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u0628\u062a\u0643\u0648\u064a\u0641 \u0627\u0644\u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0644\u0644\u0645\u0644\u0641\u0627\u062a \u0644\u0643\u0644 \u062a\u0648\u0631\u0646\u062a \u064a\u0633\u0645\u062d \u0628\u0647 I2PSnark \u0639\u0646\u062f \u062a\u0646\u0632\u064a\u0644\u0647\u0627 \u0623\u0648 \u0625\u0646\u0634\u0627\u0626\u0647\u0627. \u064a\u062c\u062f\u0631 \u0645\u0644\u0627\u062d\u0638\u0629 \u0623\u0646 \u0632\u064a\u0627\u062f\u0629 \u0647\u0630\u0647 \u0627\u0644\u0642\u064a\u0645\u0629 \u0628\u0634\u0643\u0644 \u0645\u0644\u062d\u0648\u0638 \u0639\u0646 2000 \u0645\u0644\u0641 \u0642\u062f \u062a\u062a\u0637\u0644\u0651\u0628 \u062a\u0643\u0648\u064a\u0641\u0627\u062a \u0625\u0636\u0627\u0641\u064a\u0629 \u0639\u0644\u0649 \u0646\u0638\u0627\u0645 \u0627\u0644\u0636\u064a\u0627\u0641\u0629 \u0644\u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0644\u0644\u0645\u0644\u0641\u0627\u062a \u0627\u0644\u0645\u0641\u062a\u0648\u062d\u0629 \u0627\u0644\u062a\u064a \u0633\u064a\u0633\u0645\u062d \u0628\u0647\u0627 \u0646\u0638\u0627\u0645 \u0627\u0644\u062a\u0634\u063a\u064a\u0644 (\u0645\u062b\u0644 <code>ulimit -n</code> \u0641\u064a \u0644\u064a\u0646\u0643\u0633). \u0644\u0644\u062a\u063a\u064a\u064a\u0631\u060c \u0623\u0636\u0641 \u0625\u0644\u0649 \u0645\u0644\u0641 \u0627\u0644\u062a\u0643\u0648\u064a\u0641 <code>i2psnark.config</code> \u0644\u0640 I2PSnark. [\u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 I2PSnark \u0623\u0648 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0636\u0631\u0648\u0631\u064a\u0651\u0629]";
    t[370] = "Configure router bandwidth allocation";
    t[371] = "\u062d\u062f\u062f \u0633\u0631\u0639\u0629 \u0627\u0644\u0645\u0648\u062c\u0647";
    t[372] = "Here are some other public addressbook subscription links. You may wish to add one or two to your <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns subscription list</a>. In the event that addresses conflict in the subscriptions, the lists placed at the top of your susidns configuration will take precedence over those placed further down.";
    t[373] = "\u0647\u0630\u0647 \u0628\u0639\u0636 \u0631\u0648\u0627\u0628\u0637 \u0627\u0634\u062a\u0631\u0627\u0643\u0627\u062a \u062f\u0644\u064a\u0644 \u0627\u0644\u0639\u0646\u0627\u0648\u064a\u0646 \u0627\u0644\u0639\u0627\u0645\u0629 \u0627\u0644\u0623\u062e\u0631\u0649. \u0642\u062f \u062a\u0631\u063a\u0628 \u0641\u064a \u0625\u0636\u0627\u0641\u0629 \u0648\u0627\u062d\u062f \u0623\u0648 \u0627\u062b\u0646\u064a\u0646 \u0625\u0644\u0649 <a href='/dns?subscriptions' target=_blank rel=noreferrer>\u0642\u0627\u0626\u0645\u0629 \u0627\u0634\u062a\u0631\u0627\u0643\u0627\u062a susidns</a> \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643. \u0641\u064a \u062d\u0627\u0644 \u062a\u0639\u0627\u0631\u0636 \u0627\u0644\u0639\u0646\u0627\u0648\u064a\u0646 \u0641\u064a \u0627\u0644\u0627\u0634\u062a\u0631\u0627\u0643\u0627\u062a\u060c \u0633\u064a\u062a\u0645 \u0627\u0644\u0623\u062e\u0630 \u0628\u0627\u0644\u0642\u0648\u0627\u0626\u0645 \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0629 \u0641\u064a \u0623\u0639\u0644\u0649 \u062a\u0643\u0648\u064a\u0646 susidns \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u062a\u0644\u0643 \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0629 \u0641\u064a \u0627\u0644\u0623\u0633\u0641\u0644.";
