    t[555] = "\u0627\u062e\u062a\u0631 \u0627\u0633\u0645\u064b\u0627 \u0644\u0645\u0648\u0642\u0639\u0643 (\u064a\u0633\u062a\u062e\u062f\u0645 <i>hostname</i>.i2p) \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u062d\u0631\u0648\u0641 \u0627\u0644\u0635\u063a\u064a\u0631\u0629. \u0644\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u062a\u0648\u0641\u0631 \u0627\u0633\u0645 \u0627\u0644\u0645\u0636\u064a\u0641\u060c \u062a\u062d\u0642\u0642 \u0645\u0646 <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> \u0623\u0648 <a href=http://reg.i2p target=_blank>reg.i2p</a> \u0642\u0628\u0644 \u0623\u0646 \u062a\u0642\u0631\u0631. \u0623\u062f\u062e\u0644 \u0627\u0644\u0627\u0633\u0645 \u0627\u0644\u062c\u062f\u064a\u062f \u0644\u0645\u0648\u0642\u0639\u0643 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href='/i2ptunnel/edit?tunnel=3'>\u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0627\u0646\u0641\u0627\u0642</a> \u062d\u064a\u062b \u064a\u0630\u0643\u0631 <i>\u0627\u0633\u0645 \u0627\u0644\u0645\u0648\u0642\u0639</i>\u060c \u0645\u0639 \u0627\u0633\u062a\u0628\u062f\u0627\u0644 \u0627\u0644\u0645\u0643\u0627\u0646 \u0627\u0644\u0646\u0645\u0648\u0630\u062c\u064a <i>mysite.i2p</i>. \u0625\u0630\u0627 \u0623\u0631\u062f\u062a \u062a\u0648\u0641\u064a\u0631 \u0645\u0648\u0642\u0639\u0643 \u0639\u0646\u062f \u0628\u062f\u0621 I2P\u060c \u0641\u0639\u0644 \u0645\u064a\u0632\u0629 <i>\u0628\u062f\u0621 \u062a\u0644\u0642\u0627\u0626\u064a</i> \u062b\u0645 \u0627\u0646\u0642\u0631 \u0641\u0648\u0642 <i>\u062d\u0641\u0638</i>.";
