    t[607] = "\u0648\u0644\u0643\u0646 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u0648\u062c\u0647\u0627\u062a \u0627\u0644\u0639\u062f\u0648\u0627\u0646\u064a\u0629 \u0628\u0634\u0643\u0644 \u0645\u0641\u0631\u0637";
    t[608] = "Deadlock detected";
    t[609] = "\u062a\u0645 \u0627\u0643\u062a\u0634\u0627\u0641 \u062d\u0627\u0644\u0629 \u062a\u0648\u0642\u0641 \u062a\u0627\u0645";
    t[610] = "Use SSU IP address detection only";
    t[611] = "\u0627\u0633\u062a\u062e\u062f\u0645 \u0627\u0643\u062a\u0634\u0627\u0641 \u0639\u0646\u0648\u0627\u0646 IP SSU \u0641\u0642\u0637";
    t[614] = "Tick the box marked <i>Proxy DNS when using SOCKS v5</i> to prevent DNS leaks.";
    t[615] = "\u0627\u062e\u062a\u0631 \u0627\u0644\u062e\u0627\u0646\u0629 \u0627\u0644\u0645\u062d\u062f\u062f\u0629 \u0628\u0640 <i>\u0648\u0643\u064a\u0644 \u0646\u0638\u0627\u0645 \u062a\u0633\u0645\u064a\u0627\u062a \u0627\u0644\u0646\u0637\u0627\u0642 \u0639\u0646\u062f \u0627\u0633\u062a\u062e\u062f\u0627\u0645SOCKS v5</i> \u0644\u0645\u0646\u0639 \u062a\u0633\u0631\u0628\u0627\u062a \u0646\u0638\u0627\u0645 \u0627\u0644\u0623\u0633\u0645\u0627\u0621.";
    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "\u0642\u062f \u062a\u0643\u0648\u0646 \u0627\u0644\u0645\u0643\u0627\u0641\u0622\u062a \u0625\u064a\u062c\u0627\u0628\u064a\u0629 \u0623\u0648 \u0633\u0644\u0628\u064a\u0629\u060c \u0648\u062a\u0624\u062b\u0631 \u0639\u0644\u0649 \u0625\u062f\u0631\u0627\u062c \u0627\u0644\u0646\u0638\u064a\u0631 \u0641\u064a \u0627\u0644\u0645\u0633\u062a\u0648\u064a\u0627\u062a \u0627\u0644\u0633\u0631\u064a\u0639\u0629 \u0648\u0627\u0644\u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0633\u0639\u0629. \u064a\u062a\u0645 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0633\u0631\u064a\u0639\u0629 \u0641\u064a \u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0639\u0645\u064a\u0644\u060c \u0648\u064a\u062a\u0645 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0633\u0639\u0629 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0627\u0633\u062a\u0643\u0634\u0627\u0641\u064a\u0629.";
    t[618] = "Yes";
    t[619] = "\u0646\u0639\u0645";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "\u0628\u0627\u0644\u0631\u063a\u0645 \u0645\u0646 \u0623\u0646 I2P \u0633\u064a\u0639\u0645\u0644 \u0628\u0634\u0643\u0644 \u062c\u064a\u062f \u0628\u0647\u0630\u0627 \u0627\u0644\u062a\u0643\u0648\u064a\u0646\u060c \u0625\u0644\u0627 \u0623\u0646\u0647 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0633\u0631\u0639\u0629 \u062a\u0646\u0632\u064a\u0644\u0643 \u0628\u0627\u0644\u0641\u0639\u0644 \u0623\u0643\u062b\u0631 \u0645\u0646 128 \u0643\u064a\u0644\u0648\u0628\u0627\u064a\u062a \u0641\u064a \u0627\u0644\u062b\u0627\u0646\u064a\u0629\u060c \u0641\u0633\u064a\u0643\u0648\u0646 \u0645\u0646 \u0627\u0644\u0623\u0641\u0636\u0644 \u0644\u0644\u0634\u0628\u0643\u0629 \u0644\u0648 \u0641\u062a\u062d\u062a \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "\u062a\u0637\u0628\u064a\u0642 \u064a\u0639\u0645\u0644 \u0645\u0646 \u0633\u0637\u0631 \u0627\u0644\u0623\u0648\u0627\u0645\u0631 \u0645\u0631\u0641\u0642 \u0645\u0639 I2P \u064a\u0633\u062a\u062e\u062f\u0645 \u0644\u0637\u0644\u0628 \u0645\u0648\u0627\u0631\u062f \u0639\u0646\u0627\u0648\u064a\u0646 \u0625\u0646\u062a\u0631\u0646\u062a\u060c \u0628\u0634\u0643\u0644 \u0645\u0634\u0627\u0628\u0647 \u0644\u0640 <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> \u0623\u0648 <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. \u064a\u0633\u062a\u062e\u062f\u0645 \u0625\u064a\u0628\u062c\u062a \u0623\u064a\u0636\u064b\u0627 \u062f\u0627\u062e\u0644\u064a\u064b\u0627 \u0645\u0646 \u0642\u0628\u0644 \u0627\u0644\u0645\u0648\u062c\u0647\u060c \u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644 \u0644\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631 \u0645\u0646 \u0645\u0636\u064a\u0641\u064a\u0646 \u0639\u0646 \u0628\u0639\u062f. \u0625\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627\u060c \u064a\u0633\u062a\u062e\u062f\u0645 \u0625\u064a\u0628\u062c\u062a \u0648\u0643\u064a\u0644 HTTP \u0639\u0644\u0649 <code>127.0.0.1:4444</code>.";
    t[630] = "Mobile console option saved.";
    t[631] = "\u062a\u0645 \u062d\u0641\u0638 \u062e\u064a\u0627\u0631 \u0648\u062d\u062f\u0629 \u0627\u0644\u062a\u062d\u0643\u0645 \u0627\u0644\u0645\u062d\u0645\u0648\u0644\u0629.";
    t[632] = "Known Floodfills";
    t[633] = "\u0645\u062f\u0627\u0641\u0646 \u0627\u0644\u0641\u064a\u0636\u0627\u0646\u0627\u062a \u0627\u0644\u0645\u0639\u0631\u0648\u0641\u0629";
    t[634] = "OpenDemocracy";
    t[635] = "\u0627\u0644\u062f\u064a\u0645\u0642\u0631\u0627\u0637\u064a\u0629 \u0627\u0644\u0645\u0641\u062a\u0648\u062d\u0629";
    t[640] = "Enable UPnP to open firewall ports";
    t[641] = "\u062a\u0645\u0643\u064a\u0646 UPnP \u0644\u0641\u062a\u062d \u0645\u0646\u0627\u0641\u0630 \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629";
    t[652] = "Select secret key file";
    t[653] = "\u062d\u062f\u062f \u0645\u0644\u0641 \u0627\u0644\u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0633\u0631\u064a";
    t[660] = "Please open your firewall or enable UDP.";
    t[661] = "\u0627\u0644\u0631\u062c\u0627\u0621 \u0641\u062a\u062d \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0623\u0648 \u062a\u0645\u0643\u064a\u0646 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u064a\u0648 \u062f\u064a \u0628\u064a.";
    t[666] = "Install I2P system service";
    t[667] = "\u062a\u062b\u0628\u064a\u062a \u062e\u062f\u0645\u0629 \u0646\u0638\u0627\u0645 I2P";
    t[676] = "Reseed URL Selection";
    t[677] = "\u0625\u0639\u0627\u062f\u0629 \u0627\u062e\u062a\u064a\u0627\u0631 \u0639\u0646\u0648\u0627\u0646 URL";
    t[678] = "Same IPv4 /24 as us";
    t[679] = "\u0646\u0641\u0633 IPv4 /24 \u0645\u062b\u0644\u0646\u0627";
    t[688] = "I2P+ Service now disabled on system start";
    t[689] = "\u062a\u0645 \u0627\u0644\u0622\u0646 \u062a\u0639\u0637\u064a\u0644 \u062e\u062f\u0645\u0629 I2P \u0639\u0646\u062f \u0628\u062f\u0621 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0646\u0638\u0627\u0645";
    t[690] = "Configure Bandwidth";
    t[691] = "\u062a\u0643\u0648\u064a\u0646 \u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u062a\u0631\u062f\u062f\u064a";
    t[692] = "Updating IPv6 setting";
    t[693] = "\u062a\u062d\u062f\u064a\u062b \u0625\u0639\u062f\u0627\u062f IPv6";
    t[700] = "Acquired {0} router infos from reseed hosts";
    t[701] = "\u062a\u0645 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 {0} \u0645\u0646 \u0627\u0644\u0645\u0636\u064a\u0641\u064a\u0646 \u0627\u0644\u0645\u0639\u0627\u062f \u0632\u0631\u0639\u0647\u0645";
    t[706] = "Setup Wizard";
    t[707] = "\u0645\u0639\u0627\u0644\u062c \u0627\u0644\u0625\u0639\u062f\u0627\u062f";
    t[708] = "Router Console Theme";
    t[709] = "\u062a\u064a\u0645\u0629 \u0648\u0627\u062c\u0647\u0629 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645";
    t[710] = "caps";
    t[711] = "\u0642\u0628\u0639\u0627\u062a";
    t[714] = "Backup quantity";
    t[715] = "\u0642\u062f\u0631 \u0646\u0633\u062e \u0627\u0644\u0627\u062d\u062a\u064a\u0627\u0637";
    t[720] = "Textual router performance statistics";
    t[721] = "\u0627\u062d\u0635\u0627\u0626\u0627\u062a \u0646\u0635\u064a\u0629 \u0644\u0644\u0645\u0648\u062c\u0647";
    t[722] = "Javadocs";
    t[723] = "\u062c\u0627\u0641\u0627\u062f\u0648\u0643\u0633";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "\u0627\u0644\u0645\u0648\u0642\u0639 \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a eepsite \u0647\u0648 \u0645\u0648\u0642\u0639 \u0648\u064a\u0628 \u064a\u062a\u0645 \u0627\u0633\u062a\u0636\u0627\u0641\u062a\u0647 \u0628\u0634\u0643\u0644 \u0645\u062c\u0647\u0648\u0644 \u0639\u0644\u0649 \u0634\u0628\u0643\u0629 I2P - \u064a\u0645\u0643\u0646\u0643 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u064a\u0647 \u0639\u0646 \u0637\u0631\u064a\u0642 \u062a\u0643\u0648\u064a\u0646 \u0645\u062a\u0635\u0641\u062d \u0627\u0644\u0648\u064a\u0628 \u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0628\u0631\u0648\u0643\u0633\u064a HTTP \u0644\u0640 I2P (\u0627\u0646\u0638\u0631 \u0623\u0639\u0644\u0627\u0647) \u0648\u0627\u0644\u062a\u0635\u0641\u062d \u0625\u0644\u0649 \u0627\u0644\u0645\u0648\u0642\u0639 \u0627\u0644\u0645\u0644\u062d\u0642 \u0628\u0647 \u0627\u0645\u062a\u062f\u0627\u062f <code>.i2p</code> (\u0645\u062b\u0644 <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). \u0643\u0645\u0627 \u064a\u062c\u0628 \u0627\u0644\u062a\u0623\u0643\u062f \u0645\u0646 \u062a\u0643\u0648\u064a\u0646 \u0645\u062a\u0635\u0641\u062d\u0643 \u0644\u062d\u0644 \u0627\u0644\u0627\u0633\u0645 DNS \u0639\u0646 \u0628\u064f\u0639\u062f \u0639\u0646\u062f \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0628\u0631\u0648\u0643\u0633\u064a \u0644\u062a\u062c\u0646\u0628 \u062a\u0633\u0631\u0628\u0627\u062a DNS.";
    t[730] = "Updating UDP port to {0}";
    t[731] = "\u062a\u062d\u062f\u064a\u062b \u0645\u0646\u0641\u0630 UDP \u0625\u0644\u0649 {0}";
    t[732] = "Apache Web Server Security Guide";
    t[733] = "\u062f\u0644\u064a\u0644 \u0623\u0645\u0627\u0646 \u062e\u0627\u062f\u0645 \u0648\u064a\u0628 \u0623\u0628\u0627\u062a\u0634\u064a";
    t[736] = "Locate the configuration file: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> in the <code>clients.config.d</code> folder in your I2P settings directory, and then edit accordingly:";
    t[737] = "\u062a\u062d\u062f\u064a\u062f \u0645\u0644\u0641 \u0627\u0644\u062a\u0643\u0648\u064a\u0646: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> \u0641\u064a \u0645\u062c\u0644\u062f <code>clients.config.d</code> \u0641\u064a \u062f\u0644\u064a\u0644 \u0625\u0639\u062f\u0627\u062f\u0627\u062a I2P \u0627\u0644\u062e\u0627\u0635 \u0628\u0643\u060c \u062b\u0645 \u0642\u0645 \u0628\u062a\u0639\u062f\u064a\u0644\u0647 \u062d\u0633\u0628 \u0627\u0644\u062d\u0627\u062c\u0629:";
    t[738] = "Webmail client";
    t[739] = "\u0639\u0645\u064a\u0644 \u0628\u0631\u064a\u062f \u0627\u0644\u0648\u064a\u0628";
    t[756] = "Lookup Password";
    t[757] = "\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0644\u0644\u0628\u062d\u062b";
    t[762] = "Rekeying after graceful shutdown";
    t[763] = "\u062a\u063a\u064a\u0631 \u0627\u0644\u0645\u0641\u062a\u0627\u062d  \u0628\u0639\u062f \u0627\u0644\u062a\u0648\u0642\u0641";
    t[770] = "WorldAtlas";
    t[771] = "\u0623\u0637\u0644\u0633 \u0627\u0644\u0639\u0627\u0644\u0645";
    t[772] = "If you can't, I2P supports UPnP (Universal Plug and Play) and UDP hole punching with \"SSU introductions\" to relay traffic.";
    t[773] = "\u0641\u064a \u062d\u0627\u0644\u0629 \u0639\u062f\u0645 \u062a\u0645\u0643\u0646\u0643\u060c \u064a\u062f\u0639\u0645 I2P \u062a\u0642\u0646\u064a\u0629 UPnP (\u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u0639\u0627\u0645 \u0627\u0644\u0642\u0627\u0628\u0644 \u0644\u0644\u062a\u0648\u0635\u064a\u0644) \u0648\"\u0642\u0630\u0641 \u0627\u0644\u062b\u0642\u0648\u0628\" \u0641\u064a \u0627\u0644\u062d\u0632\u0645 UDP \u0645\u0639 \u0645\u0642\u062f\u0645\u0627\u062a SSU \u0644\u062a\u0645\u0631\u064a\u0631 \u0627\u0644\u062d\u0631\u0643\u0629.";
    t[774] = "Set theme universally across all apps";
    t[775] = "\u0642\u0645 \u0628\u062a\u0639\u064a\u064a\u0646 \u0627\u0644\u0633\u0645\u0629 \u0628\u0634\u0643\u0644 \u0639\u0627\u0645 \u0639\u0628\u0631 \u062c\u0645\u064a\u0639 \u0627\u0644\u062a\u0637\u0628\u064a\u0642\u0627\u062a";
    t[776] = "The maximum data transfer values indicate the theoretical maximum, and in practice will normally be much lower.";
    t[777] = "\u062a\u0634\u064a\u0631 \u0627\u0644\u0642\u064a\u0645 \u0627\u0644\u0642\u0635\u0648\u0649 \u0644\u0646\u0642\u0644 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0625\u0644\u0649 \u0627\u0644\u062d\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0627\u0644\u0646\u0638\u0631\u064a\u060c \u0648\u0639\u0627\u062f\u0629 \u0645\u0627 \u062a\u0643\u0648\u0646 \u0641\u064a \u0627\u0644\u0645\u0645\u0627\u0631\u0633\u0629 \u0627\u0644\u0639\u0645\u0644\u064a\u0629 \u0623\u0642\u0644 \u0645\u0646 \u0630\u0644\u0643 \u0628\u0643\u062b\u064a\u0631.";
    t[778] = "WARN - Firewalled with UDP Disabled";
    t[779] = "\u062a\u062d\u0630\u064a\u0631 - \u0645\u062d\u0645\u064a \u0645\u0639 \u062a\u0639\u0637\u064a\u0644 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u064a\u0648 \u062f\u064a \u0628\u064a";
    t[780] = "Select Stats for Graphing";
