    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "\u0627\u0644\u0631\u0642\u0645 \u0627\u0644\u0623\u0648\u0644 \u0647\u0648 \u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0630\u064a\u0646 \u062a\u0628\u0627\u062f\u0644 \u0645\u0639\u0647\u0645 \u0645\u0648\u062c\u0647\u0643 \u0631\u0633\u0627\u0626\u0644 \u0641\u064a \u0627\u0644\u062f\u0642\u0627\u0626\u0642 \u0627\u0644\u0642\u0644\u064a\u0644\u0629 \u0627\u0644\u0645\u0627\u0636\u064a\u0629. \u0642\u062f \u064a\u062a\u0631\u0627\u0648\u062d \u0647\u0630\u0627 \u0627\u0644\u0639\u062f\u062f \u0645\u0627 \u0628\u064a\u0646 8-10 \u0625\u0644\u0649 \u0645\u0626\u0627\u062a \u0639\u062f\u0629\u060c \u0627\u0639\u062a\u0645\u0627\u062f\u064b\u0627 \u0639\u0644\u0649 \u0625\u062c\u0645\u0627\u0644\u064a \u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0648\u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u0645\u0634\u062a\u0631\u0643 \u0648\u062d\u0631\u0643\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u0645\u0648\u0644\u062f\u0629 \u0645\u062d\u0644\u064a\u064b\u0627. \u0627\u0644\u0631\u0642\u0645 \u0627\u0644\u062b\u0627\u0646\u064a \u0647\u0648 \u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0645\u0644\u0627\u062d\u0638\u064a\u0646 \u062e\u0644\u0627\u0644 \u0627\u0644\u0633\u0627\u0639\u0629 \u0627\u0644\u0623\u062e\u064a\u0631\u0629 \u062a\u0642\u0631\u064a\u0628\u064b\u0627. \u0644\u0627 \u062f\u0627\u0639\u064a \u0644\u0644\u0642\u0644\u0642 \u0625\u0630\u0627 \u0627\u062e\u062a\u0644\u0641 \u0647\u0630\u0627\u0646 \u0627\u0644\u0639\u062f\u062f\u0627\u0646 \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631. <a href='/configstats#router.activePeers'>[\u062a\u0645\u0643\u064a\u0646 \u0627\u0644\u0631\u0633\u0645 \u0627\u0644\u0628\u064a\u0627\u0646\u064a]</a>.";
    t[838] = "This file should be used only for a very limited number of friends (less than 3).";
