    t[879] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u0633\u0645\u062d \u0628\u062a\u0639\u0637\u064a\u0644 \u0627\u062e\u062a\u0628\u0627\u0631\u0627\u062a SSU \u0644\u062a\u062d\u062f\u064a\u062f \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0645\u062d\u0645\u064a \u0628\u062c\u062f\u0627\u0631 \u0646\u0627\u0631\u064a \u0648\u064a\u0645\u0643\u0646 \u062a\u0645\u0643\u064a\u0646\u0647 \u0644\u0644\u0631\u0648\u0627\u062a\u0631 \u0627\u0644\u062a\u064a \u0644\u0627 \u0634\u0643 \u0623\u0646\u0647\u0627 \u063a\u064a\u0631 \u0645\u062d\u0645\u064a\u0629 \u0628\u062c\u062f\u0627\u0631 \u0646\u0627\u0631\u064a \u0648\u0644\u0643\u0646\u0647\u0627 \u062a\u0639\u0627\u0646\u064a \u0645\u0646 \u0642\u0636\u0627\u064a\u0627 \u0641\u0631\u0636 \u062c\u062f\u0627\u0631 \u0646\u0627\u0631\u064a \u0645\u062a\u0642\u0637\u0639\u0629. \u0641\u064a \u062d\u0627\u0644\u0629 \u062a\u0639\u0637\u064a\u0644 \u0627\u0644\u0627\u062e\u062a\u0628\u0627\u0631\u060c \u0643\u0644\u0627 SSU \u0648\u0640 NTCP \u064a\u062c\u0628 \u0623\u0646 \u064a\u0628\u0644\u063a \u0639\u0646 \u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u0639\u0627\u0645 \u0627\u0644\u062d\u0627\u0644\u064a \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0639\u0644\u0649 <a href=/info>\u0635\u0641\u062d\u0629 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0631\u0627\u0648\u062a\u0631</a>. [\u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u0645\u0637\u0644\u0648\u0628\u0629]";
