    t[968] = "Updating update policy to {0}";
    t[969] = "\u062a\u062d\u062f\u064a\u062b \u0633\u064a\u0627\u0633\u0629 \u0627\u0644\u062a\u062d\u062f\u064a\u062b \u0625\u0644\u0649 {0}";
    t[970] = "Advanced View";
    t[971] = "\u0639\u0631\u0636 \u0645\u062a\u0642\u062f\u0645";
    t[976] = "Externally reachable hostname or IP address";
    t[977] = "\u0627\u0633\u0645 \u0627\u0644\u0645\u0636\u064a\u0641 \u0623\u0648 \u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u0630\u064a \u064a\u0645\u0643\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u064a\u0647 \u062e\u0627\u0631\u062c\u064a\u064b\u0627";
    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "\u064a\u0639\u0645\u0644 \u062e\u0627\u062f\u0648\u0645\u0643 \u0627\u0644\u0648\u064a\u0628 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627 \u0639\u0644\u0649 <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>\u060c \u0644\u0643\u0646\u0647 \u063a\u064a\u0631 \u0645\u062a\u0627\u062d \u0644\u0644\u0622\u062e\u0631\u064a\u0646 \u062d\u062a\u0649 \u062a\u0642\u0648\u0645 \u0628\u0628\u062f\u0621 \u0627\u0646\u0641\u0627\u0642 <i>\u062e\u0627\u062f\u0648\u0645 I2P</i>. \u0628\u0639\u062f \u0628\u062f\u0621 \u0627\u0644\u0627\u0646\u0641\u0627\u0642\u060c \u0633\u064a\u0635\u0639\u0628 \u0627\u0644\u0639\u062b\u0648\u0631 \u0639\u0644\u0649 \u0645\u0648\u0642\u0639\u0643 \u0645\u0646 \u0642\u0628\u0644 \u0627\u0644\u0622\u062e\u0631\u064a\u0646. \u064a\u0645\u0643\u0646\u0643 \u0645\u062c\u0631\u062f \u0625\u062e\u0628\u0627\u0631 \u0627\u0644\u0646\u0627\u0633 \u0628\u0627\u0644\u0648\u062c\u0647\u0629 \u0623\u0648 \u0639\u0646\u0648\u0627\u0646 Base32\u060c \u0644\u0643\u0646 \u062d\u0638\u064b\u0627 \u0637\u064a\u0628\u064b\u0627\u060c \u0641\u0625\u0646 I2P \u0644\u062f\u064a\u0647 \u062f\u0644\u064a\u0644 \u0639\u0646\u0627\u0648\u064a\u0646 \u0644\u062a\u062e\u0632\u064a\u0646 \u0623\u0633\u0645\u0627\u0621 \u0627\u0644\u0646\u0637\u0627\u0642\u0627\u062a\u060c \u0648\u0645\u062e\u062a\u0644\u0641 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0627\u0644\u062a\u064a \u064a\u0645\u0643\u0646\u0643 <a href=/help/hostnameregistration>\u062a\u0633\u062c\u064a\u0644 \u0646\u0637\u0627\u0642 .i2p \u062c\u062f\u064a\u062f</a> \u0645\u062c\u0627\u0646\u064b\u0627.";
    t[984] = "Major Sybil Warning - above router is closer than average minimum distance";
