    t[1209] = "\u0645\u0634\u0627\u0647\u062f\u0629 \u0634\u0631\u0643\u0627\u062a \u0627\u0644\u062a\u0643\u0646\u0648\u0644\u0648\u062c\u064a\u0627 \u0627\u0644\u0643\u0628\u0631\u0649...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "\u0627\u0644\u0627\u0646\u062d\u0631\u0627\u0641 (\u0627\u0644\u0641\u0627\u0631\u0642) \u0644\u0633\u0627\u0639\u0629 \u062c\u0647\u0627\u0632\u0643 \u0627\u0644\u062d\u0627\u0633\u0648\u0628\u064a \u0645\u0642\u0627\u0631\u0646\u0629 \u0628\u0627\u0644\u0648\u0642\u062a \u0627\u0644\u0645\u0634\u062a\u0631\u0643 \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629 (\u0625\u0646 \u0648\u062c\u062f). \u064a\u062a\u0637\u0644\u0628 I2P \u0623\u0646 \u062a\u0643\u0648\u0646 \u0633\u0627\u0639\u0629 \u062c\u0647\u0627\u0632\u0643 \u0627\u0644\u062d\u0627\u0633\u0648\u0628\u064a \u062f\u0642\u064a\u0642\u0629. \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0627\u0646\u062d\u0631\u0627\u0641 \u0623\u0643\u062b\u0631 \u0645\u0646 \u062b\u0648\u0627\u0646\u064d \u0642\u0644\u064a\u0644\u0629\u060c \u064a\u0631\u062c\u0649 \u062a\u0635\u062d\u064a\u062d \u0627\u0644\u0645\u0634\u0643\u0644\u0629 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0636\u0628\u0637 \u0648\u0642\u062a \u062c\u0647\u0627\u0632\u0643 \u0627\u0644\u062d\u0627\u0633\u0648\u0628\u064a. \u0625\u0630\u0627 \u0644\u0645 \u064a\u062a\u0645\u0643\u0646 I2P \u0645\u0646 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a\u060c \u0642\u062f \u064a\u0634\u064a\u0631 \u0642\u0631\u0627\u0621\u0629 0ms. \u0645\u0644\u0627\u062d\u0638\u0629: \u0644\u0627 \u064a\u062a\u0645 \u0639\u0631\u0636 \u0647\u0630\u0627 \u0625\u0644\u0627 \u0641\u064a \u0627\u0644\u0642\u0633\u0645 <i>\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0645\u0648\u062c\u0647 (\u0645\u062a\u0642\u062f\u0645)</i>. \u064a\u0645\u0643\u0646\u0643 \u0625\u0636\u0627\u0641\u0629 \u0647\u0630\u0627 \u0627\u0644\u0642\u0633\u0645 \u0625\u0644\u0649 \u0634\u0631\u064a\u0637\u0643 \u0627\u0644\u062c\u0627\u0646\u0628\u064a \u0639\u0628\u0631 \u0635\u0641\u062d\u0629 <a href='/configsidebar'>\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a</a>.";
    t[1224] = "Sort by inbound rate";
    t[1225] = "\u062d\u0633\u0628 \u0645\u0639\u062f\u0644 \u0627\u0644\u062f\u0627\u062e\u0644";
    t[1236] = "Can I download torrents from non-I2P trackers?";
