    t[1253] = "\u0636\u0645\u0646 <i>\u062a\u062d\u062f\u064a\u062f \u0645\u0644\u0641 \u0645\u0636\u063a\u0648\u0637 \u0623\u0648 \u0645\u0644\u0641 su3</i> \u0627\u0646\u0642\u0631 \u0639\u0644\u0649 <i>\u062a\u0635\u0641\u062d...</i>";
