    t[1269] = "\u0628\u0631\u064a\u062f \u0627\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0645\u062c\u0647\u0648\u0644";
    t[1272] = "To migrate the key to a new router, or to setup multihoming (running the same service on multiple routers for redundancy and load-balancing), copy the backed up key to your .i2p directory and specify it in the new server tunnel, or replace the default key in the plugin folder (e.g. the zzzot plugin).";
    t[1273] = "\u0644\u0646\u0642\u0644 \u0627\u0644\u0645\u0641\u062a\u0627\u062d \u0625\u0644\u0649 \u0645\u0648\u062c\u0647 \u062c\u062f\u064a\u062f\u060c \u0623\u0648 \u0644\u062a\u0647\u064a\u0626\u0629 \u0645\u062a\u0639\u062f\u062f \u0627\u0644\u0645\u0636\u064a\u0641\u0627\u062a (\u062a\u0634\u063a\u064a\u0644 \u0646\u0641\u0633 \u0627\u0644\u062e\u062f\u0645\u0629 \u0639\u0644\u0649 \u0645\u0648\u062c\u0647\u0627\u062a \u0645\u062a\u0639\u062f\u062f\u0629 \u0644\u0644\u0625\u062d\u062a\u064a\u0627\u0637 \u0648\u062a\u0648\u0632\u064a\u0639 \u0627\u0644\u062d\u0645\u0644)\u060c \u0642\u0645 \u0628\u0646\u0633\u062e \u0627\u0644\u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0627\u062d\u062a\u064a\u0627\u0637\u064a \u0625\u0644\u0649 \u0645\u062c\u0644\u062f\u0643 .i2p \u0648\u062a\u062d\u062f\u064a\u062f\u0647 \u0641\u064a \u0646\u0641\u0642 \u0627\u0644\u062e\u0627\u062f\u0645 \u0627\u0644\u062c\u062f\u064a\u062f\u060c \u0623\u0648 \u0627\u0633\u062a\u0628\u062f\u0627\u0644 \u0627\u0644\u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0641\u064a \u0645\u062c\u0644\u062f \u0627\u0644\u0625\u0636\u0627\u0641\u0629 (\u0645\u062b\u0644 \u0632\u0648\u062a \u0627\u0644\u0625\u0636\u0627\u0641\u0629).";
