    t[1298] = "This setting permits an expiry time to be configured (in seconds) for bans enforced via blocklists. By default bans persist for the duration of the router session. [Restart required]";
    t[1299] = "\u064a\u0633\u0645\u062d \u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u0628\u062a\u0643\u0648\u064a\u0646 \u0648\u0642\u062a \u0627\u0646\u062a\u0647\u0627\u0621 \u0627\u0644\u0635\u0644\u0627\u062d\u064a\u0629 (\u0628\u0627\u0644\u062b\u0648\u0627\u0646\u064a) \u0644\u0639\u0645\u0644\u064a\u0627\u062a \u0627\u0644\u062d\u0638\u0631 \u0627\u0644\u0645\u0641\u0631\u0648\u0636\u0629 \u0639\u0628\u0631 \u0642\u0648\u0627\u0626\u0645 \u0627\u0644\u062d\u0638\u0631. ";
