    t[1325] = "I2CP";
    t[1326] = "This mode enhances anonymity by preventing correlation between public IP address changes and your router identity. Both your router identity and UDP port will be changed.";
    t[1327] = "\u0647\u0630\u0627 \u0627\u0644\u0648\u0636\u0639 \u064a\u0639\u0632\u0632 \u0627\u0644\u0633\u0631\u064a\u0629 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0645\u0646\u0639 \u0627\u0644\u0627\u0631\u062a\u0628\u0627\u0637 \u0628\u064a\u0646 \u062a\u063a\u064a\u064a\u0631 \u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u0639\u0627\u0645 \u0648\u0647\u0648\u064a\u0629 \u0645\u0648\u062c\u0647\u0643. \u0633\u064a\u062a\u0645 \u062a\u063a\u064a\u064a\u0631 \u0643\u0644 \u0645\u0646 \u0647\u0648\u064a\u0629 \u0627\u0644\u0645\u0648\u062c\u0647 \u0648\u0627\u0644\u0645\u0646\u0641\u0630 UDP.";
