    t[1343] = "susidns";
    t[1350] = "If I2P appears to be using too much ram, you can force the router to run the garbage collection routine to free up memory.";
    t[1351] = "\u0625\u0630\u0627 \u0628\u062f\u0627 \u0623\u0646 I2P \u064a\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0630\u0627\u0643\u0631\u0629 \u0627\u0644\u0648\u0635\u0648\u0644 \u0627\u0644\u0639\u0634\u0648\u0627\u0626\u064a\u060c \u0641\u064a\u0645\u0643\u0646\u0643 \u0625\u062c\u0628\u0627\u0631 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0639\u0644\u0649 \u062a\u0634\u063a\u064a\u0644 \u0631\u0648\u062a\u064a\u0646 \u062c\u0645\u0639 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0645\u0647\u0645\u0644\u0629 \u0644\u062a\u062d\u0631\u064a\u0631 \u0627\u0644\u0630\u0627\u0643\u0631\u0629.";
