    t[1381] = "\u0639\u0646\u062f \u062a\u0639\u064a\u064a\u0646\u0647 \u0639\u0644\u0649 \u0627\u0644\u0635\u062d\u064a\u062d\u060c \u0625\u0630\u0627 \u0643\u0627\u0646 \u0645\u0648\u062c\u0647\u0643 \u064a\u062e\u062f\u0645 \u0643\u062f\u0648\u0645\u0629 \u0641\u064a\u0636 \u0644\u0644\u0634\u0628\u0643\u0629\u060c \u0633\u064a\u062a\u0645 \u0625\u062e\u0641\u0627\u0621 \u0645\u0634\u0627\u0631\u0643\u062a\u0643 \u0643\u0640 <a href=/configadvanced#ffconf>\u062f\u0648\u0645\u0629 \u0641\u064a\u0636</a> \u0645\u0646 \u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a \u0627\u0644\u0623\u062e\u0631\u0649.";
