    t[1404] = "This setting determines which <a href=/profiles#profile_defs>peer capabilities</a> will not be used to build your router's tunnels. e.g. <code>router.excludePeerCaps=LMN</code>";
    t[1405] = "\u064a\u062d\u062f\u062f \u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f <a href=/profiles";
