    t[1669] = "('MM' = \u0634\u0647\u0631\u060c 'dd' = \u064a\u0648\u0645\u060c 'HH' = \u0633\u0627\u0639\u0629\u060c 'mm' = \u062f\u0642\u064a\u0642\u0629\u060c 'ss' = \u062b\u0627\u0646\u064a\u0629\u060c 'SSS' = \u0645\u0644\u0644\u064a \u062b\u0627\u0646\u064a\u0629)";
    t[1670] = "Invalid address";
    t[1671] = "\u0639\u0646\u0648\u0627\u0646 \u062e\u0627\u0637\u0626";
