    t[1673] = "\u0646\u0641\u0642";
    t[1676] = "and any that end up in that file will get throttled in the future";
    t[1677] = "\u0648\u0633\u0648\u0641 \u062a\u062a\u0645 \u062a\u062d\u0643\u064a\u0645 \u0623\u064a \u0648\u062c\u0647\u0629 \u062a\u0646\u062a\u0647\u064a \u0628\u0647\u0627 \u0641\u064a \u0630\u0644\u0643 \u0627\u0644\u0645\u0644\u0641 \u0641\u064a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644";
    t[1684] = "News &amp; Reviews";
    t[1685] = "\u0627\u0644\u0623\u062e\u0628\u0627\u0631 \u0648\u0627\u0644\u0645\u0631\u0627\u062c\u0639\u0627\u062a";
    t[1686] = "This is the number of peers your router has available for building your exploratory tunnels which are used to determine network performance. It is generally in the range 8-75. The fast peers are included in the high capacity tier. Your high capacity peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.highCapacityPeers'>[Enable graphing]</a>";
    t[1687] = "\u0647\u0630\u0627 \u0627\u0644\u0639\u062f\u062f \u0627\u0644\u0630\u064a \u064a\u062a\u0648\u0641\u0631 \u0644\u062f\u0649 \u0645\u0648\u062c\u0647\u0643 \u0644\u0628\u0646\u0627\u0621 \u0623\u0646\u0641\u0627\u0642\u0643 \u0627\u0644\u0627\u0633\u062a\u0643\u0634\u0627\u0641\u064a\u0629 \u0627\u0644\u062a\u064a \u062a\u0633\u062a\u062e\u062f\u0645 \u0644\u062a\u062d\u062f\u064a\u062f \u0623\u062f\u0627\u0621 \u0627\u0644\u0634\u0628\u0643\u0629. \u0628\u0634\u0643\u0644 \u0639\u0627\u0645 \u064a\u062a\u0631\u0627\u0648\u062d \u0628\u064a\u0646 8-75. \u064a\u062a\u0645 \u062a\u0636\u0645\u064a\u0646 \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0633\u0631\u064a\u0639\u064a \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0641\u064a \u0627\u0644\u0637\u0628\u0642\u0629 \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0633\u0639\u0629. \u064a\u062a\u0645 \u0639\u0631\u0636 \u0623\u0642\u0631\u0627\u0646\u0643 \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0633\u0639\u0629 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href='/profiles'>\u0635\u0641\u062d\u0629 \u0627\u0644\u0645\u0644\u0641\u0627\u062a</a>. <a href='/configstats#router.highCapacityPeers'>[\u062a\u0645\u0643\u064a\u0646 \u0627\u0644\u0631\u0633\u0645 \u0627\u0644\u0628\u064a\u0627\u0646\u064a]</a>";
