    t[1802] = "This setting (in seconds) allows you to manually configure the amount of time to wait before an attempt to refresh a router is determined to have failed. [The default is 20 seconds]";
    t[1803] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f (\u0628\u0627\u0644\u062b\u0648\u0627\u0646\u064a) \u064a\u062a\u064a\u062d \u0644\u0643 \u062a\u0643\u0648\u064a\u0641 \u0645\u062f\u0629 \u0627\u0644\u0627\u0646\u062a\u0638\u0627\u0631 \u064a\u062f\u0648\u064a\u0627\u064b \u0642\u0628\u0644 \u0623\u0646 \u064a\u0639\u062a\u0628\u0631 \u0645\u062d\u0627\u0648\u0644\u0629 \u062a\u062d\u062f\u064a\u062b \u0631\u0627\u0648\u062a\u0631 \u0641\u0627\u0634\u0644\u0629. [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 20 \u062b\u0627\u0646\u064a\u0629]";
