    t[2207] = "\u0625\u0635\u062f\u0627\u0631";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "\u062a\u062e\u062a\u0627\u0631 I2P \u0645\u0646\u0641\u0630\u064b\u0627 \u0639\u0634\u0648\u0627\u0626\u064a\u064b\u0627 \u0628\u064a\u0646 9000 \u0648\u0640 31000 \u0644\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0645\u0648\u062c\u0647\u0627\u062a \u0623\u062e\u0631\u0649 \u0639\u0646\u062f \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0628\u0631\u0646\u0627\u0645\u062c \u0644\u0644\u0645\u0631\u0629 \u0627\u0644\u0623\u0648\u0644\u0649\u060c \u0623\u0648 \u0639\u0646\u062f\u0645\u0627 \u064a\u062a\u063a\u064a\u0631 \u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u062a\u0634\u063a\u064a\u0644 \u0641\u064a <a href=/confignet#ipchange>\u0648\u0636\u0639 \u0627\u0644\u062d\u0627\u0633\u0648\u0628 \u0627\u0644\u0645\u062d\u0645\u0648\u0644</a>. \u064a\u062a\u0645 \u0639\u0631\u0636 \u0627\u0644\u0645\u0646\u0641\u0630 <a href=/confignet#udpconfig>\u0627\u0644\u0645\u062e\u062a\u0627\u0631</a> \u0641\u064a \u0635\u0641\u062d\u0629 <a href=/confignet>\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0634\u0628\u0643\u0629</a>.";
    t[2212] = "Message send rate (B/s)";
    t[2213] = "\u0645\u0639\u062f\u0644 \u0625\u0631\u0633\u0627\u0644 \u0627\u0644\u0631\u0633\u0627\u0644\u0629 (B/s)";
    t[2214] = "Update or check already in progress";
    t[2215] = "\u0627\u0644\u062a\u062d\u062f\u064a\u062b \u0623\u0648 \u0627\u0644\u062a\u062d\u0642\u0642 \u0642\u064a\u062f \u0627\u0644\u062a\u0642\u062f\u0645 \u0628\u0627\u0644\u0641\u0639\u0644";
    t[2218] = "Log date format";
    t[2219] = "\u062a\u0627\u0631\u064a\u062e \u0627\u0644\u0633\u062c\u0644";
    t[2226] = "Less than 256MB allocated to the JVM";
    t[2227] = "\u0623\u0642\u0644 \u0645\u0646 256 \u0645\u064a\u062c\u0627\u0628\u0627\u064a\u062a \u0645\u062e\u0635\u0635\u0629 \u0644\u0640 JVM";
    t[2230] = "Average closest floodfill distance";
    t[2231] = "\u0645\u062a\u0648\u0633\u0637 \u200b\u200b\u0623\u0642\u0631\u0628 \u0645\u0633\u0627\u0641\u0629 \u0644\u0631\u062f\u0645 \u0627\u0644\u0641\u064a\u0636\u0627\u0646";
    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "\u0633\u064a\u0633\u062a\u063a\u0631\u0642 \u0627\u0644\u0623\u0645\u0631 10 \u062f\u0642\u0627\u0626\u0642 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u0645\u0646\u0630 \u0628\u062f\u0627\u064a\u0629 \u0639\u0645\u0644 \u0645\u0648\u062c\u0647\u0643 \u062d\u062a\u0649 \u064a\u0642\u0628\u0644 \u0628\u0628\u0646\u0627\u0621 \u0623\u0646\u0641\u0627\u0642 \u0645\u0634\u0627\u0631\u0643\u0629 \u0644\u0644\u062a\u0623\u0643\u062f \u0645\u0646 \u0627\u0633\u062a\u0642\u0631\u0627\u0631 \u0627\u0644\u0645\u0648\u062c\u0647 \u0648\u0627\u0631\u062a\u0628\u0627\u0637\u0647 \u0628\u0646\u062c\u0627\u062d \u0628\u0627\u0644\u0634\u0628\u0643\u0629.";
    t[2234] = "Last Heard From";
    t[2235] = "\u0622\u062e\u0631 \u0633\u0645\u0627\u0639 \u0645\u0646";
    t[2236] = "midnight";
    t[2237] = "\u0644\u064a\u0644";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "\u0645\u0642\u062f\u0645\u0629 \u0644\u0637\u064a\u0641\u0629 \u0644\u0640 I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "\u0627\u0644\u0648\u0642\u062a \u0627\u0644\u0630\u064a \u062a\u0633\u062a\u063a\u0631\u0642\u0647 \u0627\u0644\u0645\u0647\u0627\u0645 \u0641\u064a \u0627\u0627\u0644\u0627\u0646\u062a\u0638\u0627\u0631 \u0642\u0628\u0644 \u0627\u0644\u062a\u0646\u0641\u064a\u0630. \u064a\u062a\u0645 \u0639\u0631\u0636 \u0637\u0627\u0628\u0648\u0631 \u0627\u0644\u0645\u0647\u0627\u0645 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href='/jobs'>\u0627\u0644\u0645\u0647\u0627\u0645</a>. \u0644\u0644\u0623\u0633\u0641\u060c \u0647\u0646\u0627\u0643 \u0623\u0637\u0627\u0628\u064a\u0631 \u0645\u0647\u0627\u0645 \u0623\u062e\u0631\u0649 \u062f\u0627\u062e\u0644 \u0627\u0644\u0645\u0648\u062c\u0647 \u0642\u062f \u062a\u0643\u0648\u0646 \u0645\u0632\u062f\u062d\u0645\u0629\u060c \u0648\u0644\u0627 \u064a\u062a\u0648\u0641\u0631 \u062d\u0627\u0644\u062a\u0647\u0627 \u0641\u064a \u0644\u0648\u062d\u0629 \u0627\u0644\u062a\u062d\u0643\u0645. \u064a\u0641\u062a\u0631\u0636 \u0623\u0646 \u064a\u0643\u0648\u0646 \u062a\u0623\u062e\u0631 \u0627\u0644\u0645\u0647\u0627\u0645 \u0635\u0641\u0631\u064a\u064b\u0627 \u0639\u0627\u062f\u0629. \u0625\u0630\u0627 \u0627\u0633\u062a\u0645\u0631 \u0641\u064a \u0627\u0644\u0627\u0631\u062a\u0641\u0627\u0639 \u0639\u0646 500 \u0645\u0644\u064a \u062b\u0627\u0646\u064a\u0629 \u0628\u0634\u0643\u0644 \u0645\u0633\u062a\u0645\u0631\u060c \u0641\u0625\u0645\u0627 \u0623\u0646 \u062c\u0647\u0627\u0632\u0643 \u0628\u0637\u0626 \u062c\u062f\u064b\u0627 \u0623\u0648 \u062a\u0648\u0627\u062c\u0647 \u0627\u0644\u0634\u0628\u0643\u0629 \u0645\u0634\u0643\u0644\u0627\u062a \u0627\u062a\u0635\u0627\u0644 \u0623\u0648 \u0623\u0646 \u0627\u0644\u0645\u0648\u062c\u0647 \u064a\u0639\u0627\u0646\u064a \u0645\u0634\u0627\u0643\u0644 \u062e\u0637\u064a\u0631\u0629. <a href='/configstats#jobQueue.jobLag'>[\u062a\u0645\u0643\u064a\u0646 \u0627\u0644\u0631\u0633\u0645 \u0627\u0644\u0628\u064a\u0627\u0646\u064a]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "\u062a\u0643\u0648\u064a\u0646 \u062a\u062d\u062f\u064a\u062b\u0627\u062a I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "\u0642\u0628\u0644 \u0625\u062e\u0628\u0627\u0631 \u0627\u0644\u0639\u0627\u0644\u0645 \u0628\u0645\u0648\u0642\u0639\u0643 \u0627\u0644\u062c\u062f\u064a\u062f\u060c \u064a\u062c\u0628 \u0623\u0646 \u062a\u0636\u064a\u0641 \u0628\u0639\u0636 \u0627\u0644\u0645\u062d\u062a\u0648\u0649. \u0627\u0630\u0647\u0628 \u0625\u0644\u0649 \u062f\u0644\u064a\u0644 \u062c\u0630\u0631 \u0627\u0644\u062e\u0627\u062f\u0648\u0645 <a href=#rootdir>\u0627\u0644\u0645\u0630\u0643\u0648\u0631 \u0623\u0639\u0644\u0627\u0647</a> \u0648\u0627\u0633\u062a\u0628\u062f\u0644 \u0635\u0641\u062d\u0629 \u062a\u062d\u0648\u064a\u0644 <i>index.html</i> \u0628\u0645\u062d\u062a\u0648\u0627\u0643 \u0627\u0644\u062e\u0627\u0635. \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u062d\u062a\u0627\u062c \u0625\u0644\u0649 \u0642\u0627\u0644\u0628 \u0644\u0645\u0648\u0642\u0639 \u0628\u0633\u064a\u0637\u060c \u0641\u0627\u0633\u062a\u062e\u062f\u0645 <a href=http://127.0.0.1:7658/help/pagetemplate.html>\u0647\u0630\u0647 \u0627\u0644\u0635\u0641\u062d\u0629</a> \u0628\u062d\u0631\u064a\u0629. \u0625\u0630\u0627 \u062a\u0645 \u0625\u0639\u0627\u062f\u062a\u0643 \u0625\u0644\u0649 \u0647\u0630\u0647 \u0627\u0644\u0635\u0641\u062d\u0629 \u0628\u0639\u062f \u062a\u062d\u0631\u064a\u0631 \u0627\u0644\u0645\u062d\u062a\u0648\u0649\u060c \u062d\u0627\u0648\u0644 \u0645\u0633\u062d \u0630\u0627\u0643\u0631\u0629 \u062a\u062e\u0632\u064a\u0646 \u0627\u0644\u0648\u064a\u0628 \u0644\u0645\u062a\u0635\u0641\u062d\u0643.";
