    t[2273] = "\u0622\u062e\u0631 \u0623\u062e\u0628\u0627\u0631 \u0627\u0644\u0623\u0628\u062d\u0627\u062b \u0627\u0644\u0639\u0644\u0645\u064a\u0629";
