    t[2287] = "\u0627\u0644\u062a\u0639\u0627\u0631\u064a\u0641";
    t[2288] = "Show all current peer connections";
    t[2289] = "\u0623\u0638\u0647\u0631 \u0627\u062a\u0635\u0627\u0644\u0627\u062a \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u064a\u0646";
    t[2292] = "Signed by";
    t[2293] = "\u0645\u0648\u0642\u0639 \u0645\u0646 \u0637\u0631\u0641";
    t[2294] = "The <i class=example>default</i> threshold applies to any remote destination not explicitly listed in the definition or in any of the referenced files. To set a default threshold use the keyword <i class=example>default</i>.";
    t[2295] = "\u062a\u0646\u0637\u0628\u0642 \u0639\u062a\u0628\u0629 <i class=example>\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629</i> \u0639\u0644\u0649 \u0623\u064a \u0648\u062c\u0647\u0629 \u0639\u0646 \u0628\u064f\u0639\u062f \u063a\u064a\u0631 \u0645\u062f\u0631\u062c\u0629 \u0635\u0631\u0627\u062d\u0629 \u0641\u064a \u0627\u0644\u062a\u0639\u0631\u064a\u0641 \u0623\u0648 \u0641\u064a \u0623\u064a \u0645\u0646 \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0627\u0644\u0645\u0631\u062c\u0639\u064a\u0629. \u0644\u062a\u0639\u064a\u064a\u0646 \u0639\u062a\u0628\u0629 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629 \u0627\u0633\u062a\u062e\u062f\u0645 \u0645\u0641\u062a\u0627\u062d <i class=example>default</i>.";
    t[2306] = "Estimated total leasesets";
    t[2307] = "\u0645\u062c\u0645\u0648\u0639 \u0627\u0644\u0625\u064a\u062c\u0627\u0631\u0627\u062a \u0627\u0644\u0645\u0642\u062f\u0631\u0629";
    t[2308] = "Building tunnels";
    t[2309] = "\u062c\u0627\u0631\u064a \u0628\u0646\u0627\u0621 \u0627\u0644\u0646\u0641\u0642";
    t[2310] = "Send on";
    t[2311] = "\u0627\u0631\u0633\u0627\u0644 \u0627\u0644\u0649";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "\u0625\u0630\u0627 \u0643\u0627\u0646 \u0644\u062f\u0649 \u0645\u0648\u062c\u0647\u0643 10 \u0623\u0642\u0631\u0627\u0646 \u0646\u0634\u0637\u0629 \u0623\u0648 \u0623\u0643\u062b\u0631\u060c \u0641\u0643\u0644 \u0634\u064a\u0621 \u0628\u062d\u0627\u0644\u0647 \u0627\u0644\u0637\u0628\u064a\u0639\u064a\u0629. \u064a\u062c\u0628 \u0639\u0644\u0649 \u0627\u0644\u0645\u0648\u062c\u0647 \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u062a\u0635\u0627\u0644\u0627\u062a \u0645\u0639 \u0628\u0636\u0639\u0629 \u0623\u0642\u0631\u0627\u0646 \u0641\u064a \u062c\u0645\u064a\u0639 \u0627\u0644\u0623\u0648\u0642\u0627\u062a. \u0623\u0641\u0636\u0644 \u0637\u0631\u064a\u0642\u0629 \u0644\u0644\u0628\u0642\u0627\u0621 \"\u0623\u0643\u062b\u0631 \u0627\u062a\u0635\u0627\u0644\u0627\" \u0628\u0627\u0644\u0634\u0628\u0643\u0629 \u0647\u064a <a href=/config>\u0645\u0634\u0627\u0631\u0643\u0629 \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0646\u0637\u0627\u0642</a>.";
    t[2320] = "Not enough shared bandwidth to build transit tunnels.";
    t[2321] = "\u0644\u0627 \u064a\u0648\u062c\u062f \u0639\u0631\u0636 \u0646\u0637\u0627\u0642 \u062a\u0631\u062f\u062f\u064a \u0645\u0634\u062a\u0631\u0643 \u0643\u0627\u0641\u064d \u0644\u0628\u0646\u0627\u0621 \u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0646\u0642\u0644.";
    t[2332] = "Congestion";
    t[2333] = "\u0627\u0632\u062f\u062d\u0627\u0645";
    t[2334] = "Graph Data";
    t[2335] = "\u0631\u0633\u0645 \u0628\u064a\u0627\u0646\u064a";
    t[2338] = "You must enter a key";
    t[2339] = "\u0639\u0644\u064a\u0643 \u0627\u062f\u062e\u0627\u0644 \u0645\u0641\u062a\u0627\u062d";
    t[2342] = "SymmetricNAT";
    t[2343] = "\u0645\u062a\u0645\u0627\u062b\u0644";
    t[2364] = "Some basic indications of router overload:";
    t[2365] = "\u0628\u0639\u0636 \u0627\u0644\u0645\u0624\u0634\u0631\u0627\u062a \u0627\u0644\u0623\u0633\u0627\u0633\u064a\u0629 \u0644\u062d\u0645\u0644 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u0632\u0627\u0626\u062f:";
    t[2370] = "Glossary";
    t[2371] = "\u0627\u0644\u0645\u0633\u0631\u062f";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "\u0644\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0627\u0633\u0645 \u0645\u0636\u064a\u0641 \u062e\u0627\u0635 \u0628\u0643\u060c \u064a\u0648\u0641\u0631 \u0645\u0633\u062c\u0644\u0648 \u0645\u062c\u0627\u0644\u0627\u062a I2P \u0645\u062b\u0644 <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> \u0623\u0648 <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> \u062e\u062f\u0645\u0627\u062a \u062a\u0633\u062c\u064a\u0644 \u062a\u0633\u0645\u062d \u0644\u0643 \u0628\u062a\u0633\u062c\u064a\u0644 \u0648\u0625\u062f\u0627\u0631\u0629 \u0627\u0633\u0645 \u0645\u0636\u064a\u0641 .i2p \u0623\u0648 \u0646\u0637\u0627\u0642 \u0641\u0631\u0639\u064a \u0633\u064a\u062a\u0645 \u0646\u0634\u0631\u0647 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629. \u0642\u062f \u062a\u0637\u0644\u0628 \u0628\u0639\u0636 \u0645\u0648\u0627\u0642\u0639 \u0627\u0644\u062a\u0633\u062c\u064a\u0644 \u0639\u0646\u0648\u0627\u0646 <i>B64 \u0627\u0644\u0648\u062c\u0647\u0629</i> \u0644\u0644\u0646\u0641\u0642/\u0627\u0644\u062e\u062f\u0645\u0629 \u0627\u0644\u062a\u064a \u062a\u0631\u063a\u0628 \u0641\u064a \u0631\u0628\u0637\u0647\u0627 \u0628\u0627\u0633\u0645 \u0645\u0636\u064a\u0641\u060c \u0648\u064a\u062c\u0628 \u0623\u0646 \u062a\u0642\u0648\u0645 \u0628\u0646\u0633\u062e\u0647\u0627 \u0645\u0646 \u0642\u0633\u0645 <i>\u0627\u0644\u0648\u062c\u0647\u0629 \u0627\u0644\u0645\u062d\u0644\u064a\u0629</i> \u0639\u0644\u0649 <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>\u0635\u0641\u062d\u0629 \u062a\u0643\u0648\u064a\u0646 \u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642</a>.";
