    t[2579] = "\u064a\u0645\u0643\u0646 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0639\u062f\u064a\u062f \u0645\u0646 \u0627\u0644\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a \u0641\u064a \u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a \u0644\u0643\u064a <a href='/configstats'>\u064a\u062a\u0645 \u0631\u0633\u0645\u0647\u0627 \u0628\u0627\u0644\u0631\u0633\u0648\u0645 \u0627\u0644\u0628\u064a\u0627\u0646\u064a\u0629</a> \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u062a\u062d\u0644\u064a\u0644. \u0643\u0645\u0627 \u064a\u0645\u0643\u0646\u0643 \u062a\u062e\u0635\u064a\u0635 \u0627\u0644\u0623\u0642\u0633\u0627\u0645 \u0627\u0644\u062a\u064a \u062a\u0638\u0647\u0631 \u0641\u064a \u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a \u0648\u0645\u0648\u0642\u0639\u0647\u0627 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href='/configsidebar'>\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u0627\u0644\u062e\u0627\u0635 \u0628\u0627\u0644\u0646\u0641\u0642 \u064a\u0633\u0645\u062d \u0644\u0643 \u0628\u062a\u0645\u0643\u064a\u0646 \u0623\u0648 \u062a\u0639\u0637\u064a\u0644 \u0627\u0644\u0631\u062f\u0648\u062f \u0639\u0644\u0649 \u0627\u0644\u0627\u0633\u062a\u0641\u0633\u0627\u0631\u0627\u062a \u0627\u0644\u0645\u0631\u0633\u0644\u0629 \u0625\u0644\u0649 \u0627\u0644\u062e\u0648\u0627\u062f\u0645 \u0627\u0644\u0645\u0636\u064a\u0641\u0629 \u0628\u0648\u0627\u0633\u0637\u0629 \u0627\u0644\u0631\u0627\u0648\u062a\u0631. \u0644\u062a\u0639\u0637\u064a\u0644 \u0627\u0644\u0627\u0633\u062a\u0641\u0633\u0627\u0631\u0627\u062a\u060c \u064a\u062c\u0628 \u0625\u0636\u0627\u0641\u0629 \u0627\u0644\u0633\u0637\u0631 <code>i2p.streaming.answerPings=false</code> \u0625\u0644\u0649 \u0642\u0633\u0645 <i>\u0627\u0644\u062e\u064a\u0627\u0631\u0627\u062a \u0627\u0644\u0645\u062e\u0635\u0635\u0629</i> \u0644\u062a\u0643\u0648\u064a\u0641 \u0627\u0644\u062e\u0627\u062f\u0645 \u0641\u064a \u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642.";
    t[2592] = "Max";
    t[2593] = "\u0645\u0627\u0643\u0633";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0631\u063a\u0628 \u0628\u062a\u062b\u0628\u064a\u062a \u0627\u0644\u062a\u062d\u062f\u064a\u062b\u0627\u062a \u063a\u064a\u0631 \u0627\u0644\u0645\u0648\u0642\u0651\u0639\u0629 \u0644\u0640I2P (.zip)\u060c \u064a\u062c\u0628 \u0625\u0636\u0627\u0641\u0629 \u0647\u0630\u0627 \u0625\u0644\u0649 \u0645\u0644\u0641 <code>router.config</code> \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0645\u0627 \u0644\u0645 \u062a\u0643\u0646 \u0642\u062f \u0643\u0648\u0651\u0646\u062a \u0628\u0627\u0644\u0641\u0639\u0644 <code>routerconsole.advanced=true</code>\u060c \u0648\u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u062d\u0627\u0644\u0629 \u0641\u0625\u0646 \u0647\u0630\u0627 \u0627\u0644\u062e\u064a\u0627\u0631 \u0645\u0632\u0648\u0651\u062f \u0628\u0627\u0644\u0641\u0639\u0644. \u0645\u0644\u0627\u062d\u0638\u0629: \u0627\u0628\u062a\u062f\u0627\u0621\u064b \u0645\u0646 I2P+ 0.9.48+\u060c \u064a\u062a\u0645 \u062a\u0645\u0643\u064a\u0646 \u062a\u062b\u0628\u064a\u062a <a href=/configupdate#i2pupdates>\u0627\u0644\u062a\u062d\u062f\u064a\u062b\u0627\u062a \u063a\u064a\u0631 \u0627\u0644\u0645\u0648\u0642\u0651\u0639\u0629</a> \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a.";
