    t[2608] = "The current external IP address reported by UPnP is {0}";
    t[2609] = "\u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u0627\u0644\u062d\u0627\u0644\u064a \u0627\u0644\u0630\u064a \u062a\u0645 \u0627\u0644\u0625\u0628\u0644\u0627\u063a \u0639\u0646\u0647 \u0628\u0648\u0627\u0633\u0637\u0629 UPnP \u0647\u0648 {0}";
    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0639\u0631\u0641 \u0634\u062e\u0635\u064b\u0627 \u062a\u062b\u0642 \u0628\u0647 \u064a\u0633\u062a\u062e\u062f\u0645 I2P\u060c \u0627\u0637\u0644\u0628 \u0645\u0646\u0647 \u0625\u0631\u0633\u0627\u0644 \u0645\u0644\u0641 \u0625\u0639\u0627\u062f\u0629 \u0628\u0630\u0631 \u062a\u0645 \u0625\u0646\u0634\u0627\u0624\u0647 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0647\u0630\u0647 \u0627\u0644\u0635\u0641\u062d\u0629 \u0641\u064a \u0644\u0648\u062d\u0629 \u0645\u0631\u0627\u0642\u0628\u0629 \u0645\u0648\u062c\u0647\u0647\u0645. \u062b\u0645 \u0627\u062e\u062a\u0631 \u062e\u064a\u0627\u0631 <i>\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631 \u0645\u0646 \u0627\u0644\u0645\u0644\u0641</i> \u0641\u064a {0} \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0645\u0644\u0641 \u0627\u0644\u0630\u064a \u062a\u0644\u0642\u064a\u062a\u0647.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[2621] = "\u0644\u062a\u0645\u0643\u064a\u0646 \u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0627\u0644\u062c\u0644\u0633\u0629 \u0641\u0642\u0637 \u0639\u0644\u0649 \u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0639\u0645\u064a\u0644\u060c \u0642\u0645 \u0628\u062a\u0646\u0634\u064a\u0637 <a href=\"/help/advancedsettings\">\u0627\u0644\u0648\u0636\u0639 \u0627\u0644\u0645\u062a\u0642\u062f\u0645</a> \u0644\u0648\u062d\u062f\u0629 \u0627\u0644\u062a\u062d\u0643\u0645.";
