    t[2643] = "\u0631\u0633\u0645 \u0628\u064a\u0627\u0646\u064a \u0644\u0644\u0628\u0627\u0646\u062f\u0648\u064a\u062f\u062b";
    t[2654] = "Manage your I2P hosts file here (I2P domain name resolution)";
    t[2655] = "\u0625\u062f\u0627\u0631\u0629 \u0645\u0644\u0641 \u0645\u0636\u064a\u0641\u0627\u062a I2P \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0647\u0646\u0627 (\u062a\u062d\u0644\u064a\u0644 \u0627\u0633\u0645 \u0645\u062c\u0627\u0644 I2P)";
    t[2656] = "Estimated total floodfills";
    t[2657] = "\u0625\u062c\u0645\u0627\u0644\u064a \u0627\u0644\u0641\u064a\u0636\u0627\u0646\u0627\u062a \u0627\u0644\u0645\u0642\u062f\u0631\u0629";
    t[2658] = "Show systray icon";
    t[2659] = "\u0623\u0638\u0647\u0631 \u0627\u0644\u0623\u064a\u0642\u0648\u0646\u0629";
    t[2660] = "Exploratory";
    t[2661] = "\u062a\u0635\u0641\u062d";
    t[2664] = "Same IPv6 /48 as us";
    t[2665] = "\u0646\u0641\u0633 IPv6 /48 \u0645\u062b\u0644\u0646\u0627";
    t[2670] = "Or to deny all unspecified destinations:";
    t[2671] = "\u0623\u0648 \u0644\u062d\u0638\u0631 \u062c\u0645\u064a\u0639 \u0627\u0644\u0648\u062c\u0647\u0627\u062a \u063a\u064a\u0631 \u0627\u0644\u0645\u062d\u062f\u062f\u0629:";
    t[2672] = "Peers we've been talking to in the last minute / last hour";
    t[2673] = "\u0627\u0644\u0632\u0645\u0644\u0627\u0621 \u0627\u0644\u0630\u064a\u0646 \u062a\u062d\u062f\u062b\u0646\u0627 \u0625\u0644\u064a\u0647\u0645 \u0641\u064a \u0627\u0644\u062f\u0642\u0627\u0626\u0642 \u0627\u0644\u0642\u0644\u064a\u0644\u0629 \u0627\u0644\u0645\u0627\u0636\u064a\u0629/\u0627\u0644\u0633\u0627\u0639\u0629 \u0627\u0644\u0645\u0627\u0636\u064a\u0629";
    t[2676] = "Open console on startup";
    t[2677] = "\u0641\u062a\u062d \u0648\u062d\u062f\u0629 \u0627\u0644\u062a\u062d\u0643\u0645 \u0639\u0646\u062f \u0628\u062f\u0621 \u0627\u0644\u062a\u0634\u063a\u064a\u0644";
    t[2680] = "Review possible sybils in network database";
    t[2681] = "\u0642\u0645 \u0628\u0645\u0631\u0627\u062c\u0639\u0629 \u0631\u0645\u0648\u0632 \u0627\u0644\u0639\u0631\u0627\u0641\u0629 \u0627\u0644\u0645\u062d\u062a\u0645\u0644\u0629 \u0641\u064a \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629";
    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "\u062a\u0643\u0648\u064a\u0646 \u0627\u0631\u062a\u0628\u0627\u0637 \u0634\u0628\u0643\u0629 WAN Ethernet";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f (\u0628\u0627\u0644\u062b\u0648\u0627\u0646\u064a) \u064a\u062a\u064a\u062d \u0644\u0643 \u062a\u062c\u0627\u0648\u0632 \u0627\u0644\u062a\u0623\u062e\u064a\u0631 \u0628\u064a\u0646 \u062a\u0634\u063a\u064a\u0644\u0627\u062a \u0645\u0647\u0645\u0629 \u0627\u0633\u062a\u0643\u0634\u0627\u0641 \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u062a\u064a \u062a\u062d\u0627\u0648\u0644 \u062a\u062d\u062f\u064a\u062f \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u062c\u062f\u062f \u0644\u0625\u0636\u0627\u0641\u062a\u0647\u0645 \u0625\u0644\u0649 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u064a\u0629. \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0633\u062a\u0634\u062a\u063a\u0644 \u0627\u0644\u0645\u0647\u0645\u0629 \u0643\u0644 80 \u062b\u0627\u0646\u064a\u0629\u060c \u0623\u0648 \u0643\u0644 3 \u062f\u0642\u0627\u0626\u0642 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u064a\u0639\u0627\u0646\u064a \u0645\u0646 \u062a\u0623\u062e\u064a\u0631 \u0641\u064a \u0627\u0644\u0645\u0647\u0627\u0645 \u0623\u0648 \u0627\u0644\u0631\u0633\u0627\u0626\u0644. \u0625\u0630\u0627 \u0628\u0644\u063a \u062d\u062c\u0645 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u064a\u0629 4000 \u0642\u0631\u064a\u0646\u060c \u0633\u064a\u0632\u062f\u0627\u062f \u0627\u0644\u062a\u0623\u062e\u064a\u0631 \u0625\u0644\u0649 15 \u062f\u0642\u064a\u0642\u0629. \u0642\u062f \u062a\u0631\u063a\u0628 \u0628\u0632\u064a\u0627\u062f\u0629 \u0627\u0644\u062a\u0623\u062e\u064a\u0631 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u064a\u0629 \u0644\u062f\u064a\u0643 \u0645\u0645\u0644\u0648\u0621\u0629 \u0628\u0634\u0643\u0644 \u062c\u064a\u062f (\u0623\u0643\u062b\u0631 \u0645\u0646 2000 \u0642\u0631\u064a\u0646)\u060c \u0623\u0648 \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0631\u063a\u0628 \u0641\u064a \u062e\u0641\u0636 \u0627\u0633\u062a\u0647\u0644\u0627\u0643 \u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0628\u0634\u0643\u0644 \u0639\u0627\u0645. \u0645\u0644\u0627\u062d\u0638\u0629: \u0644\u0644\u0631\u0648\u0627\u062a\u0631 \u0627\u0644\u062a\u064a \u062a\u0639\u0645\u0644 \u0643\u0645\u0644\u0626\u0629 \u0641\u064a\u0636\u0627\u0646\u060c \u0644\u0627 \u062a\u0634\u062a\u063a\u0644 \u0647\u0630\u0647 \u0627\u0644\u0645\u0647\u0645\u0629.";
    t[2698] = "Current";
    t[2699] = "\u0627\u0644\u062d\u0627\u0644\u064a";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "\u0645\u0648\u0642\u0639 \u0648\u064a\u0628 \u0645\u0636\u064a\u0641 \u0639\u0644\u0649 \u0634\u0628\u0643\u0629 I2P. \u0625\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627\u060c \u064a\u062a\u0645 \u062a\u0647\u064a\u0626\u0629 \u0648\u062a\u0634\u063a\u064a\u0644 <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>\u062e\u0627\u062f\u0648\u0645 \u0648\u064a\u0628 \u062c\u064a\u062a\u064a</a> \u0639\u0644\u0649 <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "\u064a\u0645\u0643\u0646 \u062a\u0639\u0637\u064a\u0644\u0647 \u0623\u0648 \u062a\u063a\u064a\u064a\u0631\u0647 \u0645\u0646 \u062e\u0644\u0627\u0644 <a href=/i2ptunnelmgr>\u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642</a>. \u0643\u0645\u0627 \u064a\u0645\u0643\u0646 \u062a\u0643\u0648\u064a\u0646\u0647 \u0644\u0644\u0627\u0631\u062a\u0628\u0627\u0637 \u0628\u0648\u0627\u062c\u0647\u0629 \u0645\u062d\u062f\u062f\u0629 \u0623\u0648 \u062c\u0645\u064a\u0639 \u0627\u0644\u0648\u0627\u062c\u0647\u0627\u062a.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "\u062a\u0645 \u062a\u0645\u0643\u064a\u0646 \u062e\u062f\u0645\u0629 I2P \u0627\u0644\u0622\u0646 \u0639\u0646\u062f \u0628\u062f\u0621 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0646\u0638\u0627\u0645";
    t[2748] = "Computer related news aggregation";
    t[2749] = "\u062a\u062c\u0645\u064a\u0639 \u0627\u0644\u0623\u062e\u0628\u0627\u0631 \u0627\u0644\u0645\u062a\u0639\u0644\u0642\u0629 \u0628\u0627\u0644\u0643\u0645\u0628\u064a\u0648\u062a\u0631";
    t[2752] = "Same IP as us";
    t[2753] = "\u0646\u0641\u0633 IP \u0645\u062b\u0644\u0646\u0627";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "\u064a\u0645\u0643\u0646\u0643 \u0625\u0646\u0634\u0627\u0621 \u0639\u0627\u0626\u0644\u0629 \u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 \u062c\u062f\u064a\u062f\u0629 \u0647\u0646\u0627. \u0628\u0645\u062c\u0631\u062f \u0625\u0646\u0634\u0627\u0621 \u0627\u0644\u0639\u0627\u0626\u0644\u0629\u060c \u064a\u0645\u0643\u0646\u0643 \u062a\u0635\u062f\u064a\u0631 \u0645\u0644\u0641 \u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0639\u0627\u0626\u0644\u0629 \u0648\u0645\u0634\u0627\u0631\u0643\u062a\u0647 \u0645\u0639 \u0623\u062c\u0647\u0632\u0629 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u0623\u062e\u0631\u0649 \u0641\u064a \u0639\u0627\u0626\u0644\u062a\u0643 \u0627\u0644\u0645\u0631\u0634\u062d\u0629.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "\u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0648\u0627\u0641\u0642 \u0627\u0644\u0646\u0638\u064a\u0631 \u0639\u0644\u0649 \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0641\u064a\u0647\u0627";
    t[2758] = "Advanced Lookup";
    t[2759] = "\u0628\u062d\u062b \u0645\u062a\u0642\u062f\u0645";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "\u0645\u0646 \u0623\u062c\u0644 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u0645\u0648\u0627\u0642\u0639 \u0627\u0644\u0645\u0636\u064a\u0641\u0629 \u0639\u0644\u0649 I2P \u0648\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u062e\u0627\u062f\u0645 \u0627\u0644\u062e\u0631\u0648\u062c \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0628\u0634\u0643\u0644 \u0627\u062e\u062a\u064a\u0627\u0631\u064a \u0644\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0645\u0648\u0627\u0642\u0639 clearnet\u060c \u0633\u062a\u062d\u062a\u0627\u062c \u0625\u0644\u0649 \u062a\u0643\u0648\u064a\u0641 \u0645\u062a\u0635\u0641\u062d\u0643 \u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0648\u0643\u064a\u0644 HTTP \u0644\u0640 I2P \u0627\u0644\u0630\u064a \u064a\u0639\u0645\u0644 \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0639\u0644\u0649 <code>127.0.0.1 \u0645\u0646\u0641\u0630 4444</code>. \u0645\u0639\u0638\u0645 \u0627\u0644\u0645\u062a\u0635\u0641\u062d\u0627\u062a \u062a\u0648\u0641\u0631 \u062e\u064a\u0627\u0631 \u062a\u0643\u0648\u064a\u0641 \u0648\u0643\u064a\u0644 \u0627\u0644\u0648\u0635\u0648\u0644\u061b \u0641\u064a \u0647\u0630\u0627 \u0627\u0644\u062f\u0631\u0633 \u0627\u0644\u062a\u0639\u0644\u064a\u0645\u064a \u0627\u0644\u0645\u0635\u063a\u0631 \u0633\u0646\u0631\u0643\u0632 \u0639\u0644\u0649 \u0641\u0627\u064a\u0631\u0641\u0648\u0643\u0633.";
    t[2776] = "Close to us";
    t[2777] = "\u0642\u0631\u064a\u0628 \u0645\u0646\u0627";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "\u062e\u0631\u064a\u0637\u0629 \u0645\u0648\u0642\u0639 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 I2P+";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "\u0627\u0635\u062f\u0627\u0631 \u0627\u0644\u0645\u0644\u062d\u0642 {0} \u0644\u064a\u0633 \u0627\u0643\u062b\u0631 \u062d\u062f\u0627\u062b\u0629 \u0645\u0646 \u0627\u0644\u0645\u0644\u062d\u0642 \u0627\u0644\u0645\u062b\u0628\u062a";
    t[2796] = "Streaming radio service";
    t[2797] = "\u062e\u062f\u0645\u0629 \u0627\u0644\u0628\u062b \u0627\u0644\u0625\u0630\u0627\u0639\u064a";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "\u062a\u0639\u0645\u0644 I2P+ \u0628\u0634\u0643\u0644 \u0623\u0641\u0636\u0644 \u0639\u0646\u062f\u0645\u0627 \u062a\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u062a\u0639\u0643\u0633 \u0628\u062f\u0642\u0629 \u0633\u0631\u0639\u0629 \u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u0634\u0628\u0643\u0629 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0641\u064a \u0642\u0633\u0645 <a href=/config>\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0639\u0631\u0636 \u0627\u0644\u062a\u0631\u062f\u062f\u064a</a>. \u0628\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u060c \u062a\u0645 \u062a\u0643\u0648\u064a\u0646 I2P+ \u0628\u0628\u0639\u0636 \u0627\u0644\u0642\u064a\u0645 \u0627\u0644\u0645\u062d\u0627\u0641\u0638\u0629 \u0646\u0633\u0628\u064a\u064b\u0627 \u0627\u0644\u062a\u064a \u0644\u0646 \u062a\u0646\u0627\u0633\u0628 \u0627\u0644\u0639\u062f\u064a\u062f \u0645\u0646 \u062d\u0627\u0644\u0627\u062a \u0627\u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645\u060c \u0644\u0630\u0627 \u064a\u0631\u062c\u0649 \u0623\u062e\u0630 \u0627\u0644\u0648\u0642\u062a \u0644\u0645\u0631\u0627\u062c\u0639\u0629 \u0647\u0630\u0647 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0648\u062a\u0635\u062d\u064a\u062d\u0647\u0627 \u0639\u0646\u062f \u0627\u0644\u0636\u0631\u0648\u0631\u0629. \u0643\u0644\u0645\u0627 \u062e\u0635\u0635\u062a \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0639\u0631\u0636 \u0627\u0644\u062a\u0631\u062f\u062f\u064a\u060c <i>\u0628\u0635\u0641\u0629 \u062e\u0627\u0635\u0629</i> \u0627\u0644\u0639\u0631\u0636 \u0627\u0644\u062a\u0631\u062f\u062f\u064a \u0627\u0644\u0635\u0627\u0639\u062f\u060c \u0633\u062a\u0633\u062a\u0641\u064a\u062f \u0623\u0643\u062b\u0631 \u0645\u0646 \u0627\u0644\u0634\u0628\u0643\u0629.";
    t[2810] = "Transit by Peer";
    t[2811] = "\u0627\u0644\u0639\u0628\u0648\u0631 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0623\u0642\u0631\u0627\u0646";
    t[2812] = "Hidden Mode";
    t[2813] = "\u0648\u0636\u0639 \u0627\u0644\u062e\u0641\u0627\u0621";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "\u064a\u062a\u0637\u0644\u0628 \u0627\u0644\u0628\u0631\u0646\u0627\u0645\u062c \u0627\u0644\u0645\u0633\u0627\u0639\u062f \u0625\u0635\u062f\u0627\u0631 Jetty {0} \u0623\u0648 \u0623\u0642\u0644";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "\u0627\u0644\u0648\u0643\u064a\u0644 \u0627\u0644\u0645\u0631\u0627\u0642\u0628\u0629 \u0642\u062f \u064a\u0643\u0648\u0646 \u0645\u0636\u064a\u0641\u064b\u0627 \u0639\u0646 \u0628\u064f\u0639\u062f \u0623\u0648 \u062e\u062f\u0645\u0629 \u062a\u0639\u0645\u0644 \u0639\u0644\u0649 \u062c\u0647\u0627\u0632 \u0627\u0644\u0643\u0645\u0628\u064a\u0648\u062a\u0631 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 (localhost/127.0.0.1).";
    t[2824] = "Events in peak period";
    t[2825] = "\u0627\u0644\u0623\u062d\u062f\u0627\u062b \u0641\u064a \u0641\u062a\u0631\u0629 \u0627\u0644\u0630\u0631\u0648\u0629";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "\u0644\u063a\u0629 \u0648\u0627\u062c\u0647\u0629 \u062a\u062d\u0643\u0645 \u0627\u0644\u0645\u0648\u062c\u0647 \u0648\u0639\u0631\u0636 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0627\u0644\u0648\u064a\u0628";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "\u0645\u0627 \u064a\u062c\u0628 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0647 \u0641\u064a \u0627\u0644\u062d\u062f\u062b I2P+ \u0644\u0627 \u064a\u0639\u0645\u0644";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "\u062a\u062d\u0630\u064a\u0631 \u062d\u0648\u0644 \u062f\u0631\u062c\u0629 \u0627\u0644\u0645\u062c\u0647\u0648\u0644\u064a\u0629: \u0627\u0644\u0627\u0639\u062f\u0627\u062f\u0627\u062a \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0646\u0641\u0642 \u0648\u0627\u062d\u062f.";
    t[2858] = "I2P IRC Network";
    t[2859] = "\u0634\u0628\u0643\u0629 I2P IRC";
    t[2864] = "pixels wide";
    t[2865] = "\u0628\u0643\u0633\u0644 \u0648\u0627\u0633\u0639\u0629";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "\u064a\u062f\u064a\u0631 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u0627\u0644\u0634\u0628\u0643\u0629 I2P (I2NP) \u0639\u0645\u0644\u064a\u0629 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0648\u0627\u0644\u0645\u0632\u062c \u0628\u064a\u0646 \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0628\u064a\u0646 \u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a\u060c \u0628\u0627\u0644\u0625\u0636\u0627\u0641\u0629 \u0625\u0644\u0649 \u0627\u062e\u062a\u064a\u0627\u0631 \u0648\u0633\u064a\u0644\u0629 \u0627\u0644\u0646\u0642\u0644 (\u0639\u0646\u062f\u0645\u0627 \u062a\u0643\u0648\u0646 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0648\u0633\u064a\u0644\u0629 \u0645\u062f\u0639\u0648\u0645\u0629) \u0639\u0646\u062f \u0627\u0644\u062a\u0648\u0627\u0635\u0644 \u0645\u0639 \u0632\u0645\u064a\u0644. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0642\u0645 \u0628\u0632\u064a\u0627\u0631\u0629 \u0627\u0644\u0648\u062b\u0627\u0626\u0642 <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>\u0639\u0644\u0649 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "\u0627\u0646\u062a\u0647\u0649 {0} \u0645\u0646\u0630";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "\u062d\u0627\u0644\u0629 \u0645\u0648\u062c\u0647\u0643 \u0641\u064a \u0642\u0628\u0648\u0644 \u0623\u0648 \u0631\u0641\u0636 \u0637\u0644\u0628\u0627\u062a \u0628\u0646\u0627\u0621 \u0623\u0646\u0641\u0627\u0642 \u0645\u0634\u0627\u0631\u0643\u0629 \u0639\u0628\u0631\u0647 \u0645\u0646 \u0645\u0648\u062c\u0647\u0627\u062a \u0623\u062e\u0631\u0649. \u0642\u062f \u064a\u0642\u0628\u0644 \u0645\u0648\u062c\u0647\u0643 \u062c\u0645\u064a\u0639 \u0627\u0644\u0637\u0644\u0628\u0627\u062a \u0623\u0648 \u064a\u0642\u0628\u0644 \u0623\u0648 \u064a\u0631\u0641\u0636 \u0646\u0633\u0628\u0629 \u0645\u0646\u0647\u0627 \u0623\u0648 \u064a\u0631\u0641\u0636\u0647\u0627 \u062c\u0645\u064a\u0639\u064b\u0627 \u0644\u0623\u0633\u0628\u0627\u0628 \u0645\u062e\u062a\u0644\u0641\u0629 \u0644\u0644\u0633\u064a\u0637\u0631\u0629 \u0639\u0644\u0649 \u062d\u0631\u0643\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0648\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0645\u0639\u0627\u0644\u062c \u0648\u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u0637\u0627\u0642\u0629 \u0644\u0644\u0639\u0645\u0644\u0627\u0621 \u0627\u0644\u0645\u062d\u0644\u064a\u064a\u0646. <b>\u0645\u0644\u0627\u062d\u0638\u0629";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "\u064a\u0631\u062c\u0649 \u0627\u0644\u062a\u0648\u0627\u0635\u0644 \u0645\u0639 \u0635\u062f\u064a\u0642 \u0645\u0648\u062b\u0648\u0642 \u0628\u0647 \u0645\u0639\u0631\u0648\u0641 \u0644\u062f\u064a\u0647 \u0645\u0648\u062c\u0647 I2P \u0642\u064a\u062f \u0627\u0644\u062a\u0634\u063a\u064a\u0644\u060c \u0648\u0627\u0637\u0644\u0628 \u0645\u0646\u0647 \u0627\u0644\u0645\u0633\u0627\u0639\u062f\u0629 \u0641\u064a \u0625\u0639\u0627\u062f\u0629 \u0628\u0630\u0648\u0631 \u0645\u0648\u062c\u0647 I2P \u0627\u0644\u062e\u0627\u0635 \u0628\u0643. \u0627\u0637\u0644\u0628 \u0645\u0646\u0647\u0645 \u0625\u0631\u0633\u0627\u0644 \u0645\u0644\u0641 \u0625\u0639\u0627\u062f\u0629 \u0628\u0630\u0631 \u0645\u0635\u062f\u0631 \u0645\u0646 \u0645\u0648\u062c\u0647 I2P \u0627\u0644\u062e\u0627\u0635 \u0628\u0647\u0645 \u0627\u0644\u0639\u0627\u0645\u0644. \u0645\u0646 \u0627\u0644\u0623\u0633\u0627\u0633\u064a \u0623\u0646 \u064a\u062a\u0645 \u062a\u0628\u0627\u062f\u0644 \u0627\u0644\u0645\u0644\u0641 \u0639\u0628\u0631 \u0642\u0646\u0627\u0629 \u0622\u0645\u0646\u0629\u060c \u0645\u062b\u0644 \u0627\u0644\u062a\u0634\u0641\u064a\u0631 \u0644\u062a\u062c\u0646\u0628 \u0627\u0644\u062a\u0644\u0627\u0639\u0628 \u0627\u0644\u062e\u0627\u0631\u062c\u064a (\u062a\u0648\u0642\u064a\u0639 \u0648\u062a\u0634\u0641\u064a\u0631 PGP \u0648\u0627\u0644\u062a\u062d\u0642\u0642 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0645\u0641\u062a\u0627\u062d \u0639\u0627\u0645 \u0645\u0648\u062b\u0648\u0642 \u0628\u0647). \u0627\u0644\u0645\u0644\u0641 \u0646\u0641\u0633\u0647 \u063a\u064a\u0631 \u0645\u0648\u0642\u0639\u060c \u0644\u0630\u0627 \u064a\u0631\u062c\u0649 \u0642\u0628\u0648\u0644 \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0641\u0642\u0637 \u0645\u0646 \u0623\u0635\u062f\u0642\u0627\u0621 \u0645\u0648\u062b\u0648\u0642 \u0628\u0647\u0645 \u0645\u0639\u0631\u0648\u0641\u064a\u0646. \u0644\u0627 \u062a\u0642\u0645 \u0628\u0627\u0633\u062a\u064a\u0631\u0627\u062f \u0645\u0644\u0641 \u0625\u0639\u0627\u062f\u0629 \u0628\u0630\u0631 \u0625\u0630\u0627 \u0644\u0645 \u062a\u0633\u062a\u0637\u0639 \u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0645\u0635\u062f\u0631\u0647.";
    t[2916] = "Last Good Send";
    t[2917] = "\u0622\u062e\u0631 \u0625\u0631\u0633\u0627\u0644 \u062c\u064a\u062f";
    t[2918] = "Delete this value to disable";
    t[2919] = "\u0627\u062d\u0630\u0641 \u0647\u0630\u0647 \u0627\u0644\u0642\u064a\u0645\u0629 \u0644\u062a\u0639\u0637\u064a\u0644\u0647\u0627";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "\u064a\u0645\u0643\u0646\u0643 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0645\u0633\u062c\u0644 \u0641\u064a \u0646\u0641\u0642 \u064a\u0643\u062a\u0628 \u0641\u064a \u0645\u0644\u0641 \u064a\u0645\u0643\u0646 \u0644\u0646\u0641\u0642 \u0622\u062e\u0631 \u0623\u0648 \u0644\u0639\u062f\u0629 \u0623\u0646\u0641\u0627\u0642 \u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0647 \u0644\u0644\u062a\u062d\u0643\u0645. \u064a\u0645\u0643\u0646 \u062a\u062d\u0631\u064a\u0631 \u0647\u0630\u0647 \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u064a\u062f\u0648\u064a\u064b\u0627 \u0623\u064a\u0636\u064b\u0627.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "\u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 \u064a\u0642\u0648\u0645 \u0628\u062a\u0634\u063a\u064a\u0644 \u0646\u0633\u062e\u0629 \u063a\u064a\u0631 \u0623\u0635\u0644\u064a\u0629 \u0645\u0646 \u0627\u0644\u0628\u0631\u0627\u0645\u062c \u0627\u0644\u062a\u064a \u062a\u0645\u062a \u0645\u062d\u0627\u0643\u0627\u062a\u0647\u0627 \u0645\u0646 \u0645\u0643\u062a\u0628\u0629 Java BigInteger";
    t[2928] = "Country";
    t[2929] = "\u0627\u0644\u0628\u0644\u062f";
