    t[2935] = "\u0627\u0646\u062d\u0631\u0627\u0641 \u0627\u0644\u0633\u0627\u0639\u0629 \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0633\u0627\u0639\u062a\u0646\u0627";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "\u0627\u0644\u062d\u062f \u0627\u0644\u0630\u064a \u0625\u0630\u0627 \u062a\u0645 \u0627\u062e\u062a\u0631\u0627\u0642\u0647 \u0633\u064a\u0624\u062f\u064a \u0625\u0644\u0649 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u0648\u062c\u0647\u0629 \u0627\u0644\u0628\u0639\u064a\u062f\u0629 \u0627\u0644\u0645\u062e\u0627\u0644\u0641\u0629 \u0641\u064a \u0645\u0644\u0641 \u0645\u062d\u062f\u062f";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "\u0639\u0627\u062f\u0629 \u0645\u0627 \u064a\u0631\u062c\u0639 \u0630\u0644\u0643 \u0625\u0644\u0649 \u062a\u0639\u0627\u0631\u0636 \u0641\u064a \u0627\u0644\u0645\u0646\u0641\u0630 7654. \u0642\u0645 \u0628\u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0627\u0644\u0633\u062c\u0644\u0627\u062a \u0644\u0644\u062a\u0623\u0643\u062f.";
    t[2940] = "Disabling inbound TCP";
    t[2941] = "\u0627\u0644\u063a\u0627\u0621 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 TCP \u0627\u0644\u062f\u0627\u062e\u0644\u064a";
    t[2944] = "Keyring";
    t[2945] = "\u0627\u0644\u0645\u0641\u0627\u062a\u064a\u062d";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "\u062a\u0645 \u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0627\u0644\u0639\u0627\u0626\u0644\u0629 (\u0634\u0647\u0627\u062f\u0629 \u0627\u0644\u062a\u0648\u0642\u064a\u0639 \u0645\u062b\u0628\u062a\u0629 \u0648\u0635\u0627\u0644\u062d\u0629)";
    t[2954] = "Router info not available";
    t[2955] = "\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u063a\u064a\u0631 \u0645\u062a\u0648\u0641\u0631\u0629";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "\u0642\u062f \u062a\u0643\u0648\u0646 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0643\u0627\u0645\u0644\u0629 (\u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644 I2PSnark) \u060c \u0623\u0648 \u0627\u0644\u0648\u0627\u062c\u0647\u0629 \u0627\u0644\u0623\u0645\u0627\u0645\u064a\u0629 \u0644\u0639\u0645\u064a\u0644 \u0623\u0648 \u062a\u0637\u0628\u064a\u0642 \u0622\u062e\u0631 \u064a\u062c\u0628 \u062a\u0645\u0643\u064a\u0646\u0647 \u0628\u0634\u0643\u0644 \u0645\u0646\u0641\u0635\u0644 (\u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644 SusiDNS \u060c I2PTunnel) \u060c \u0623\u0648 \u0644\u064a\u0633 \u0644\u062f\u064a\u0647\u0645 \u0648\u0627\u062c\u0647\u0629 \u0648\u064a\u0628 \u0639\u0644\u0649 \u0627\u0644\u0625\u0637\u0644\u0627\u0642 (\u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644 \u062f\u0641\u062a\u0631 \u0627\u0644\u0639\u0646\u0627\u0635\u0631).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "\u062a\u062d\u0630\u064a\u0631 - \u0644\u0627 \u064a\u064f\u0646\u0635\u062d \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0623\u0646\u0641\u0627\u0642 0-hop \u0627\u0644\u0648\u0627\u0631\u062f\u0629 \u0644\u0623\u062c\u0647\u0632\u0629 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u0645\u062e\u0641\u064a\u0629.";
    t[2972] = "HTTP Proxy";
    t[2973] = "\u0627\u0644\u0645\u0648\u0642\u0639 \u0627\u0644\u0648\u0643\u064a\u0644";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "\u0647\u0630\u0627 \u0647\u0648 \u0627\u0644\u0639\u062f\u062f \u0627\u0644\u0625\u062c\u0645\u0627\u0644\u064a \u0644\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0645\u0639\u0631\u0648\u0641\u0629 \u0644\u062f\u0649 \u0645\u0648\u062c\u0647\u0643. \u064a\u062a\u0645 \u062a\u0635\u0646\u064a\u0641\u0647\u0627 \u0641\u064a \u0635\u0641\u062d\u0629 \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629 (<a href='/netdb'>\u0635\u0641\u062d\u0629 \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629</a>). \u0642\u062f \u064a\u062a\u0631\u0627\u0648\u062d \u0647\u0630\u0627 \u0627\u0644\u0639\u062f\u062f \u0645\u0646 \u0623\u0642\u0644 \u0645\u0646 100 \u0625\u0644\u0649 1000 \u0623\u0648 \u0623\u0643\u062b\u0631. \u0647\u0630\u0627 \u0627\u0644\u0631\u0642\u0645 \u0644\u064a\u0633 \u062d\u062c\u0645 \u0627\u0644\u0634\u0628\u0643\u0629 \u0627\u0644\u0643\u0644\u064a\u061b \u0642\u062f \u064a\u062e\u062a\u0644\u0641 \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631 \u062d\u0633\u0628 \u0625\u062c\u0645\u0627\u0644\u064a \u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0648\u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u0645\u0634\u062a\u0631\u0643 \u0648\u062d\u0631\u0643\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u0645\u0648\u0644\u062f\u0629 \u0645\u062d\u0644\u064a\u064b\u0627. \u0644\u064a\u0633 \u0628\u0627\u0644\u0636\u0631\u0648\u0631\u0629 \u0623\u0646 \u064a\u0639\u0631\u0641 \u0645\u0648\u062c\u0647 I2P \u0643\u0644 \u0645\u0648\u062c\u0647 \u0622\u062e\u0631 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629.";
