    t[3241] = "\u0623\u0648\u0644 \u0645\u0648\u062c\u0647 \u0641\u064a \u0627\u0644\u0646\u0641\u0642. \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u062f\u0627\u062e\u0644\u064a\u0629\u060c \u0647\u0630\u0627 \u0627\u0644\u0645\u0630\u0643\u0648\u0631 \u0641\u064a <i>LeaseSet</i> \u0627\u0644\u0645\u0646\u0634\u0648\u0631 \u0641\u064a \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629. \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u062e\u0627\u0631\u062c\u064a\u0629\u060c \u0627\u0644\u0628\u0648\u0627\u0628\u0629 \u0647\u064a \u0627\u0644\u0645\u0648\u062c\u0647 \u0627\u0644\u0645\u0646\u0634\u0626.";
