    t[3322] = "A <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> link (which always ends with .b32.i2p) is a hash of a <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a> destination. For services on the network, the Base64 hash is often mapped to an .i2p domain in the addressbook.";
    t[3323] = "\u0631\u0627\u0628\u0637 <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>\u0628\u064a\u063232</a> (\u0627\u0644\u0630\u064a \u062f\u0627\u0626\u0645\u064b\u0627 \u0645\u0627 \u064a\u0646\u062a\u0647\u064a \u0628\u0640 .b32.i2p) \u0647\u0648 \u0647\u0627\u0634 \u0644\u0648\u062c\u0647\u0629 <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>\u0628\u064a\u063264</a>. \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0644\u062e\u062f\u0645\u0627\u062a \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u064a\u062a\u0645 \u0631\u0628\u0637 \u0647\u0627\u0634 \u0628\u064a\u063264 \u063a\u0627\u0644\u0628\u064b\u0627 \u0628\u0646\u0637\u0627\u0642 .i2p \u0641\u064a \u062f\u0644\u064a\u0644 \u0627\u0644\u0639\u0646\u0627\u0648\u064a\u0646.";
