    t[3433] = "\u0625\u0630\u0627 \u062a\u0645 \u062a\u0647\u064a\u0626\u062a\u0647\u0627 \u0639\u0644\u0649 \u0635\u062d\u064a\u062d\u060c \u0633\u062a\u0636\u0639 \u0647\u0630\u0647 \u0627\u0644\u062e\u064a\u0627\u0631\u0627\u062a \u0623\u064a\u0642\u0648\u0646\u0629 \u0641\u064a \u0645\u0646\u0637\u0642\u0629 \u0625\u062e\u0637\u0627\u0631 \u0627\u0644\u0646\u0638\u0627\u0645/\u0635\u0644\u0635\u0627\u0644 \u0627\u0644\u0646\u0638\u0627\u0645 \u0645\u0639 \u062e\u064a\u0627\u0631\u0627\u062a \u0627\u0644\u062a\u062d\u0643\u0651\u0645 \u0627\u0644\u0623\u0633\u0627\u0633\u064a\u0629 \u0641\u064a \u0627\u0644\u062e\u062f\u0645\u0629. [\u0645\u0639\u0637\u0651\u0644\u0629 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627]";
    t[3440] = "Windows";
    t[3441] = "Windows";
    t[3444] = "Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[3445] = "\u0642\u0645 \u0628\u062a\u063a\u064a\u064a\u0631 \u0647\u0630\u0647 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0641\u0642\u0637 \u0625\u0630\u0627 \u062a\u0645 \u062d\u0638\u0631 HTTPS \u0628\u0648\u0627\u0633\u0637\u0629 \u062c\u062f\u0627\u0631 \u062d\u0645\u0627\u064a\u0629 \u0645\u0642\u064a\u062f \u0648\u0641\u0634\u0644\u062a \u0639\u0645\u0644\u064a\u0629 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0632\u0631\u0639.";
