    t[3456] = "Enable I2P service";
    t[3457] = "\u062a\u0641\u0639\u064a\u0644 \u062e\u062f\u0645\u0629 I2P";
    t[3458] = "Events in this period";
    t[3459] = "\u0623\u062d\u062f\u0627\u062b \u0647\u0630\u0647 \u0627\u0644\u0641\u062a\u0631\u0629";
    t[3460] = "INTERNET FACING PORTS";
    t[3461] = "\u0627\u0644\u0645\u0646\u0627\u0641\u0630 \u0627\u0644\u0645\u0648\u062c\u0647\u0629 \u0646\u062d\u0648 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a";
    t[3462] = "Config Dir";
    t[3463] = "\u0645\u062c\u0644\u062f \u0627\u0644\u062a\u0643\u0648\u064a\u0646";
    t[3464] = "This setting configures the initial size of the outbound message queue. [Default is 64]";
    t[3465] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u0643\u0648\u0651\u0646 \u062d\u062c\u0645 \u0627\u0644\u0637\u0627\u0628\u0648\u0631 \u0627\u0644\u0645\u0628\u062f\u0626\u064a \u0644\u0644\u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u0645\u0646\u0628\u062b\u0642\u0629. [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 64]";
    t[3466] = "Larger interval";
    t[3467] = "\u0641\u0627\u0635\u0644 \u0632\u0645\u0646\u064a \u0623\u0643\u0628\u0631";
    t[3468] = "You must first update to version {0}";
    t[3469] = "\u064a\u062c\u0628 \u0639\u0644\u064a\u0643 \u0623\u0648\u0644\u0627\u064b \u0627\u0644\u062a\u062d\u062f\u064a\u062b \u0625\u0644\u0649 \u0627\u0644\u0625\u0635\u062f\u0627\u0631 {0}";
    t[3472] = "ago";
    t[3473] = "\u0645\u0646\u0630";
    t[3476] = "Threads dumped to {0}";
    t[3477] = "\u062a\u0645 \u062a\u0641\u0631\u064a\u063a \u0627\u0644\u0645\u0648\u0627\u0636\u064a\u0639 \u0625\u0644\u0649 {0}";
    t[3480] = "Bandwidth in/out";
    t[3481] = "\u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u062f\u0627\u062e\u0644\u064a/\u062e\u0627\u0631\u062c\u064a";
    t[3482] = "This setting determines whether stats about our router are sporadically published to the NetDb. [Default is false]";
    t[3483] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u062d\u062f\u062f \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0627\u0644\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a \u062d\u0648\u0644 \u0631\u0627\u0648\u062a\u0631\u0646\u0627 \u0633\u062a\u0646\u0634\u0631 \u0628\u0634\u0643\u0644 \u0639\u0634\u0648\u0627\u0626\u064a \u0625\u0644\u0649 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u064a\u0629. [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 \u062e\u0637\u0623]";
    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "\u0647\u0630\u0627 \u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0645\u062a\u0627\u062d\u064a\u0646 \u0644\u0628\u0646\u0627\u0621 \u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0639\u0645\u0644\u0627\u0621 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0645\u0648\u062c\u0647\u0643. \u0639\u0627\u062f\u0629 \u0645\u0627 \u064a\u062a\u0631\u0627\u0648\u062d \u0647\u0630\u0627 \u0627\u0644\u0639\u062f\u062f \u0628\u064a\u0646 8-30. \u064a\u062a\u0645 \u0639\u0631\u0636 \u0623\u0642\u0631\u0627\u0646\u0643 \u0633\u0631\u064a\u0639\u064a \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href='/profiles'>\u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0627\u0644\u0634\u062e\u0635\u064a\u0629</a>. <a href='/configstats#router.fastPeers'>[\u062a\u0645\u0643\u064a\u0646 \u0627\u0644\u0631\u0633\u0645 \u0627\u0644\u0628\u064a\u0627\u0646\u064a]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "\u0627\u0646\u0642\u0631 \u0641\u0648\u0642 \u0627\u0644\u0632\u0631 <i>\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0646\u0634\u0631 \u0645\u0646 \u0645\u0644\u0641</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "\u0625\u0635\u062f\u0627\u0631 \u0645\u062a\u063a\u064a\u0631 \u0645\u0646 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u0628\u0635\u0644\u064a \u064a\u0634\u0641\u0631 \u0639\u062f\u0629 \u0631\u0633\u0627\u0626\u0644 \u0645\u0639\u0627\u064b \u0644\u062c\u0639\u0644\u0647 \u0623\u0643\u062b\u0631 \u0635\u0639\u0648\u0628\u0629 \u0639\u0644\u0649 \u0627\u0644\u0645\u0647\u0627\u062c\u0645\u064a\u0646 \u0623\u062f\u0627\u0621 \u062a\u062d\u0644\u064a\u0644 \u062d\u0631\u0643\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0648\u0632\u064a\u0627\u062f\u0629 \u0633\u0631\u0639\u0629 \u0646\u0642\u0644 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a\u060c \u064a\u064f\u0631\u062c\u0649 \u0632\u064a\u0627\u0631\u0629 \u0627\u0644\u0648\u062b\u0627\u0626\u0642 <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>\u0639\u0644\u0649 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "\u0643\u064a\u0641\u064a\u0629 \u062a\u0642\u0648\u064a\u0629 \u0645\u0648\u0642\u0639 WordPress \u0627\u0644\u062e\u0627\u0635 \u0628\u0643";
    t[3496] = "I2P Internals";
    t[3497] = "I2P \u0627\u0644\u062f\u0627\u062e\u0644\u064a\u0629";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627\u060c \u064a\u062a\u0645 \u062a\u0632\u0648\u064a\u062f I2P \u0628\u062e\u0627\u062f\u0648\u0645 \u0648\u064a\u0628 \u0644\u0627\u0633\u062a\u0636\u0627\u0641\u0629 \u0645\u0648\u0642\u0639\u0643 \u0627\u0644\u062e\u0627\u0635 \u0627\u0644\u0645\u062c\u0647\u0644 (\u0639\u0627\u062f\u0629 \u0645\u0627 \u064a\u0634\u0627\u0631 \u0625\u0644\u064a\u0647 \u0628\u0640 \u00abeepsite\u00bb). \u0643\u0644\u0627 \u0627\u0644\u0645\u0648\u0642\u0639 \u0648\u0648\u0627\u062c\u0647\u0629 \u062a\u062d\u0643\u0645 \u0645\u0648\u062c\u0647 I2P \u064a\u0639\u0645\u0644\u0627\u0646 \u0639\u0644\u0649 \u0646\u0633\u062e\u0629 \u0645\u062e\u0641\u0641\u0629 \u0645\u0646 Jetty. \u0648\u0647\u064a \u0645\u062e\u0635\u0635\u0629 \u0644\u0640 I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u062a\u064a\u062d \u0644\u0643 \u0627\u0633\u062a\u0628\u0639\u0627\u062f \u0627\u0644\u0631\u0648\u0627\u062a\u0631 \u0627\u0644\u0623\u0643\u0628\u0631 \u0633\u0646\u0627\u064b \u0645\u0646 \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a\u0643 \u0627\u0644\u0634\u0628\u0643\u064a\u0629. \u0627\u0644\u0631\u0648\u0627\u062a\u0631 \u0627\u0644\u062a\u064a \u062a\u062a\u062c\u0627\u0648\u0632 \u0639\u0645\u0631\u0647\u0627 \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0623\u0648 \u0627\u0644\u0642\u064a\u0645\u0629 \u0627\u0644\u062a\u064a \u062d\u062f\u062f\u062a\u0647\u0627 \u0633\u062a\u064f\u062d\u0630\u0641 \u0645\u0646 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u064a\u0629 \u0648\u0633\u064a\u062a\u0645 \u062d\u0638\u0631\u0647\u0627 \u0644\u0645\u062f\u0629 \u062c\u0644\u0633\u0629 \u0627\u0644\u0631\u0627\u0648\u062a\u0631. \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u060c \u064a\u062a\u0645 \u0627\u0633\u062a\u0628\u0639\u0627\u062f \u0627\u0644\u0631\u0648\u0627\u062a\u0631 \u0627\u0644\u0623\u0642\u062f\u0645 \u0645\u0646 0.9.20. \u0645\u0644\u0627\u062d\u0638\u0629: \u0628\u062f\u0621\u064b\u0627 \u0645\u0646 \u0625\u0635\u062f\u0627\u0631 I2P+ 0.9.46+\u060c \u064a\u062a\u0645 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0631\u0648\u0627\u062a\u0631 \u0630\u0627\u062a \u0627\u0644\u0625\u0635\u062f\u0627\u0631\u0627\u062a \u0627\u0644\u062d\u062f\u064a\u062b\u0629 \u062c\u062f\u064b\u0627 \u0644\u0628\u0646\u0627\u0621 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0645\u062d\u0644\u064a\u0629 \u0641\u0642\u0637. [\u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u0645\u0637\u0644\u0648\u0628\u0629]";
    t[3508] = "HackerNews";
    t[3509] = "\u0647\u0627\u0643\u0631 \u0646\u064a\u0648\u0632";
    t[3510] = "Registering an I2P Domain";
    t[3511] = "\u062a\u0633\u062c\u064a\u0644 \u0646\u0637\u0627\u0642 I2P";
    t[3512] = "Plugin Manager";
    t[3513] = "\u0645\u062f\u064a\u0631 \u0627\u0644\u0645\u0633\u0627\u0639\u062f";
    t[3514] = "Router Console Language";
    t[3515] = "\u0644\u063a\u0629 \u0644\u0648\u062d\u0629 \u0627\u0644\u062a\u062d\u0643\u0645";
    t[3522] = "Rejected";
    t[3523] = "\u0645\u0631\u0641\u0648\u0636";
    t[3524] = "Service (Wrapper) log";
    t[3525] = "\u0633\u062c\u0644 \u0627\u0644\u062e\u062f\u0645\u0629 (\u0627\u0644\u0645\u062c\u0645\u0639).";
    t[3528] = "Floodfill enabled";
    t[3529] = "\u062a\u0645 \u062a\u0645\u0643\u064a\u0646 floodfill";
    t[3538] = "Changelog";
    t[3539] = "\u0633\u062c\u0644\u0651 \u0627\u0644\u062a\u063a\u064a\u064a\u0631\u0627\u062a ";
    t[3542] = "Internal Error";
    t[3543] = "\u0645\u0634\u0643\u0644 \u062f\u0627\u062e\u0644\u064a";
    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "\u064a\u062a\u062c\u0627\u0648\u0632 \u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u060c \u0628\u0627\u0644\u0645\u0644\u0644\u064a \u062b\u0627\u0646\u064a\u0629\u060c \u0627\u0644\u062d\u062f \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0644\u0648\u0642\u062a \u0645\u0639\u0627\u0644\u062c\u0629 \u0627\u0644\u0631\u0633\u0627\u0626\u0644 (\u0627\u0644\u0645\u0634\u0627\u0631 \u0625\u0644\u064a\u0647 \u0628\u0627\u0633\u0645 <i>\u062a\u0623\u062e\u064a\u0631 \u0627\u0644\u0631\u0633\u0627\u0644\u0629</i> \u0641\u064a \u0642\u0633\u0645 \u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a \u0644\u0644\u0627\u0632\u062f\u062d\u0627\u0645) \u0642\u0628\u0644 \u062a\u062d\u062f\u064a\u062f \u0623\u0646 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0645\u0632\u062f\u062d\u0645 \u0648\u064a\u062a\u0645 \u0631\u0641\u0636 \u0637\u0644\u0628\u0627\u062a \u0646\u0641\u0642 \u0627\u0644\u0646\u0642\u0644. ";
    t[3550] = "No lifetime events";
    t[3551] = "\u0644\u0627 \u062a\u0648\u062c\u062f \u0623\u062d\u062f\u0627\u062b \u0645\u062f\u0649 \u0627\u0644\u062d\u064a\u0627\u0629";
    t[3556] = "No stored analysis";
    t[3557] = "\u0644\u0627 \u064a\u0648\u062c\u062f \u062a\u062d\u0644\u064a\u0644 \u0645\u062e\u0632\u0646";
