    t[3780] = "To preserve anonymity, make sure that the webserver is not publicly available outside of the I2P network, which is normally achieved by configuring the webserver to listen on localhost (127.0.0.1) rather than all interfaces (0.0.0.0).";
    t[3781] = "\u0644\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0627\u0644\u0633\u0631\u064a\u0629\u060c \u062a\u0623\u0643\u062f \u0645\u0646 \u0639\u062f\u0645 \u0625\u062a\u0627\u062d\u0629 \u062e\u0627\u062f\u0648\u0645 \u0627\u0644\u0648\u064a\u0628 \u0628\u0634\u0643\u0644 \u0639\u0644\u0646\u064a \u062e\u0627\u0631\u062c \u0634\u0628\u0643\u0629 I2P\u060c \u0648\u064a\u062a\u062d\u0642\u0642 \u0630\u0644\u0643 \u0639\u0627\u062f\u0629 \u0645\u0646 \u062e\u0644\u0627\u0644 \u062a\u0643\u0648\u064a\u0646 \u062e\u0627\u062f\u0648\u0645 \u0627\u0644\u0648\u064a\u0628 \u0644\u0644\u0627\u0633\u062a\u0645\u0627\u0639 \u0639\u0644\u0649 \u0645\u0636\u064a\u0641 \u0645\u062d\u0644\u064a (127.0.0.1) \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0643\u0627\u0641\u0629 \u0627\u0644\u0648\u0627\u062c\u0647\u0627\u062a (0.0.0.0).";
    t[3782] = "UPnP is not enabled";
    t[3783] = "\u0644\u0645 \u064a\u062a\u0645 \u062a\u0645\u0643\u064a\u0646 UPnP";
    t[3784] = "Import the secret family key that you exported from an existing router in the family.";
    t[3785] = "\u0642\u0645 \u0628\u0627\u0633\u062a\u064a\u0631\u0627\u062f \u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0639\u0627\u0626\u0644\u0629 \u0627\u0644\u0633\u0631\u064a \u0627\u0644\u0630\u064a \u0642\u0645\u062a \u0628\u062a\u0635\u062f\u064a\u0631\u0647 \u0645\u0646 \u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 \u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0627\u0644\u0639\u0627\u0626\u0644\u0629.";
    t[3790] = "No events found in previous {0}";
    t[3791] = "\u0644\u0645 \u064a\u062a\u0645 \u0627\u0644\u0639\u062b\u0648\u0631 \u0639\u0644\u0649 \u0623\u062d\u062f\u0627\u062b \u0641\u064a {0} \u0627\u0644\u0633\u0627\u0628\u0642\u0629";
    t[3796] = "This plugin requires Java version {0} or higher";
    t[3797] = "\u0647\u0630\u0627 \u0627\u0644\u0645\u0644\u062d\u0642 \u064a\u062d\u062a\u0627\u062c \u0627\u0644\u0649 \u0627\u0635\u062f\u0627\u0631 \u062c\u0627\u0641\u0627 {0} \u0627\u0648 \u0623\u0639\u0644\u0649";
    t[3800] = "Averages";
    t[3801] = "\u0627\u0644\u0645\u062a\u0648\u0633\u0637\u0627\u062a";
    t[3808] = "Enter <code>127.0.0.1</code> in the <i>HTTP Proxy</i> field, and <code>4444</code> in the <i>Port</i> field.";
    t[3809] = "\u0623\u062f\u062e\u0644 <code>127.0.0.1</code> \u0641\u064a \u062d\u0642\u0644 <i>\u0648\u0643\u064a\u0644 HTTP</i> \u0648<code>4444</code> \u0641\u064a \u062d\u0642\u0644 <i>\u0627\u0644\u0645\u0646\u0641\u0630</i>.";
