    t[3830] = "Used by client apps. Can be changed to a different port on the <a href=/configclients>Client Configuration page</a> but this is not recommended. Can be bound to a different interface or all interfaces, or disabled, on the <a href=/configclients>Client Configuration page</a>.";
    t[3831] = "\u064a\u0633\u062a\u062e\u062f\u0645\u0647 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0627\u0644\u0639\u0645\u0644\u0627\u0621. \u064a\u0645\u0643\u0646 \u062a\u063a\u064a\u064a\u0631\u0647 \u0625\u0644\u0649 \u0645\u0646\u0641\u0630 \u0645\u062e\u062a\u0644\u0641 \u0639\u0628\u0631 <a href=/configclients>\u0635\u0641\u062d\u0629 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0639\u0645\u0644\u0627\u0621</a> \u0644\u0643\u0646 \u0647\u0630\u0627 \u063a\u064a\u0631 \u0645\u0648\u0635\u0649 \u0628\u0647. \u064a\u0645\u0643\u0646 \u0631\u0628\u0637\u0647 \u0628\u0648\u0627\u062c\u0647\u0629 \u0645\u062e\u062a\u0644\u0641\u0629 \u0623\u0648 \u0643\u0644 \u0627\u0644\u0648\u0627\u062c\u0647\u0627\u062a\u060c \u0623\u0648 \u062a\u0639\u0637\u064a\u0644\u0647 \u0639\u0628\u0631 <a href=/configclients>\u0635\u0641\u062d\u0629 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0639\u0645\u0644\u0627\u0621</a>.";
    t[3832] = "Log record format";
    t[3833] = "\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0633\u062c\u0644";
    t[3838] = "For a more extensive guide to configuration for various browsers, see the <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>browser configuration guide</a>.";
    t[3839] = "\u0644\u062f\u0644\u064a\u0644 \u0623\u0643\u062b\u0631 \u0634\u0645\u0648\u0644\u0627\u064b \u062d\u0648\u0644 \u0627\u0644\u062a\u0643\u0648\u064a\u0641 \u0644\u0645\u062a\u0635\u0641\u062d\u0627\u062a \u0645\u062e\u062a\u0644\u0641\u0629\u060c \u0634\u0627\u0647\u062f <a href=https://geti2p.net/en/about/browser-config target=_blank rel=noreferrer class='sitelink external'>\u062f\u0644\u064a\u0644 \u062a\u0643\u0648\u064a\u0641 \u0627\u0644\u0645\u062a\u0635\u0641\u062d</a>..";
    t[3842] = "Periodically test tunnels to determine the average lag, and display the results in the Congestion sidepanel section. To enable, set this value to false. [Default is false]";
    t[3843] = "\u0627\u062e\u062a\u0628\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0628\u0634\u0643\u0644 \u062f\u0648\u0631\u064a \u0644\u062a\u062d\u062f\u064a\u062f \u0645\u062a\u0648\u0633\u0637 \u200b\u200b\u0627\u0644\u062a\u0623\u062e\u0631\u060c \u0648\u0639\u0631\u0636 \u0627\u0644\u0646\u062a\u0627\u0626\u062c \u0641\u064a \u0642\u0633\u0645 \u0627\u0644\u0644\u0648\u062d\u0629 \u0627\u0644\u062c\u0627\u0646\u0628\u064a\u0629 \u0644\u0644\u0627\u0632\u062f\u062d\u0627\u0645. ";
