    t[3905] = "\u062a\u062a\u0637\u0644\u0628 \u0627\u0633\u0645 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0648\u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631";
    t[3914] = "Router reseeding and configuration";
    t[3915] = "\u0625\u0639\u0627\u062f\u0629 \u0632\u0631\u0639 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0648\u062a\u0643\u0648\u064a\u0646\u0647";
    t[3920] = "logs";
    t[3921] = "\u0627\u0644\u0633\u062c\u0644\u0627\u062a";
    t[3928] = "Configure startup of clients and webapps (services); manually start dormant services";
    t[3929] = "\u062a\u0643\u0648\u064a\u0646 \u0628\u062f\u0621 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0639\u0645\u0644\u0627\u0621 \u0648\u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0627\u0644\u0648\u064a\u0628 (\u0627\u0644\u062e\u062f\u0645\u0627\u062a)\u061b ";
    t[3930] = "Advanced router configuration";
    t[3931] = "\u062a\u0643\u0648\u064a\u0646 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u0645\u062a\u0642\u062f\u0645";
    t[3938] = "Sort by packets sent";
    t[3939] = "\u062d\u0633\u0628 \u0627\u0644\u062d\u0632\u0645 \u0627\u0644\u0645\u0631\u0633\u0644\u0629";
    t[3940] = "Move to bottom";
    t[3941] = "\u0627\u0646\u062a\u0642\u0644 \u0625\u0644\u0649 \u0627\u0644\u0623\u0633\u0641\u0644";
    t[3944] = "Router Information (advanced)";
    t[3945] = "\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 (\u0645\u062a\u0642\u062f\u0645)";
    t[3950] = "Maximum transmission unit";
    t[3951] = "\u0648\u062d\u062f\u0629 \u0627\u0644\u0625\u0631\u0633\u0627\u0644 \u0627\u0644\u0642\u0635\u0648\u0649";
    t[3954] = "NTCP [IPv6] &amp; SSU";
    t[3955] = "IPv6 NTCP\u060c SSU";
    t[3958] = "I2P requires your computer's time be accurate.";
    t[3959] = "\u064a\u062a\u0637\u0644\u0628 I2P \u062f\u0642\u0629 \u062a\u0648\u0642\u064a\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u0643\u0645\u0628\u064a\u0648\u062a\u0631 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.";
    t[3960] = "Just finished jobs";
    t[3961] = "\u0627\u0646\u062a\u0647\u064a\u062a \u0644\u0644\u062a\u0648 \u0645\u0646 \u0627\u0644\u0645\u0647\u0627\u0645";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "\u0628\u0639\u0636 \u0639\u0645\u0644\u0627\u0621 IRC \u0645\u0643\u0648\u0646\u0629 \u0644\u0644\u062a\u0641\u0635\u0644 \u0639\u0646 \u0627\u0644\u062e\u0627\u062f\u0645 \u0625\u0630\u0627 \u0644\u0645 \u064a\u0643\u0646 \u0647\u0646\u0627\u0643 \u062a\u0648\u0627\u0635\u0644 \u0645\u0639 \u0627\u0644\u062e\u0627\u062f\u0645 \u0644\u0641\u062a\u0631\u0629 \u0632\u0645\u0646\u064a\u0629\u060c \u0645\u0627 \u0642\u062f \u064a\u0633\u0628\u0628 \u0645\u0634\u0643\u0644\u0629 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0644\u0640 IRC \u0641\u064a I2P \u0625\u0630\u0627 \u062a\u0645 \u062a\u0639\u064a\u064a\u0646 \u0642\u064a\u0645\u0629 <i>\u0645\u0647\u0644\u0629 \u0628\u0646\u063a</i> \u0628\u0634\u0643\u0644 \u0645\u0646\u062e\u0641\u0636. \u062a\u0639\u064a\u064a\u0646 \u0642\u064a\u0645\u0629 \u0645\u0647\u0644\u0629 \u0628\u0646\u063a \u0641\u064a \u0639\u0645\u064a\u0644\u0643 \u0639\u0644\u0649 \u0642\u064a\u0645\u0629 \u0639\u0627\u0644\u064a\u0629 (\u0645\u062b\u0644 320 \u062b\u0627\u0646\u064a\u0629) \u0633\u064a\u0624\u062f\u064a \u0641\u064a \u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0625\u0644\u0649 \u0627\u062a\u0635\u0627\u0644 \u0623\u0643\u062b\u0631 \u0627\u0633\u062a\u0642\u0631\u0627\u0631\u064b\u0627 \u0628\u0627\u0644\u0634\u0628\u0643\u0629. \u0641\u064a hexchat \u064a\u0645\u0643\u0646\u0643 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0642\u064a\u0645\u0629 \u0628\u0643\u062a\u0627\u0628\u0629 <code>/set net_ping_timeout 320</code>. \u0633\u064a\u062a\u0645 \u0643\u062a\u0627\u0628\u0629 \u0627\u0644\u0642\u064a\u0645\u0629 \u0641\u064a \u0645\u0644\u0641 <code>hexchat.conf</code> \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.";
    t[3964] = "Run at Startup?";
    t[3965] = "\u062a\u0634\u063a\u064a\u0644 \u0639\u0646\u062f \u0627\u0644\u0628\u062f\u0627\u064a\u0629\u061f";
    t[3972] = "Never";
    t[3973] = "\u0623\u0628\u062f";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "\u062a\u0647\u064a\u0626\u0629<a href=/confignet#ipchange>\u0627\u062e\u062a\u064a\u0627\u0631\u064a\u0629</a> \u062a\u063a\u064a\u0631 \u062a\u0644\u0642\u0627\u0626\u064a\u064b\u0627 \u0647\u0648\u064a\u062a\u0643 \u0627\u0644\u0645\u0648\u062c\u0647 <a href=/netdb?r=.>\u0647\u0648\u064a\u0629 \u0645\u0648\u062c\u0647\u0643</a> \u0648<a href=/confignet#udpconfig>\u0627\u0644\u0645\u0646\u0641\u0630 \u0627\u0644\u062e\u0627\u0631\u062c\u064a</a> \u0639\u0646\u062f\u0645\u0627 \u064a\u062a\u063a\u064a\u0631 \u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u0639\u0627\u0645 \u0627\u0644\u0630\u064a \u062a\u0639\u0645\u0644 \u0639\u0644\u064a\u0647 \u0646\u0638\u0627\u0645\u0643. \u064a\u0645\u0643\u0646 \u0630\u0644\u0643 \u0645\u0646\u0639 \u0637\u0631\u0641 \u062e\u0628\u064a\u062b \u0645\u0646 \u0631\u0628\u0637 \u0647\u0648\u064a\u0629 \u0645\u0648\u062c\u0647\u0643 \u0648\u0639\u0646\u0648\u0627\u0646 IP \u0641\u064a \u0627\u0644\u0633\u064a\u0646\u0627\u0631\u064a\u0648\u0647\u0627\u062a \u0627\u0644\u062a\u064a \u0642\u062f \u064a\u062a\u063a\u064a\u0631 \u0641\u064a\u0647\u0627 \u0639\u0646\u0648\u0627\u0646 IP \u0628\u0634\u0643\u0644 \u0645\u062a\u0643\u0631\u0631\u060c \u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644 \u0639\u0646\u062f \u062a\u0634\u063a\u064a\u0644 I2P \u0639\u0644\u0649 \u062c\u0647\u0627\u0632 \u0644\u0627\u0628 \u062a\u0648\u0628 \u0645\u0646 \u0639\u062f\u0629 \u0645\u0648\u0627\u0642\u0639.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "\u0644\u0645 \u064a\u062a\u0645 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0645\u0648\u062c\u0647 \u0644\u0646\u0634\u0631 \u0639\u0646\u0648\u0627\u0646\u0647\u060c \u0648\u0628\u0627\u0644\u062a\u0627\u0644\u064a \u0641\u0647\u0648 \u0644\u0627 \u064a\u062a\u0648\u0642\u0639 \u0627\u062a\u0635\u0627\u0644\u0627\u062a \u0648\u0627\u0631\u062f\u0629.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[3999] = "\u062a\u0637\u0628\u064a\u0642 \u064a\u0639\u0645\u0644 \u0645\u0646 \u0633\u0637\u0631 \u0627\u0644\u0623\u0648\u0627\u0645\u0631 \u0645\u0631\u0641\u0642 \u0645\u0639 I2P+ (\u0644\u064a\u0646\u0643\u0633/\u0645\u0627\u0643 \u0623\u0648 \u0625\u0633) \u064a\u0633\u062a\u062e\u062f\u0645 \u0644\u0625\u062c\u0631\u0627\u0621 \u0637\u0644\u0628 <code>head</code> \u0639\u0644\u0649 \u0645\u0648\u0631\u062f HTTP \u0645\u062d\u062f\u062f \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0645\u0639 \u0625\u0631\u062c\u0627\u0639 \u0623\u0631\u0624\u0648\u0633 \u0627\u0644\u0627\u0633\u062a\u062c\u0627\u0628\u0629 \u0627\u0644\u0645\u062e\u062a\u0644\u0641\u0629 \u0645\u0646 \u0627\u0644\u062e\u0627\u062f\u0645 \u0639\u0646 \u0628\u0639\u062f. \u0625\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627\u060c \u064a\u0633\u062a\u062e\u062f\u0645 \u0625\u064a\u0628\u0647\u064a\u062f \u0648\u0643\u064a\u0644 HTTP \u0639\u0644\u0649 <code>127.0.0.1:4444</code>";
    t[4010] = "NTCP [IPv6] &amp; SSU with Introducers";
