    t[4026] = "This setting permits a custom text prefix to be set for the page title on router console pages, potentially useful when you have multiple consoles open on browser tabs and want an easy method to differentiate between them.";
    t[4027] = "\u0647\u0630\u0647 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a \u062a\u0633\u0645\u062d \u0628\u0625\u062f\u062e\u0627\u0644 \u0633\u0637\u0631 \u0646\u0635\u064a \u0645\u062e\u0635\u0635 \u0644\u0644\u0639\u0646\u0648\u0627\u0646 \u0639\u0644\u0649 \u0635\u0641\u062d\u0627\u062a \u0648\u0627\u062c\u0647\u0629 \u0627\u0644 router\u060c \u0648\u0647\u0648 \u0645\u0641\u064a\u062f \u0639\u0646\u062f\u0645\u0627 \u062a\u0643\u0648\u0646 \u0644\u062f\u064a\u0643 \u0639\u062f\u0629 \u0648\u0627\u062c\u0647\u0627\u062a \u0645\u0641\u062a\u0648\u062d\u0629 \u0641\u064a \u0639\u0644\u0627\u0645\u0627\u062a \u0627\u0644\u062a\u0628\u0648\u064a\u0628 \u0641\u064a \u0627\u0644\u0645\u062a\u0635\u0641\u062d \u0648\u062a\u0631\u064a\u062f \u0637\u0631\u064a\u0642\u0629 \u0633\u0647\u0644\u0629 \u0644\u0644\u062a\u0639\u0631\u0641 \u0628\u064a\u0646\u0647\u0627.";
