    t[4049] = "\u0648\u0627\u062c\u0647\u0629 \u0645\u062a\u0635\u0641\u062d  \u0627\u0644\u0645\u0648\u062c\u0647 I2P";
    t[4050] = "Launch console at startup";
    t[4051] = "\u0625\u0637\u0644\u0627\u0642 \u0648\u062d\u062f\u0629 \u0627\u0644\u062a\u062d\u0643\u0645 \u0639\u0646\u062f \u0628\u062f\u0621 \u0627\u0644\u062a\u0634\u063a\u064a\u0644";
    t[4052] = "Job Statistics (excluding single-shot jobs)";
    t[4053] = "\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a \u0627\u0644\u0648\u0638\u0627\u0626\u0641 (\u0628\u0627\u0633\u062a\u062b\u0646\u0627\u0621 \u0627\u0644\u0648\u0638\u0627\u0626\u0641 \u0627\u0644\u0641\u0631\u062f\u064a\u0629)";
    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "\u0644\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0645\u0648\u0627\u0642\u0639 \u0627\u0644\u0648\u064a\u0628 \u0627\u0644\u0645\u0633\u062a\u0636\u0627\u0641\u0629 \u0639\u0644\u0649 \u0634\u0628\u0643\u0629 I2P \u0648\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0628\u0631\u0648\u0643\u0633\u064a \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0644\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0645\u0648\u0627\u0642\u0639 \u0627\u0644\u0648\u064a\u0628 \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629 \u0627\u0644\u0639\u0627\u062f\u064a\u0629 \u0627\u062e\u062a\u064a\u0627\u0631\u064a\u064b\u0627\u060c \u0633\u062a\u062d\u062a\u0627\u062c \u0625\u0644\u0649 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0645\u062a\u0635\u0641\u062d \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0628\u0631\u0648\u0643\u0633\u064a <b>HTTP</b> \u0644\u0640 I2P +\u060c \u0648\u0627\u0644\u0630\u064a \u064a\u0639\u0645\u0644 \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0639\u0644\u0649 <code>127.0.0.1 \u0627\u0644\u0628\u0648\u0631\u062a 4444</code>. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0633\u0627\u0639\u062f\u0629\u060c \u0627\u0646\u0638\u0631 <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>\u062f\u0644\u064a\u0644 \u0627\u0644\u062a\u0643\u0648\u064a\u0646 </a> \u060c \u0623\u0648 <a href=/help/configuration#browserconfig>\u0627\u0644\u0628\u0631\u0646\u0627\u0645\u062c \u0627\u0644\u062a\u0639\u0644\u064a\u0645\u064a \u0627\u0644\u0635\u063a\u064a\u0631 \u0644\u0641\u0627\u064a\u0631\u0641\u0648\u0643\u0633</a>.";
