    t[4066] = "The number of participating tunnels you route for others, divided by the total number of hops in all your exploratory and client tunnels. A number greater than 1.00 means you are contributing more tunnels to the network than you are using.";
    t[4067] = "\u0639\u062f\u062f \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0627\u0644\u062a\u064a \u062a\u0648\u062c\u0647\u0647\u0627 \u0644\u0644\u0622\u062e\u0631\u064a\u0646 \u0645\u0642\u0633\u0648\u0645\u064b\u0627 \u0639\u0644\u0649 \u0625\u062c\u0645\u0627\u0644\u064a \u0639\u062f\u062f \u0627\u0644\u0645\u062d\u0637\u0627\u062a \u0641\u064a \u0643\u0644 \u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0627\u0633\u062a\u0643\u0634\u0627\u0641 \u0648\u0627\u0644\u0639\u0645\u0644\u0627\u0621 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643. \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0639\u062f\u062f \u0623\u0643\u0628\u0631 \u0645\u0646 1.00 \u0641\u0647\u0630\u0627 \u064a\u0639\u0646\u064a \u0623\u0646\u0643 \u062a\u0633\u0647\u0645 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629 \u0628\u0623\u0646\u0641\u0627\u0642 \u0623\u0643\u062b\u0631 \u0645\u0645\u0627 \u062a\u0633\u062a\u062e\u062f\u0645\u0647.";
