    t[4098] = "After restarting, you may export the family key.";
    t[4099] = "\u0628\u0639\u062f \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0634\u063a\u064a\u0644\u060c \u064a\u0645\u0643\u0646\u0643 \u062a\u0635\u062f\u064a\u0631 \u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0639\u0627\u0626\u0644\u0629.";
    t[4104] = "Router is currently hosting the configured maximum number of transit tunnels";
    t[4105] = "\u0627\u0644 router \u064a\u0642\u0648\u0645 \u062d\u0627\u0644\u064a\u0627\u064b \u0628\u0627\u0633\u062a\u0636\u0627\u0641\u062a\u0647\u062f\u0641 \u0627\u0644\u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0627\u0644\u0645\u062d\u062f\u062f \u0645\u0646 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0627\u0646\u062a\u0642\u0627\u0644\u064a\u0629";
