    t[4130] = "I2P+ will now test your internet connection to identify the optimal speed settings.";
    t[4131] = "\u0633\u064a\u0642\u0648\u0645 I2P \u0627\u0644\u0622\u0646 \u0628\u0627\u062e\u062a\u0628\u0627\u0631 \u0627\u062a\u0635\u0627\u0644\u0643 \u0628\u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a \u0644\u062a\u062d\u062f\u064a\u062f \u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0627\u0644\u0633\u0631\u0639\u0629 \u0627\u0644\u0645\u062b\u0627\u0644\u064a\u0629.";
    t[4136] = "To change client options, edit the file: {0}";
    t[4137] = "\u0644\u062a\u063a\u064a\u064a\u0631 \u062e\u064a\u0627\u0631\u0627\u062a \u0627\u0644\u0639\u0645\u064a\u0644\u060c \u0642\u0645 \u0628\u062a\u062d\u0631\u064a\u0631 \u0627\u0644\u0645\u0644\u0641: {0}";
    t[4138] = "Installed I2P+ system service";
    t[4139] = "\u062a\u062b\u0628\u064a\u062a \u062e\u062f\u0645\u0629 \u0646\u0638\u0627\u0645 I2P+";
    t[4142] = "An address containing an encrypted LeaseSet is informally referred to as a b33 address, an extension of a base32 address with the host's public key and signature type encoded into the address instead of a lookup hash. This address type is required for blinded Leasesets. More information: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>B33 Specification</a>";
    t[4143] = "\u064a\u0634\u0627\u0631 \u0625\u0644\u0649 \u0627\u0644\u0639\u0646\u0648\u0627\u0646 \u0627\u0644\u0630\u064a \u064a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 LeaseSet \u0645\u0634\u0641\u0631 \u063a\u064a\u0631 \u0631\u0633\u0645\u064a\u064b\u0627 \u0628\u0627\u0633\u0645 \u0639\u0646\u0648\u0627\u0646 b33\u060c \u0648\u0647\u0648 \u0627\u0645\u062a\u062f\u0627\u062f \u0644\u0639\u0646\u0648\u0627\u0646 \u0628\u064a\u063232 \u0648\u064a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0627\u0644\u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0639\u0627\u0645 \u0644\u0644\u0645\u0636\u064a\u0641 \u0648\u0646\u0648\u0639 \u0627\u0644\u062a\u0648\u0642\u064a\u0639 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0647\u0627\u0634 \u0627\u0644\u0628\u062d\u062b. \u064a\u062a\u0637\u0644\u0628 \u0647\u0630\u0627 \u0646\u0648\u0639 \u0627\u0644\u0639\u0646\u0648\u0627\u0646 \u0644\u0640 Leasesets \u0627\u0644\u0645\u062e\u0641\u064a\u0629. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a: <a href=https://geti2p.net/spec/b32encrypted class='sitelink external' target=_blank rel=noreferrer>\u0645\u0648\u0627\u0635\u0641\u0629 B33</a>";
    t[4146] = "Bandwidth test was not running";
    t[4147] = "\u0627\u062e\u062a\u0628\u0627\u0631 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u062a\u0631\u062f\u062f\u064a \u0644\u0645 \u064a\u0643\u0646 \u0642\u064a\u062f \u0627\u0644\u062a\u0634\u063a\u064a\u0644";
