    t[4159] = "\u0634\u0647\u0627\u062f\u0629 \u0639\u0627\u0626\u0644\u0629 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u0645\u062d\u0644\u064a";
    t[4160] = "Then click the <i>Save changes</i> button to confirm the proxy configuration and then the <i>Reseed now</i> button to initiate the reseed process.";
    t[4161] = "\u0628\u0639\u062f \u0630\u0644\u0643\u060c \u0627\u0646\u0642\u0631 \u0639\u0644\u0649 \u0632\u0631 <i>\u062d\u0641\u0638 \u0627\u0644\u062a\u063a\u064a\u064a\u0631\u0627\u062a</i> \u0644\u0644\u062a\u0623\u0643\u064a\u062f \u0639\u0644\u0649 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0648\u0643\u064a\u0644 \u0627\u0644\u0645\u0631\u0627\u0642\u0628\u0629 \u062b\u0645 \u0627\u0636\u063a\u0637 \u0639\u0644\u0649 \u0632\u0631 <i>\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631 \u0627\u0644\u0622\u0646</i> \u0644\u0628\u062f\u0621 \u0639\u0645\u0644\u064a\u0629 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631.";
