    t[4180] = "Keys for local destinations must be entered on the configuration page for the relevant service in the";
    t[4181] = "\u064a\u062c\u0628 \u0625\u062f\u062e\u0627\u0644 \u0645\u0641\u0627\u062a\u064a\u062d \u0627\u0644\u0648\u062c\u0647\u0627\u062a \u0627\u0644\u0645\u062d\u0644\u064a\u0629 \u0641\u064a \u0635\u0641\u062d\u0629 \u0627\u0644\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0627\u0644\u062e\u062f\u0645\u0629 \u0630\u0627\u062a \u0627\u0644\u0635\u0644\u0629 \u0641\u064a";
