    t[4214] = "I2P Services";
    t[4215] = "\u062e\u062f\u0645\u0627\u062a I2P";
    t[4216] = "This setting allows you to configure the update url for the unsigned update feature, if enabled. The url should end with <code>/i2pupdate.zip</code>. Note: do not install unsigned updates unless you trust the source of the update!";
    t[4217] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u0633\u0645\u062d \u0644\u0643 \u0628\u062a\u0643\u0648\u064a\u0641 \u0639\u0646\u0648\u0627\u0646 URL \u0627\u0644\u062a\u062d\u062f\u064a\u062b \u0645\u0646 \u0623\u062c\u0644 \u0645\u064a\u0632\u0629 \u0627\u0644\u062a\u062d\u062f\u064a\u062b\u0627\u062a \u063a\u064a\u0631 \u0627\u0644\u0645\u0648\u0642\u0651\u0639\u0629\u060c \u0625\u0646 \u062a\u0645 \u062a\u0645\u0643\u064a\u0646\u0647\u0627. \u064a\u062c\u0628 \u0623\u0646 \u064a\u0646\u062a\u0647\u064a \u0639\u0646\u0648\u0627\u0646 \u0627\u0644URL \u0628\u0640 <code>/i2pupdate.zip</code>. \u0645\u0644\u0627\u062d\u0638\u0629: \u0644\u0627 \u062a\u0642\u0645 \u0628\u062a\u062b\u0628\u064a\u062a \u0627\u0644\u062a\u062d\u062f\u064a\u062b\u0627\u062a \u063a\u064a\u0631 \u0627\u0644\u0645\u0648\u0642\u0651\u0639\u0629 \u0625\u0644\u0627 \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u062b\u0642 \u0628\u0645\u0635\u062f\u0631 \u0627\u0644\u062a\u062d\u062f\u064a\u062b!";
    t[4220] = "View Logs";
    t[4221] = "\u0639\u0631\u0636 \u0627\u0644\u0633\u062c\u0644\u0627\u062a";
