    t[4272] = "Acquired only 1 router info from reseed hosts";
    t[4273] = new java.lang.String[] { "\u062a\u0645 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 {0} \u0641\u0642\u0637 \u0645\u0646 \u0627\u0644\u0645\u0636\u064a\u0641\u064a\u0646 \u0627\u0644\u0645\u0639\u0627\u062f\u064a\u0646", "\u062a\u0645 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 {0} \u0641\u0642\u0637 \u0645\u0646 \u0627\u0644\u0645\u0636\u064a\u0641\u064a\u0646 \u0627\u0644\u0645\u0639\u0627\u062f\u064a\u0646", "\u062a\u0645 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 {0} \u0641\u0642\u0637 \u0645\u0646 \u0627\u0644\u0645\u0636\u064a\u0641\u064a\u0646 \u0627\u0644\u0645\u0639\u0627\u062f\u064a\u0646", "\u062a\u0645 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 {0} \u0641\u0642\u0637 \u0645\u0646 \u0627\u0644\u0645\u0636\u064a\u0641\u064a\u0646 \u0627\u0644\u0645\u0639\u0627\u062f\u064a\u0646", "\u062a\u0645 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 {0} \u0641\u0642\u0637 \u0645\u0646 \u0627\u0644\u0645\u0636\u064a\u0641\u064a\u0646 \u0627\u0644\u0645\u0639\u0627\u062f\u064a\u0646", "\u062a\u0645 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 {0} \u0641\u0642\u0637 \u0645\u0646 \u0627\u0644\u0645\u0636\u064a\u0641\u064a\u0646 \u0627\u0644\u0645\u0639\u0627\u062f\u064a\u0646" };
    t[4274] = "This setting, when set to true, prevents a router from directly communicating with other routers, forcing the use of introducers. [Default is false unlesss router is in hidden mode]";
    t[4275] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u060c \u0639\u0646\u062f \u062a\u0639\u064a\u064a\u0646\u0647 \u0639\u0644\u0649 \u0635\u062d\u064a\u062d\u060c \u064a\u0645\u0646\u0639 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0645\u0646 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0645\u0628\u0627\u0634\u0631\u0629 \u0628\u0627\u0644\u0631\u0648\u0627\u062a\u0631 \u0627\u0644\u0623\u062e\u0631\u0649\u060c \u0645\u0645\u0627 \u064a\u062c\u0628\u0631 \u0639\u0644\u0649 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0645\u0639\u0631\u0651\u0641\u064a\u0646. [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 \u062e\u0637\u0623 \u0645\u0627 \u0644\u0645 \u064a\u0643\u0646 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0641\u064a \u0648\u0636\u0639 \u0627\u0644\u0625\u062e\u0641\u0627\u0621]";
    t[4280] = "Job statistics for this session";
    t[4281] = "\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a \u0627\u0644\u0648\u0638\u0627\u0626\u0641 \u0644\u0647\u0630\u0647 \u0627\u0644\u062f\u0648\u0631\u0629";
    t[4286] = "Network Database entry";
    t[4287] = "\u0625\u062f\u062e\u0627\u0644 \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629";
    t[4292] = "Most of the eepsites are down?";
    t[4293] = "\u0647\u0644 \u0645\u0639\u0638\u0645 \u0645\u0648\u0627\u0642\u0639 eepsite \u063a\u064a\u0631 \u0646\u0634\u0637\u0629\u061f";
    t[4296] = "To log all unique remote destinations connecting to a server, and also log aggressive connection attempts:";
    t[4297] = "\u0644\u062a\u0633\u062c\u064a\u0644 \u062c\u0645\u064a\u0639 \u0627\u0644\u0648\u062c\u0647\u0627\u062a \u0627\u0644\u0639\u0646 \u0628\u0639\u062f \u0627\u0644\u0641\u0631\u064a\u062f\u0629 \u0627\u0644\u0645\u062a\u0635\u0644\u0629 \u0628\u062e\u0627\u062f\u0645\u060c \u0648\u0623\u064a\u0636\u064b\u0627 \u062a\u0633\u062c\u064a\u0644 \u0645\u062d\u0627\u0648\u0644\u0627\u062a \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u0639\u062f\u0648\u0627\u0646\u064a\u0629:";
    t[4306] = "Fresh hacks every day";
    t[4307] = "\u062d\u064a\u0644 \u062c\u062f\u064a\u062f\u0629 \u0643\u0644 \u064a\u0648\u0645";
    t[4312] = "URL";
    t[4313] = "\u0627\u0644\u0639\u0646\u0648\u0627\u0646";
    t[4326] = "I2P Router Help &amp; FAQ";
    t[4327] = "\u062a\u0639\u0644\u064a\u0645\u0627\u062a \u0648\u0625\u0631\u0634\u0627\u062f\u0627\u062a \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 I2P+ \u0627\u0644\u062a\u0639\u0644\u064a\u0645\u0627\u062a";
    t[4328] = "Indicates how quickly outbound messages to other I2P routers are sent";
    t[4329] = "\u064a\u0634\u064a\u0631 \u0625\u0644\u0649 \u0645\u062f\u0649 \u0633\u0631\u0639\u0629 \u0625\u0631\u0633\u0627\u0644 \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u0635\u0627\u062f\u0631\u0629 \u0625\u0644\u0649 \u0623\u062c\u0647\u0632\u0629 \u062a\u0648\u062c\u064a\u0647 I2P \u0627\u0644\u0623\u062e\u0631\u0649";
    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "\u0645\u0644\u0627\u062d\u0638\u0629: \u062a\u0647\u0645 \u062a\u0631\u062a\u064a\u0628 \u0627\u0644\u0625\u0639\u0644\u0627\u0646\u0627\u062a. \u064a\u062a\u062c\u0627\u0648\u0632 \u0623\u0648\u0644 \u0625\u0639\u0644\u0627\u0646 \u0644\u0639\u062a\u0628\u0629 \u0645\u0639\u064a\u0646\u0629 \u0644\u0648\u062c\u0647\u0629 \u0645\u0639\u064a\u0646\u0629 (\u0633\u0648\u0627\u0621 \u0635\u0631\u0627\u062d\u0629 \u0623\u0645 \u0645\u062f\u0631\u062c\u0629 \u0641\u064a \u0645\u0644\u0641 \u0645\u0631\u062c\u0639\u064a) \u0623\u064a \u0639\u062a\u0628\u0627\u062a \u0645\u0633\u062a\u0642\u0628\u0644\u064a\u0629 \u0644\u0646\u0641\u0633 \u0627\u0644\u0648\u062c\u0647\u0629\u060c \u0633\u0648\u0627\u0621 \u0643\u0627\u0646\u062a \u0635\u0631\u064a\u062d\u0629 \u0623\u0645 \u0645\u062f\u0631\u062c\u0629 \u0641\u064a \u0645\u0644\u0641. \u0645\u0644\u0627\u062d\u0638\u0629: \u0644\u062a\u0637\u0628\u064a\u0642 \u0645\u0644\u0641 \u0645\u0635\u0641\u064a \u062c\u062f\u064a\u062f\u060c \u064a\u062c\u0628 \u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0646\u0641\u0642 \u0628\u0639\u062f \u062a\u062d\u062f\u064a\u062f \u0645\u0648\u0642\u0639\u0647 \u0641\u064a \u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642. \u0628\u0645\u062c\u0631\u062f \u0627\u0644\u062a\u0643\u0648\u064a\u0646\u060c \u064a\u0645\u0643\u0646 \u062a\u062d\u062f\u064a\u062b \u0645\u0644\u0641 \u0627\u0644\u062a\u0639\u0631\u064a\u0641 \u062f\u0648\u0646 \u0627\u0644\u062d\u0627\u062c\u0629 \u0644\u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0646\u0641\u0642 \u0627\u0644\u0645\u0633\u062a\u0647\u062f\u0641\u060c \u0639\u0644\u0649 \u0627\u0644\u0631\u063a\u0645 \u0645\u0646 \u0623\u0646 \u0627\u0644\u0648\u062c\u0647\u0627\u062a \u0627\u0644\u0645\u062d\u062c\u0648\u0628\u0629 \u0633\u062a\u0633\u062a\u0645\u0631 \u062d\u062a\u0649 \u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0646\u0641\u0642.";
    t[4344] = "Test server location";
    t[4345] = "\u0627\u062e\u062a\u0628\u0627\u0631 \u0645\u0648\u0642\u0639 \u0627\u0644\u062e\u0627\u062f\u0645";
