    t[4347] = "\u062e\u062f\u0645\u0629 \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629 \u062a\u0648\u0641\u0631 \u0627\u062a\u0635\u0627\u0644 \u0628\u0631\u0643\u0633\u064a \u0625\u0644\u0649 <i>\u0627\u0644\u0634\u0628\u0643\u0629 \u0627\u0644\u0639\u0627\u062f\u064a\u0629</i>. \u0628\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u060c \u064a\u0643\u0648\u0646 \u0644\u062f\u0649 I2P \u0622\u0648\u062a\u0628\u0631\u0648\u0643\u0633\u064a HTTP \u0645\u0647\u064a\u0626 \u0644\u062a\u0635\u0641\u062d \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a \u0639\u0644\u0649 <code>127.0.0.1:4444</code>.";
