    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "\u0627\u0644\u0625\u0635\u062f\u0627\u0631 \u0645\u0646 \u0628\u0631\u0646\u0627\u0645\u062c I2P \u0627\u0644\u0630\u064a \u062a\u0639\u0645\u0644\u0647. \u0625\u0630\u0627 \u0623\u0635\u0628\u062d \u0625\u0635\u062f\u0627\u0631 \u062c\u062f\u064a\u062f \u0645\u062a\u0627\u062d\u064b\u0627\u060c \u0633\u064a\u062a\u0645 \u0625\u062e\u0637\u0627\u0631\u0643 \u0641\u064a \u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a. \u0645\u0646 \u0627\u0644\u0645\u062d\u0628\u0630 \u0627\u0644\u0627\u062d\u062a\u0641\u0627\u0638 \u0628\u0645\u0648\u062c\u0647\u0643 \u0645\u062d\u062f\u062b\u064b\u0627 \u0644\u0636\u0645\u0627\u0646 \u0627\u0644\u0623\u062f\u0627\u0621 \u0648\u0627\u0644\u0623\u0645\u0646 \u0627\u0644\u0623\u0645\u062b\u0644. \u0639\u0627\u062f\u0629 \u0645\u0627 \u064a\u062a\u0645 \u062c\u0639\u0644 \u0627\u0644\u062a\u062d\u062f\u064a\u062b\u0627\u062a \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0627\u0644\u0645\u0648\u062c\u0647 \u0645\u062a\u0627\u062d\u0629 \u0628\u0645\u0639\u062f\u0644 \u0643\u0644 2-3 \u0623\u0634\u0647\u0631.";
