    t[4823] = "\u0643\u0646 \u0639\u0644\u0649 \u0639\u0644\u0645 \u0628\u0623\u0646 \u062e\u0627\u062f\u0645 \u0627\u0644\u0648\u064a\u0628 \u0623\u0648 \u062a\u0637\u0628\u064a\u0642 \u0627\u0644\u0648\u064a\u0628 \u0627\u0644\u0630\u064a \u062a\u0645 \u062a\u0643\u0648\u064a\u0646\u0647 \u0628\u0634\u0643\u0644 \u0633\u064a\u0626 \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0633\u0631\u0628 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0645\u062b\u0644 \u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u062d\u0642\u064a\u0642\u064a \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0623\u0648 \u062a\u0641\u0627\u0635\u064a\u0644 \u0627\u0644\u062e\u0627\u062f\u0645 \u0627\u0644\u062a\u064a  \u062a\u0642\u0644\u0644 \u0645\u0646 \u0639\u062f\u0645 \u0627\u0644\u0643\u0634\u0641 \u0639\u0646 \u0647\u0648\u064a\u062a\u0643 \u0623\u0648 \u062a\u0633\u0627\u0639\u062f \u0627\u0644\u0645\u062a\u0633\u0644\u0644. \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0633\u062a\u062e\u062f\u0645 \u0645\u0646\u0635\u0629 \u0628\u062f\u064a\u0644\u0629\u060c \u0641\u062a\u0623\u0643\u062f \u0645\u0646 \u062a\u0623\u0645\u064a\u0646\u0647\u0627 \u0642\u0628\u0644 \u0648\u0636\u0639\u0647\u0627 \u0639\u0644\u0649 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a. \u0625\u0630\u0627 \u0643\u0646\u062a \u0641\u064a \u0634\u0643\u060c \u0641\u0627\u0631\u062c\u0639 \u0625\u0644\u0649 \u0627\u0644\u0623\u062f\u0644\u0629 \u0639\u0628\u0631 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a \u062d\u0648\u0644 \u062a\u0642\u0648\u064a\u0629 \u062e\u0627\u062f\u0645 \u0627\u0644\u0648\u064a\u0628 \u0648\u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0627\u0644\u0648\u064a\u0628\u060c \u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644:";
