    t[4864] = "A web application supplied with the router that permits creation and configuration of client and server tunnels. Also referred to as the <i>Hidden Services Manager</i>.";
    t[4865] = "\u062a\u0637\u0628\u064a\u0642 \u0648\u064a\u0628 \u0645\u0648\u0631\u062f \u0645\u0639 \u0627\u0644\u0645\u0648\u062c\u0647 \u064a\u0633\u0645\u062d \u0628\u0625\u0646\u0634\u0627\u0621 \u0648\u062a\u0643\u0648\u064a\u0646 \u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0639\u0645\u064a\u0644 \u0648\u062e\u0627\u062f\u0648\u0645. \u064a\u0634\u0627\u0631 \u0625\u0644\u064a\u0647 \u0623\u064a\u0636\u064b\u0627 \u0628\u0627\u0633\u0645 <i>\u0645\u062f\u064a\u0631 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0645\u062e\u0641\u064a\u0629</i>.";
    t[4870] = "Cross-network micro-blogging &amp; forums &amp; wiki";
