    t[4890] = "Start or stop Router clients";
    t[4891] = "\u062a\u0634\u063a\u064a\u0644 \u0623\u0648 \u0625\u064a\u0642\u0627\u0641 \u0639\u0645\u0644\u0627\u0621 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647";
    t[4894] = "UPnP support is beta, and may not work for any number of reasons";
