    t[4901] = "\u0625\u0639\u0627\u062f\u0629 \u0632\u0631\u0639 \u0627\u0644\u0645\u0633\u0627\u0639\u062f\u0629";
    t[4914] = "Save settings and redraw graphs";
    t[4915] = "\u062d\u0641\u0638 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0648\u0625\u0639\u0627\u062f\u0629 \u0631\u0633\u0645 \u0627\u0644\u0631\u0633\u0648\u0645 \u0627\u0644\u0628\u064a\u0627\u0646\u064a\u0629";
    t[4920] = "Configure update URLs and policy";
    t[4921] = "\u0642\u0645 \u0628\u062a\u0643\u0648\u064a\u0646 \u0639\u0646\u0627\u0648\u064a\u0646 URL \u0648\u0627\u0644\u0633\u064a\u0627\u0633\u0629 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0627\u0644\u062a\u062d\u062f\u064a\u062b";
    t[4922] = "Participating";
    t[4923] = "\u0645\u0634\u0627\u0631\u0643";
    t[4924] = "The current external IP address is not available.";
    t[4925] = "\u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u0627\u0644\u062d\u0627\u0644\u064a \u063a\u064a\u0631 \u0645\u062a\u0648\u0641\u0631.";
    t[4926] = "Update link";
    t[4927] = "\u0648\u0635\u0644\u0629 \u0627\u0644\u062a\u0631\u0642\u064a\u0629";
    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "\u064a\u0639\u0645\u0644 \u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u060c \u0639\u0646\u062f \u062a\u0643\u0648\u064a\u0646\u0647 \u0628\u0645\u0633\u0627\u0631 \u064a\u0634\u064a\u0631 \u0625\u0644\u0649 \u0645\u0644\u0641 \u0642\u0627\u0626\u0645\u0629 \u062d\u0638\u0631 \u0635\u0627\u0644\u062d\u060c \u0639\u0644\u0649 \u062a\u0645\u0643\u064a\u0646 \u062a\u062d\u0645\u064a\u0644 \u0642\u0627\u0626\u0645\u0629 \u062d\u0638\u0631 \u0625\u0636\u0627\u0641\u064a\u0629 \u0645\u0643\u0648\u0646\u0629 \u0628\u0648\u0627\u0633\u0637\u0629 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645 \u0639\u0646\u062f \u0628\u062f\u0621 \u062a\u0634\u063a\u064a\u0644 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647. ";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "\u064a\u062f\u0639\u0645 I2P+ \u062a\u062c\u0627\u0648\u0632\u0627\u062a \u0637\u062d\u0646 \u0645\u062e\u0635\u0635\u0629 \u0644\u0644\u0643\u0648\u0646\u0633\u0648\u0644\u060c \u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642\u060c I2PSnark\u060c SusiDNS \u0648 Susimail\u060c \u0645\u0645\u0627 \u064a\u062a\u064a\u062d \u0625\u062c\u0631\u0627\u0621 \u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0639\u0644\u0649 \u0627\u0644\u0623\u0637\u0645\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0633\u062a\u0645\u0631 \u0628\u0639\u062f \u0627\u0644\u062a\u062d\u062f\u064a\u062b\u0627\u062a. \u0645\u0646 \u0623\u062c\u0644 \u062a\u0641\u0639\u064a\u0644 \u062a\u062c\u0627\u0648\u0632\u060c \u0642\u0645 \u0628\u0625\u0646\u0634\u0627\u0621 \u0645\u0644\u0641 css \u0628\u0627\u0633\u0645 <code>override.css</code> \u0645\u0639 \u062a\u0639\u062f\u064a\u0644\u0627\u062a \u0637\u062d\u0646\u0643 \u0648\u0648\u0636\u0639\u0647 \u0641\u064a \u062f\u0644\u064a\u0644 \u0633\u0645\u0629 \u0630\u0627\u062a \u0635\u0644\u0629 \u0628\u0627\u0644\u0637\u062d\u0646 \u0627\u0644\u0630\u064a \u062a\u0631\u063a\u0628 \u0641\u064a \u062a\u063a\u064a\u064a\u0631\u0647\u060c \u0623\u0648 \u0625\u0639\u0627\u062f\u0629 \u062a\u0633\u0645\u064a\u0629 \u0623\u062d\u062f \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0627\u0644\u0646\u0645\u0648\u0630\u062c\u064a\u0629\u060c \u062b\u0645 \u0623\u0639\u062f \u062a\u062d\u0645\u064a\u0644 \u0627\u0644\u0645\u062a\u0635\u0641\u062d \u0628\u0627\u0644\u0642\u0648\u0629. \u0645\u0644\u0627\u062d\u0638\u0629 \u0623\u0646 \u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0648\u0627\u0644\u0643\u0648\u0646\u0633\u0648\u0644 \u064a\u0634\u062a\u0631\u0643\u0627\u0646 \u0641\u064a \u0646\u0641\u0633 \u0645\u0644\u0641 override.css. \u0644\u0625\u0644\u063a\u0627\u0621 \u062a\u0641\u0639\u064a\u0644 \u0627\u0644\u062a\u062c\u0627\u0648\u0632\u060c \u0627\u062d\u0630\u0641 \u0623\u0648 \u0623\u0639\u062f \u062a\u0633\u0645\u064a\u0629 \u0645\u0644\u0641 <code>override.css</code> \u062b\u0645 \u0623\u0639\u062f \u062a\u062d\u0645\u064a\u0644 \u0627\u0644\u0645\u062a\u0635\u0641\u062d \u0628\u0627\u0644\u0642\u0648\u0629 (\u0639\u0627\u062f\u0629 \u0627\u0644\u0645\u0641\u062a\u0627\u062d \u0627\u0644\u062a\u062d\u0643\u0645 + Shift + R).";
    t[4942] = "Aborted startup";
    t[4943] = "\u0625\u062d\u0628\u0627\u0637 \u0628\u062f\u0621 \u0627\u0644\u062a\u0634\u063a\u064a\u0644";
    t[4948] = "A restart may be required to update the router, implement a configuration change, or complete installation of a plugin.";
    t[4949] = "\u0642\u062f \u062a\u0643\u0648\u0646 \u0647\u0646\u0627\u0643 \u062d\u0627\u062c\u0629 \u0625\u0644\u0649 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0634\u063a\u064a\u0644 \u0644\u062a\u062d\u062f\u064a\u062b \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647\u060c \u0623\u0648 \u062a\u0646\u0641\u064a\u0630 \u062a\u063a\u064a\u064a\u0631 \u0641\u064a \u0627\u0644\u062a\u0643\u0648\u064a\u0646\u060c \u0623\u0648 \u0625\u0643\u0645\u0627\u0644 \u062a\u062b\u0628\u064a\u062a \u0627\u0644\u0628\u0631\u0646\u0627\u0645\u062c \u0627\u0644\u0625\u0636\u0627\u0641\u064a.";
