    t[4965] = "\u0633\u064a\u0624\u062f\u064a \u062a\u063a\u064a\u064a\u0631 \u0647\u0630\u0647 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0625\u0644\u0649 \u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.";
    t[4968] = "Console is to be shown on startup";
