    t[4982] = "They offered to introduce us (help peers traverse our firewall)";
    t[4983] = "\u0639\u0631\u0636\u0648\u0627 \u062a\u0642\u062f\u064a\u0645\u0646\u0627 (\u0645\u0633\u0627\u0639\u062f\u0629 \u0623\u0642\u0631\u0627\u0646\u0646\u0627 \u0641\u064a \u0627\u062c\u062a\u064a\u0627\u0632 \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u062e\u0627\u0635 \u0628\u0646\u0627)";
