    t[4985] = "\u0642\u0645 \u0628\u062a\u062d\u062f\u064a\u062b I2P \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0648\u0643\u064a\u0644 I2P http";
