    t[5007] = "\u0628\u062d\u062b \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647";
    t[5008] = "Jump Service";
    t[5009] = "\u062e\u062f\u0645\u0629 \u0627\u0644\u0642\u0641\u0632";
