    t[5015] = "\u0627\u0631\u0633\u0645 \u0627\u0644\u0623\u062d\u062f\u0627\u062b";
    t[5020] = "Disable IPv6";
    t[5021] = "\u062a\u0639\u0637\u064a\u0644 IPv6";
