    t[5031] = "\u0645\u0633\u062a\u062e\u062f\u0645";
    t[5034] = "A router in a tunnel not designated as a gateway or endpoint.";
    t[5035] = "\u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 \u0641\u064a \u0646\u0641\u0642 \u063a\u064a\u0631 \u0645\u062e\u0635\u0635 \u0643\u0628\u0648\u0627\u0628\u0629 \u0623\u0648 \u0646\u0642\u0637\u0629 \u0646\u0647\u0627\u064a\u0629.";
    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "\u0639\u0646\u062f \u062a\u0639\u064a\u064a\u0646\u0647 \u0639\u0644\u0649 \u0635\u062d\u064a\u062d\u060c \u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u0645\u0643\u0651\u0646 \u0628\u062d\u062b \u0627\u0644\u0639\u0643\u0633\u064a \u0644\u0627\u0633\u0645 \u0627\u0644\u0646\u0637\u0627\u0642 \u0644\u0644\u0623\u0642\u0631\u0627\u0646\u060c \u0645\u0634\u063a\u0651\u0644 \u0639\u0646\u062f \u0639\u0631\u0636 \u0639\u0644\u0645 \u0627\u0644\u062f\u0648\u0644\u0629 \u0644\u0644\u0623\u0642\u0631\u0627\u0646 \u0623\u0648 \u0639\u0646\u062f \u0639\u0631\u0636 \u0627\u0633\u0645 \u0627\u0644\u0645\u0636\u064a\u0641 \u0623\u0648 \u0627\u0644\u0646\u0637\u0627\u0642 \u0628\u0634\u0643\u0644 \u0635\u0631\u064a\u062d \u0641\u064a \u0648\u0627\u062c\u0647\u0629 \u0627\u0644\u062a\u062d\u0643\u0645\u060c \u0623\u0648 \u0639\u0646\u062f \u0643\u062a\u0627\u0628\u0629 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0644\u0644\u0623\u0642\u0631\u0627\u0646 \u0639\u0644\u0649 \u0627\u0644\u0642\u0631\u0635. \u0645\u0646 \u0623\u062c\u0644 \u062a\u062c\u0646\u0651\u0628 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u062d\u062b\u060c \u064a\u0648\u0635\u0649 \u0628\u062a\u0643\u0648\u064a\u0641 \u0633\u064a\u0627\u0633\u0629 \u062c\u0648\u062f\u0648\u0633\u0629 \u0644\u0645\u0647\u0644 \u0623\u0643\u062b\u0631 \u0645\u0646 10 \u062f\u0642\u0627\u0626\u0642 \u0644\u0628\u062d\u062b \u0627\u0633\u0645 \u0627\u0644\u0646\u0637\u0627\u0642\u060c \u0648\u062a\u0643\u0648\u064a\u0641 \u062e\u0627\u062f\u0648\u0645 \u0627\u0633\u0645 \u0646\u0637\u0627\u0642 \u064a\u062d\u062a\u0631\u0645 \u0627\u0644\u062e\u0635\u0648\u0635\u064a\u0629 \u0641\u064a \u0646\u0638\u0627\u0645 \u0627\u0644\u062a\u0634\u063a\u064a\u0644. [\u063a\u064a\u0631 \u0645\u0645\u0643\u0651\u0646 \u0628\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u060c \u064a\u062a\u0637\u0644\u0628 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0634\u063a\u064a\u0644]";
    t[5048] = "OK";
    t[5049] = "\u0645\u0648\u0627\u0641\u0642";
    t[5058] = "No";
    t[5059] = "\u0644\u0627";
    t[5080] = "Banned Peers";
    t[5081] = "\u0645\u0633\u062a\u062e\u062f\u0645\u0648\u0646 \u0645\u0645\u0646\u0648\u0639\u0648\u0646";
    t[5082] = "light";
    t[5083] = "\u0641\u0627\u062a\u062d";
    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0634\u063a\u0644 \u0645\u0648\u0642\u0639\u064b\u0627 \u062f\u064a\u0646\u0627\u0645\u064a\u0643\u064a\u064b\u0627 \u064a\u062a\u0639\u0627\u0645\u0644 \u0645\u0639 \u0639\u062f\u062f \u0643\u0628\u064a\u0631 \u0645\u0646 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646 \u0628\u0634\u0643\u0644 \u0645\u062a\u0632\u0627\u0645\u0646\u060c \u0641\u0625\u0646 \u062a\u062e\u0632\u064a\u0646 \u0627\u0644\u0645\u062d\u062a\u0648\u0649 \u0641\u064a \u0627\u0644\u0630\u0627\u0643\u0631\u0629 \u0642\u062f \u064a\u062d\u0633\u0646 \u063a\u0627\u0644\u0628\u064b\u0627 \u0627\u0644\u0648\u0642\u062a \u0627\u0644\u0645\u0633\u062a\u063a\u0631\u0642 \u0644\u062a\u0648\u0635\u064a\u0644 \u0627\u0644\u0635\u0641\u062d\u0627\u062a. \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0644\u0645\u062d\u062a\u0648\u0649 \u0627\u0644\u0630\u064a \u064a\u062a\u063a\u064a\u0631 \u0628\u0633\u0631\u0639\u0629\u060c \u0642\u062f \u0644\u0627 \u062a\u0632\u0627\u0644 \u0627\u0633\u062a\u0631\u0627\u062a\u064a\u062c\u064a\u0629 \"\u0627\u0644\u062a\u062e\u0632\u064a\u0646 \u0627\u0644\u0635\u063a\u064a\u0631\" <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching</a> \u062a\u0639\u0648\u062f \u0628\u0628\u0639\u0636 \u0627\u0644\u0641\u0648\u0627\u0626\u062f. \u064a\u0648\u0641\u0631 \u062e\u0627\u062f\u0648\u0645 \u0627\u0644\u0648\u064a\u0628 <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx</a> \u0646\u0638\u0627\u0645 \u062a\u062e\u0632\u064a\u0646 \u0641\u0639\u0627\u0644\u060c \u0623\u0648 \u0644\u062d\u0644 \u0623\u062b\u0642\u0644 \u0648\u0632\u0646\u064b\u0627\u060c \u062a\u0641\u062d\u0635 <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
