    t[5224] = "Show all news";
    t[5225] = "\u0639\u0631\u0636 \u0643\u0644 \u0627\u0644\u0623\u062e\u0628\u0627\u0631";
    t[5238] = "An unmaintained I2P plugin that provides serverless, end-to-end encrypted e-mail within the I2P network. For more information, see <a href=http://bote.i2p/ class=sitelink target=_blank rel=noreferrer>http://bote.i2p/</a>. Source code is available on <a href=https://github.com/i2p/i2p.i2p-bote class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[5239] = "\u0625\u0636\u0627\u0641\u0629 I2P \u063a\u064a\u0631 \u0645\u0635\u062d\u0648\u0628\u0629 \u0628\u0635\u064a\u0627\u0646\u0629 \u062a\u0648\u0641\u0631 \u0628\u0631\u064a\u062f\u064b\u0627 \u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a\u064b\u0627 \u0645\u0634\u0641\u0631\u064b\u0627 \u0645\u0646 \u0646\u0647\u0627\u064a\u0629 \u0625\u0644\u0649 \u0623\u062e\u0631\u0649 \u062f\u0627\u062e\u0644 \u0634\u0628\u0643\u0629 I2P. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a\u060c \u0642\u0645 \u0628\u0632\u064a\u0627\u0631\u0629 <a href=http://bote.i2p/ class=sitelink target=_blank rel=noreferrer>http://bote.i2p/</a>. \u0645\u0635\u062f\u0631 \u0627\u0644\u0643\u0648\u062f \u0645\u062a\u0627\u062d \u0639\u0644\u0649 <a href=https://github.com/i2p/i2p.i2p-bote class='sitelink external' target=_blank rel=noreferrer>github</a>.";
