    t[5273] = "\u062a\u0645 \u0627\u0644\u0643\u0634\u0641 \u0639\u0646 \u0625\u0635\u062f\u0627\u0631 \u0642\u062f\u064a\u0645 \u062c\u062f\u064b\u0627. \u0644\u0627 \u064a\u0648\u0635\u0649 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 I2P \u0645\u0639 \u0645\u062a\u0635\u0641\u062d\u0627\u062a \u063a\u064a\u0631 \u0645\u062f\u0627\u0648\u0645\u0629 \u062a\u0637\u0648\u064a\u0631\u0647\u0627.";
