    t[5301] = "\u0645\u0646\u0639 \u062d\u062a\u0649 \u0627\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0634\u063a\u064a\u0644";
    t[5312] = "This setting determines whether routers classified as uninteresting (K or L tier, unreachable or older than 0.9.50) are checked during the refresh router process after 1 hour of uptime. [Default is false]";
    t[5313] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u062d\u062f\u062f \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0627\u0644\u0631\u0648\u0627\u062a\u0631 \u0627\u0644\u0645\u0635\u0646\u0651\u0641\u0629 \u063a\u064a\u0631 \u0630\u0627\u062a \u0623\u0647\u0645\u064a\u0629 (\u0641\u0626\u0629 K \u0623\u0648 L\u060c \u063a\u064a\u0631 \u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u0648\u0635\u0648\u0644 \u0623\u0648 \u0623\u0642\u062f\u0645 \u0645\u0646 0.9.50) \u0633\u064a\u062a\u0645 \u0641\u062d\u0635\u0647\u0627 \u0623\u062b\u0646\u0627\u0621 \u0639\u0645\u0644\u064a\u0629 \u062a\u062d\u062f\u064a\u062b \u0627\u0644\u0631\u0648\u0627\u062a\u0631 \u0628\u0639\u062f \u0633\u0627\u0639\u0629 \u0648\u0627\u062d\u062f\u0629 \u0645\u0646 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0646\u0638\u0627\u0645. [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 \u062e\u0637\u0623]";
    t[5318] = "Configure router networking options";
    t[5319] = "\u062a\u0643\u0648\u064a\u0646 \u062e\u064a\u0627\u0631\u0627\u062a \u0634\u0628\u0643\u0629 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647";
    t[5324] = "Plugins";
    t[5325] = "\u0627\u0644\u0627\u0636\u0627\u0641\u0627\u062a";
    t[5330] = "The default subscription is to <code>http://i2p-projekt.i2p/hosts.txt</code> which is seldom updated. If you don't have another subscription, you may often have to use \"jump\" links which is much slower but ensures that your addressbook is only populated by sites you use (in addition to the default subscription addresses). To speed up browsing on I2P, it's a good idea to add some addressbook subscriptions.";
    t[5331] = "\u0627\u0644\u0627\u0634\u062a\u0631\u0627\u0643 \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 \u0641\u064a <code>http://i2p-projekt.i2p/hosts.txt</code> \u0648\u0627\u0644\u0630\u064a \u064a\u062a\u0645 \u062a\u062d\u062f\u064a\u062b\u0647 \u0646\u0627\u062f\u0631\u0627. \u0625\u0630\u0627 \u0644\u0645 \u064a\u0643\u0646 \u0644\u062f\u064a\u0643 \u0627\u0634\u062a\u0631\u0627\u0643 \u0622\u062e\u0631\u060c \u0641\u0642\u062f \u062a\u0636\u0637\u0631 \u0641\u064a \u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0625\u0644\u0649 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0631\u0648\u0627\u0628\u0637 \"\u0627\u0644\u0642\u0641\u0632\" \u0648\u0627\u0644\u062a\u064a \u062a\u0643\u0648\u0646 \u0623\u0628\u0637\u0623 \u0628\u0643\u062b\u064a\u0631 \u0648\u0644\u0643\u0646\u0647\u0627 \u062a\u0636\u0645\u0646 \u0623\u0646 \u064a\u062a\u0645 \u0645\u0644\u0621 \u062f\u0644\u064a\u0644 \u0639\u0646\u0627\u0648\u064a\u0646\u0643 \u0641\u0642\u0637 \u0628\u0627\u0644\u0645\u0648\u0627\u0642\u0639 \u0627\u0644\u062a\u064a \u062a\u0633\u062a\u062e\u062f\u0645\u0647\u0627 (\u0628\u0627\u0644\u0625\u0636\u0627\u0641\u0629 \u0625\u0644\u0649 \u0639\u0646\u0627\u0648\u064a\u0646 \u0627\u0634\u062a\u0631\u0627\u0643\u0627\u062a \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629). \u0645\u0646 \u0623\u062c\u0644 \u062a\u0633\u0631\u064a\u0639 \u0627\u0644\u062a\u0635\u0641\u062d \u0639\u0644\u0649 I2P\u060c \u0645\u0646 \u0627\u0644\u062c\u064a\u062f \u0625\u0636\u0627\u0641\u0629 \u0628\u0639\u0636 \u0627\u0634\u062a\u0631\u0627\u0643\u0627\u062a \u062f\u0644\u064a\u0644 \u0627\u0644\u0639\u0646\u0627\u0648\u064a\u0646.";
