    t[5494] = "Reseed from file failed";
    t[5495] = "\u0641\u0634\u0644\u062a Reseed \u0645\u0646 \u0627\u0644\u0645\u0644\u0641";
    t[5496] = "Installed";
    t[5497] = "\u0627\u0644\u0645\u062b\u0628\u062a\u0629";
    t[5502] = "BOB";
    t[5503] = "\u0628\u0648\u0628";
    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "\u0625\u0630\u0627 \u0628\u0639\u062f \u0628\u0636\u0639 \u062f\u0642\u0627\u0626\u0642 \u0645\u0646 \u0627\u0644\u0639\u0645\u0644\u060c \u0643\u0627\u0646 \u0645\u0648\u062c\u0647\u0643 \u064a\u0628\u064a\u0646 \u0639\u062f\u0645 \u0648\u062c\u0648\u062f \u0623\u064a \u0623\u0642\u0631\u0627\u0646 \u0646\u0634\u0637\u0629 \u0648\u0644\u0627 \u0623\u0642\u0631\u0627\u0646 \u0645\u0639\u0631\u0648\u0641\u0629\u060c \u0645\u0639 \u0625\u0634\u0639\u0627\u0631 \u0641\u064a \u0627\u0644\u062c\u0627\u0646\u0628 \u0623\u0646\u0647 \u064a\u062c\u0628 \u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u062a\u062d\u0642\u0642 \u0645\u0646 \u0625\u0645\u0643\u0627\u0646\u064a\u0629 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a. \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u062a\u0635\u0627\u0644\u0643 \u0628\u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a \u0633\u0644\u064a\u0645\u0627\u060c \u0642\u062f \u062a\u062d\u062a\u0627\u062c \u0625\u0644\u0649 \u0641\u062a\u062d \u062d\u0638\u0631 \u0644\u063a\u0629 Java \u0641\u064a \u062c\u062f\u0627\u0631\u0643 \u0627\u0644\u0646\u0627\u0631\u064a. \u0648\u0625\u0644\u0627\u060c \u0642\u062f \u062a\u062d\u062a\u0627\u062c \u0625\u0639\u0627\u062f\u0629 \u062a\u063a\u0630\u064a\u0629 \u0645\u0648\u062c\u0647 I2P \u0627\u0644\u062e\u0627\u0635 \u0628\u0643. \u062a\u0641\u0636\u0644 \u0632\u064a\u0627\u0631\u0629 <a href=/configreseed#reseedconfig>\u0635\u0641\u062d\u0629 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u063a\u0630\u064a\u0629</a> \u0648\u0627\u0636\u063a\u0637 \u0639\u0644\u0649 \u0632\u0631 <i>\u062d\u0641\u0638 \u0627\u0644\u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0648\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u063a\u0630\u064a\u0629 \u0627\u0644\u0622\u0646</i>. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a\u060c \u0627\u0646\u0638\u0631 \u0642\u0633\u0645 <a href=#reseedhelp>\u0645\u0633\u0627\u0639\u062f\u0629 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u063a\u0630\u064a\u0629</a> \u0623\u0639\u0644\u0627\u0647.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "\u0648\u0627\u062c\u0647\u0629 \u0628\u0631\u0645\u062c\u0629 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0639\u0644\u0649 \u0645\u0633\u062a\u0648\u0649 \u0623\u0639\u0644\u0649 \u0644\u0644\u0639\u0645\u0644\u0627\u0621. \u0644\u0627 \u062a\u0641\u062a\u062d \u0625\u0644\u0627 \u0639\u0646\u062f\u0645\u0627 \u064a\u0637\u0644\u0628 \u0639\u0645\u064a\u0644 SAM V3 \u062c\u0644\u0633\u0629 UDP. \u064a\u0645\u0643\u0646 \u062a\u0645\u0643\u064a\u0646\u0647\u0627/\u062a\u0639\u0637\u064a\u0644\u0647\u0627 \u0645\u0646 \u062e\u0644\u0627\u0644 <a href=/configclients> \u0635\u0641\u062d\u0629 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0639\u0645\u064a\u0644</a>. \u064a\u0645\u0643\u0646 \u062a\u063a\u064a\u064a\u0631\u0647\u0627 \u0641\u064a \u0645\u0644\u0641 <code>clients.config</code> \u0628\u062e\u064a\u0627\u0631 \u0633\u0637\u0631 \u0627\u0644\u0623\u0648\u0627\u0645\u0631 SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "\u0625\u0630\u0627 \u0623\u0631\u062f\u062a \u062c\u0639\u0644 \u0645\u0648\u0642\u0639\u0643 \u0645\u062a\u062c\u0627\u0648\u0628\u064b\u0627\u060c \u0641\u0625\u0646 \u0636\u063a\u0637 \u0627\u0644\u0635\u0648\u0631 \u0623\u0645\u0631 \u062d\u064a\u0648\u064a \u0639\u0646\u062f \u0627\u0633\u062a\u0636\u0627\u0641\u0629 \u0635\u0648\u0631 \u0643\u0628\u064a\u0631\u0629. \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u062e\u062f\u0645\u0629 \u0645\u062b\u0644 <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> \u0644\u0636\u063a\u0637 \u0635\u0648\u0631\u0643 \u0628\u062a\u0646\u0633\u064a\u0642 png \u0648 jpeg \u063a\u0627\u0644\u0628\u064b\u0627 \u0645\u0627 \u064a\u0624\u062f\u064a \u0625\u0644\u0649 \u0645\u0644\u0641\u0627\u062a \u0623\u0635\u063a\u0631 \u0628\u0643\u062b\u064a\u0631 \u0645\u0639 \u062e\u0633\u0627\u0631\u0629 \u062c\u0648\u062f\u0629 \u0623\u0642\u0644. \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u062d\u0627\u0644\u0627\u062a \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u062a\u0641\u0648\u0642 \u062a\u0646\u0633\u064a\u0642 \u0648\u064a\u0628 \u0628\u064a \u0639\u0644\u0649 \u062c\u064a \u0628\u064a \u0625\u064a\u0647\u060c \u0645\u0646 \u062e\u0644\u0627\u0644 \u062a\u0648\u0644\u064a\u062f \u0645\u0644\u0641\u0627\u062a \u0623\u0635\u063a\u0631 \u062d\u062c\u0645\u064b\u0627 \u0628\u0646\u0641\u0633 \u0627\u0644\u062c\u0648\u062f\u0629 \u0627\u0644\u0645\u0631\u0626\u064a\u0629 \u062a\u0642\u0631\u064a\u0628\u064b\u0627 \u0623\u0648 \u0627\u0644\u0623\u0641\u0636\u0644\u060c \u0648\u0644\u0647 \u062f\u0639\u0645 \u0648\u0627\u0633\u0639 \u0644\u0644\u0645\u062a\u0635\u0641\u062d\u0627\u062a. \u0623\u064a\u0636\u064b\u0627\u060c \u062a\u0623\u0645\u0644 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0625\u0633 \u0641\u064a \u062c\u064a \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0645\u0633\u062a\u0637\u064a\u0644\u0627\u062a \u0627\u0644\u0628\u0643\u0633\u0644 \u0644\u0644\u0631\u0645\u0648\u0632 \u0648\u0627\u0644\u0631\u0633\u0648\u0645\u0627\u062a - \u0641\u0647\u064a \u063a\u0627\u0644\u0628\u064b\u0627 \u0623\u0635\u063a\u0631 \u062d\u062c\u0645\u064b\u0627 \u0645\u0646 \u0645\u0644\u0641 \u0645\u0633\u062a\u0637\u064a\u0644\u0627\u062a \u0627\u0644\u0628\u0643\u0633\u0644 \u0627\u0644\u0645\u0643\u0627\u0641\u0626 (\u0642\u0645 \u0628\u062a\u0645\u0631\u064a\u0631\u0647\u0627 \u0639\u0628\u0631 \u062e\u062f\u0645\u0629 \u0645\u062b\u0644 <a href=https://vecta.io/nano target=_blank class='sitelink external'>\u0645\u0635\u063a\u0631 Nano SVG</a> \u0644\u0625\u0632\u0627\u0644\u0629 \u0645\u0627 \u0644\u0627 \u062f\u0627\u0639\u064a \u0644\u0647)\u060c \u0648\u062a\u062a\u062d\u0645\u0644 \u0627\u0644\u062a\u0642\u0631\u064a\u0628 \u0628\u062f\u0648\u0646 \u0641\u0642\u062f\u0627\u0646 \u0641\u064a \u0627\u0644\u062c\u0648\u062f\u0629\u060c \u0648\u064a\u0645\u0643\u0646 \u0636\u063a\u0637\u0647\u0627 \u0628\u0648\u0627\u0633\u0637\u0629 \u062e\u0627\u062f\u0648\u0645 \u0627\u0644\u0648\u064a\u0628 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.\"";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "\u062a\u0639\u0637\u064a\u0644 UPnP \u0639\u0644\u0649 \u0627\u0644\u062c\u0647\u0627\u0632";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "\u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u060c \u0633\u062a\u0634\u0627\u0631\u0643 \u0645\u0639\u0638\u0645 \u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0639\u0645\u064a\u0644 \u0644\u062f\u064a\u0643 (\u0627\u0644\u0628\u0631\u064a\u062f\u060c \u0648\u0643\u064a\u0644 http\u060c \u200f\u200fIRC) \u0646\u0641\u0633 \u0645\u062c\u0645\u0648\u0639\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 (\u0644\u0623\u0633\u0628\u0627\u0628 \u0623\u062f\u0627\u0621) \u0648\u0633\u062a\u064f\u0638\u0647\u0631 \u0643\u0640 \u200f\u200f\u200f<i>\u0639\u0645\u0644\u0627\u0621 \u0645\u0634\u062a\u0631\u0643\u0648\u0646</i>\u200f \u200f\u0648\u200f\u200f\u200f<i>\u0639\u0645\u0644\u0627\u0621 \u0645\u0634\u062a\u0631\u0643\u0648\u0646 (DSA)</i>\u200f \u0641\u064a \u0642\u0627\u0626\u0645\u0629 \u0627\u0644\u062c\u0627\u0646\u0628\u064a\u0629 \u062a\u062d\u062a \u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u062e\u062f\u0645\u0629 \u0648\u0639\u0644\u0649 \u0635\u0641\u062d\u0629\u200f \u200f<a href=/tunnels>\u0627\u0644\u0623\u0646\u0641\u0627\u0642</a>.";
    t[5538] = "Theme change saved.";
    t[5539] = "\u062a\u0645 \u062d\u0641\u0638 \u062a\u063a\u064a\u064a\u0631 \u0627\u0644\u062a\u064a\u0645\u0629.";
