    t[5544] = "This section is not enabled by default unless <a href='/help/configuration#advancedconsole'>Advanced Console mode</a> is enabled. You may enable it on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[5545] = "\u0644\u0627 \u064a\u062a\u0645 \u062a\u0641\u0639\u064a\u0644 \u0647\u0630\u0627 \u0627\u0644\u0642\u0633\u0645 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627 \u0645\u0627 \u0644\u0645 \u064a\u062a\u0645 \u062a\u0641\u0639\u064a\u0644 \u0648\u0636\u0639 <a href='/help/configuration#advancedconsole'>\u0644\u0648\u062d\u0629 \u0627\u0644\u062a\u062d\u0643\u0645 \u0627\u0644\u0645\u062a\u0642\u062f\u0645\u0629</a>. \u064a\u0645\u0643\u0646\u0643 \u062a\u0641\u0639\u064a\u0644\u0647 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href='/configsidebar'>\u062a\u0643\u0648\u064a\u0646 \u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628</a>.";
    t[5546] = "Move up";
    t[5547] = "\u062d\u0631\u0643 \u0627\u0644\u0649 \u0627\u0644\u0627\u0639\u0644\u0649";
    t[5554] = "Firewalls, Modems &amp; Routers";
    t[5555] = "\u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u062d\u0645\u0627\u064a\u0629\u060c \u0627\u0644\u0645\u0648\u062f\u0645\u0627\u062a \u0648\u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a";
    t[5556] = "Also, some routers cannot correctly forward both TCP and UDP on a single port, or may have other limitations or bugs that prevent them from passing traffic through to I2P.";
    t[5557] = "\u0628\u0627\u0644\u0625\u0636\u0627\u0641\u0629 \u0625\u0644\u0649 \u0630\u0644\u0643\u060c \u0644\u0627 \u062a\u0633\u062a\u0637\u064a\u0639 \u0628\u0639\u0636 \u0623\u062c\u0647\u0632\u0629 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0625\u0639\u0627\u062f\u0629 \u062a\u0648\u062c\u064a\u0647 \u0643\u0644 \u0645\u0646 TCP \u0648UDP \u0628\u0634\u0643\u0644 \u0635\u062d\u064a\u062d \u0639\u0644\u0649 \u0645\u0646\u0641\u0630 \u0648\u0627\u062d\u062f\u060c \u0623\u0648 \u0642\u062f \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0642\u064a\u0648\u062f \u0623\u0648 \u0623\u062e\u0637\u0627\u0621 \u0623\u062e\u0631\u0649 \u062a\u0645\u0646\u0639\u0647\u0627 \u0645\u0646 \u062a\u0645\u0631\u064a\u0631 \u062d\u0631\u0643\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0639\u0628\u0631 I2P.";
