    t[5666] = "Help with configuring I2P to use a non-system default browser";
    t[5667] = "\u0627\u0644\u0645\u0633\u0627\u0639\u062f\u0629 \u0641\u064a \u062a\u0643\u0648\u064a\u0646 I2P \u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0645\u062a\u0635\u0641\u062d \u0627\u0641\u062a\u0631\u0627\u0636\u064a \u063a\u064a\u0631 \u062e\u0627\u0635 \u0628\u0627\u0644\u0646\u0638\u0627\u0645";
