    t[5875] = "\u0645\u0644\u0627\u062d\u0638\u0629 \u0623\u0646 \u0627\u0644\u0627\u0634\u062a\u0631\u0627\u0643 \u0628\u062e\u062f\u0645\u0629 hosts.txt \u0647\u0648 \u0641\u0639\u0644 \u062b\u0642\u0629\u060c \u0644\u0623\u0646 \u0627\u0634\u062a\u0631\u0627\u0643\u0627\u062e\u0628\u064a\u062b \u0642\u062f \u064a\u0639\u0637\u064a\u0643 \u0639\u0646\u0627\u0648\u064a\u0646 \u062e\u0627\u0637\u0626\u0629\u060c \u0644\u0630\u0627 \u064a\u062c\u0628 \u0627\u0644\u062d\u0630\u0631 \u0639\u0646\u062f \u0627\u0644\u0627\u0634\u062a\u0631\u0627\u0643 \u0628\u0642\u0648\u0627\u0626\u0645 \u0645\u0646 \u0645\u0635\u0627\u062f\u0631 \u0645\u062c\u0647\u0648\u0644\u0629. \u0642\u062f \u062a\u0643\u0648\u0646 \u0644\u0645\u062f\u064a\u0631\u064a \u0647\u0630\u0647 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0633\u064a\u0627\u0633\u0627\u062a \u0645\u062e\u062a\u0644\u0641\u0629 \u0644\u0639\u0631\u0636 \u0627\u0644\u0645\u0636\u064a\u0641\u064a\u0646. \u0627\u0644\u062d\u0636\u0648\u0631 \u0639\u0644\u0649 \u0647\u0630\u0647 \u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u0644\u0627 \u064a\u0639\u0646\u064a \u0627\u0644\u0645\u0648\u0627\u0641\u0642\u0629.";
