    t[6169] = "\u0644\u0627 \u064a\u0628\u062f\u0648 \u0623\u0646 \u0645\u0646\u0641\u0630 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u0627\u0644\u064a\u0648 \u062f\u064a \u0628\u064a \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0645\u062d\u0645\u064a \u0628\u062c\u062f\u0627\u0631 \u062d\u0645\u0627\u064a\u0629.";
