    t[6179] = "\u064a\u0628\u062f\u0648 \u0623\u0646\u0643 \u0645\u062d\u0645\u064a \u0639\u0644\u0649 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u062a\u064a \u0633\u064a \u0628\u064a\u060c \u0648\u0628\u0627\u0644\u062a\u0627\u0644\u064a \u0644\u0627 \u064a\u0645\u0643\u0646 \u0644\u0645\u0648\u062c\u0647\u0643 \u0642\u0628\u0648\u0644 \u0627\u0644\u0627\u062a\u0635\u0627\u0644\u0627\u062a \u0627\u0644\u0648\u0627\u0631\u062f\u0629.";
    t[6188] = "HTTP proxy";
    t[6189] = "\u0628\u0631\u0648\u0643\u0633\u064a HTTP";
    t[6204] = "Combined bandwidth graph";
    t[6205] = "\u0631\u0633\u0645 \u0628\u064a\u0627\u0646\u064a \u0644\u0633\u0631\u0639\u0629 \u0627\u0644\u0627\u062a\u0635\u0627\u0644";
    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "\u0644\u0627 \u062a\u0643\u0634\u0641 \u0639\u0646 \u0647\u0630\u0627 \u0627\u0644\u0645\u0644\u0641 \u0644\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646 \u0627\u0644\u0645\u062c\u0647\u0648\u0644\u064a\u0646\u060c \u062d\u064a\u062b \u0625\u0646\u0647 \u064a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0628\u064a\u0627\u0646\u0627\u062a \u062d\u0633\u0627\u0633\u0629 (100 \u0645\u0644\u0641\u0627\u062a RouterInfo) \u0645\u0646 \u0645\u0648\u062c\u0647 I2P \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0627\u0644\u062a\u064a \u0645\u0646 \u0627\u0644\u0645\u0645\u0643\u0646 \u0623\u0646 \u064a\u0633\u062a\u062e\u062f\u0645\u0647\u0627 \u062e\u0635\u0645 \u0644\u0625\u0632\u0627\u0644\u0629 \u0625\u062e\u0641\u0627\u0621 \u0647\u0648\u064a\u062a\u0643. \u0645\u0646 \u0623\u062c\u0644 \u062d\u0645\u0627\u064a\u0629 \u0633\u0631\u064a\u062a\u0643: \u064a\u062c\u0628 \u0623\u0646 \u062a\u0646\u062a\u0638\u0631 \u0628\u0636\u0639 \u0633\u0627\u0639\u0627\u062a/\u0623\u064a\u0627\u0645 \u0642\u0628\u0644 \u0645\u0634\u0627\u0631\u0643\u0629 \u0627\u0644\u0645\u0644\u0641 \u0645\u0639 \u0635\u062f\u064a\u0642\u0643 \u0627\u0644\u0645\u0624\u062a\u0645\u0646. \u0643\u0645\u0627 \u064a\u0646\u0635\u062d \u0623\u064a\u0636\u064b\u0627 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0647\u0630\u0647 \u0627\u0644\u0625\u062c\u0631\u0627\u0621\u0627\u062a \u0628\u0634\u0643\u0644 \u0645\u0639\u062a\u062f\u0644 (\u0644\u0627 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0645\u0631\u0629 \u0648\u0627\u062d\u062f\u0629 \u0641\u064a \u0627\u0644\u0623\u0633\u0628\u0648\u0639).";
    t[6218] = "Plugin {0} installed but failed to start";
