    t[6232] = "Configure";
    t[6233] = "\u0627\u0644\u0636\u0628\u0637";
    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "\u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0645\u062a\u0645\u062b\u0644 \u0641\u064a \u0627\u0644\u0645\u0633\u0627\u0647\u0645\u0629 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0633\u0645\u0627\u062d \u0644\u0645\u0648\u062c\u0647\u0627\u062a \u0623\u062e\u0631\u0649 \u0628\u0628\u0646\u0627\u0621 \u0623\u0646\u0641\u0627\u0642 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0645\u0648\u062c\u0647\u0643 \u0641\u064a \u0633\u0644\u0633\u0644\u0629 \u0646\u0641\u0642. \u064a\u062a\u0637\u0644\u0628 \u062a\u062e\u0635\u064a\u0635 \u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u0635\u0627\u0639\u062f (\u062d\u0635\u0629 \u0627\u0644\u0634\u0628\u0643\u0629) \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 12 \u0643\u064a\u0644\u0648\u0628\u0627\u064a\u062a \u0641\u064a \u0627\u0644\u062b\u0627\u0646\u064a\u0629 \u0644\u062a\u0645\u0643\u064a\u0646 \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629. \u064a\u0631\u062c\u0649 \u0645\u0644\u0627\u062d\u0638\u0629 \u0623\u0646 \u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a \u0627\u0644\u0645\u062d\u0645\u064a\u0629 \u0628\u062c\u062f\u0627\u0631 \u0646\u0627\u0631\u064a \u0633\u062a\u0643\u0648\u0646 \u0645\u062d\u062f\u0648\u062f\u0629 \u0641\u064a \u0642\u062f\u0631\u062a\u0647\u0627 \u0639\u0644\u0649 \u0627\u0644\u0645\u0633\u0627\u0647\u0645\u0629 \u0641\u064a \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629\u060c \u0648\u0644\u0646 \u064a\u0634\u0627\u0631\u0643 \u0627\u0644\u0645\u0648\u062c\u0647 \u0627\u0644\u0645\u062d\u062f\u062f \u0643\u0645\u062e\u0641\u064a \u0639\u0644\u0649 \u0627\u0644\u0625\u0637\u0644\u0627\u0642.";
