    t[6253] = "\u062a\u0623\u062e\u0631";
    t[6258] = "For best participation as a floodfill router, you should open your firewall.";
    t[6259] = "\u0644\u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0627\u0644\u0623\u0641\u0636\u0644 \u0643\u0645\u0648\u062c\u0647 \u0644\u0645\u0644\u0621 \u0627\u0644\u0641\u064a\u0636\u0627\u0646\u060c \u064a\u0646\u0628\u063a\u064a \u0623\u0646 \u062a\u0641\u062a\u062d \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.";
