    t[6271] = "\u062a\u062d\u062f\u064a\u062f \u0627\u0644\u062d\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0644\u0639\u062f\u062f \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0627\u0644\u062a\u064a \u064a\u0645\u0643\u0646 \u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0625\u0646\u0634\u0627\u0624\u0647\u0627. ";
    t[6272] = "Updating unsigned update URL to {0}";
