    t[6286] = "Gracefully restarting to exit Hidden Router Mode";
    t[6287] = "\u0627\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0634\u063a\u064a\u0644 \u0639\u0644\u0649 \u0646\u0638\u0627\u0645 \u0627\u0644\u0645\u0648\u062c\u0647 \u0627\u0644\u0645\u062a\u062e\u0641\u064a ";
