    t[6312] = "Current console and webapp translation report";
    t[6313] = "\u062a\u0642\u0631\u064a\u0631 \u062d\u0627\u0644\u0629 \u062a\u0631\u062c\u0645\u0629 \u0627\u0644\u0642\u0646\u0648\u0627\u062a \u0627\u0644\u062d\u0627\u0644\u064a\u0629 \u0648\u0627\u0644\u0645\u0648\u0642\u0639 \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a";
    t[6314] = "It improves your anonymity by creating cover traffic, and helps the network. ";
    t[6315] = "\u064a\u0639\u0645\u0644 \u0639\u0644\u0649 \u062a\u062d\u0633\u064a\u0646 \u0639\u062f\u0645 \u0627\u0644\u0643\u0634\u0641 \u0639\u0646 \u0647\u0648\u064a\u062a\u0643 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0625\u0646\u0634\u0627\u0621 \u062d\u0631\u0643\u0629 \u0645\u0631\u0648\u0631 \u0645\u062e\u0641\u064a\u0629\u060c \u0648\u064a\u0633\u0627\u0639\u062f \u0627\u0644\u0634\u0628\u0643\u0629.";
    t[6316] = "No transit tunnels are built when Hidden mode is active";
    t[6317] = "\u0644\u0627 \u064a\u062a\u0645 \u0625\u0646\u0634\u0627\u0621 \u0623\u0646\u0641\u0627\u0642 \u0645\u0634\u0627\u0631\u0643\u0629 \u0639\u0646\u062f\u0645\u0627 \u064a\u0643\u0648\u0646 \u0627\u0644\u0648\u0636\u0639 \u0627\u0644\u0645\u062e\u0641\u064a \u0646\u0634\u0637\u064b\u0627";
    t[6322] = "Outbound to 32000 only, does not listen on this port. Starts at 31000 and will increment until 31999 looking for a free port. To change, see the <a href=https://wrapper.tanukisoftware.com/doc/english/prop-port.html target=_blank rel=noreferrer class='sitelink external'>wrapper documentation</a>.";
    t[6323] = "\u0627\u0644\u0625\u0631\u0633\u0627\u0644 \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u0625\u0644\u0649 32000 \u0641\u0642\u0637\u060c \u0644\u0627 \u064a\u0633\u062a\u0645\u0639 \u0639\u0644\u0649 \u0647\u0630\u0627 \u0627\u0644\u0645\u0646\u0641\u0630. \u064a\u0628\u062f\u0623 \u0645\u0646 31000 \u0648\u0633\u064a\u0632\u064a\u062f \u062d\u062a\u0649 31999 \u0628\u062d\u062b\u064b\u0627 \u0639\u0646 \u0645\u0646\u0641\u0630 \u062d\u0631. \u0644\u0644\u062a\u063a\u064a\u064a\u0631\u060c \u0634\u0627\u0647\u062f <a href=https://wrapper.tanukisoftware.com/doc/english/prop-port.html target=_blank rel=noreferrer class='sitelink external'>\u062a\u0648\u062b\u064a\u0642 wrapper</a>.";
