    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u062d\u062f\u062f \u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0645\u0633\u062a\u0643\u0634\u0641\u0629 \u0639\u0644\u0649 \u0627\u0644\u062a\u0648\u0627\u0632\u064a \u0639\u0646\u062f \u062a\u0634\u063a\u064a\u0644 \u0645\u0647\u0645\u0629 \u0627\u0633\u062a\u0643\u0634\u0627\u0641 \u0627\u0644\u0623\u0642\u0631\u0627\u0646 [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 \u0642\u0631\u064a\u0646 \u0648\u0627\u062d\u062f \u0643\u0644 \u0645\u0631\u0629 \u0639\u0646\u062f\u0645\u0627 \u064a\u062a\u062c\u0627\u0648\u0632 \u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0645\u0639\u0631\u0648\u0641\u0629 3000]. \u0645\u0644\u0627\u062d\u0638\u0629 \u0623\u0646 \u0632\u064a\u0627\u062f\u0629 \u0647\u0630\u0647 \u0627\u0644\u0642\u064a\u0645\u0629 \u0633\u062a\u0632\u064a\u062f \u0645\u0646 \u0645\u062a\u0637\u0644\u0628\u0627\u062a \u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0644\u0644\u0627\u0633\u062a\u0643\u0634\u0627\u0641\u060c \u0648\u062a\u0639\u064a\u064a\u0646 \u0647\u0630\u0647 \u0627\u0644\u0642\u064a\u0645\u0629 \u0639\u0627\u0644\u064a\u0629 \u062c\u062f\u0627\u064b \u0642\u062f \u064a\u0633\u0628\u0628 \u062a\u0623\u062e\u064a\u0631\u0627\u064b \u0645\u0641\u0631\u0637\u0627\u064b \u0644\u0644\u0631\u0633\u0627\u0626\u0644 \u0648\u064a\u062a\u062f\u0627\u062e\u0644 \u0645\u0639 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0623\u062e\u0631\u0649\u060c \u0644\u0630\u0627 \u0627\u0633\u062a\u062e\u062f\u0645\u0647 \u0628\u062d\u0630\u0631!";
