    t[6794] = "To join an existing family, import the private key you exported from a router in the family.";
    t[6795] = "\u0644\u0644\u0627\u0646\u0636\u0645\u0627\u0645 \u0625\u0644\u0649 \u0639\u0627\u0626\u0644\u0629 \u0645\u0648\u062c\u0648\u062f\u0629\u060c \u0642\u0645 \u0628\u0627\u0633\u062a\u064a\u0631\u0627\u062f \u0627\u0644\u0645\u0641\u062a\u0627\u062d \u0627\u0644\u062e\u0627\u0635 \u0627\u0644\u0630\u064a \u0642\u0645\u062a \u0628\u062a\u0635\u062f\u064a\u0631\u0647 \u0645\u0646 \u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 \u0641\u064a \u0627\u0644\u0639\u0627\u0626\u0644\u0629.";
