    t[6924] = "You have configured I2P to share more than 128KBps of bandwidth, but you are firewalled.";
    t[6925] = "\u0642\u0645\u062a \u0628\u0627\u0639\u062f\u0627\u062f I2P \u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0623\u0643\u062b\u0631 \u0645\u0646 128KBps\u060c \u0644\u0643\u0646\u0643 \u0648\u0631\u0627\u0621 \u062c\u062f\u0627\u0631 \u0646\u0627\u0631\u064a.";
    t[6928] = "Bugs in the device's UPnP implementation";
    t[6929] = "\u0623\u062e\u0637\u0627\u0621 \u0641\u064a \u062a\u0646\u0641\u064a\u0630 UPnP \u0639\u0644\u0649 \u0627\u0644\u062c\u0647\u0627\u0632";
    t[6942] = "High capacity";
    t[6943] = "\u0642\u062f\u0631\u0629 \u0639\u0627\u0644\u064a\u0629";
    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "\u062a\u0637\u0628\u064a\u0642 \u062c\u0627\u0641\u0627 \u0644\u0639\u0645\u064a\u0644 \u062a\u0648\u0631\u060c \u0645\u062a\u0627\u062d \u0643\u0625\u0636\u0627\u0641\u0629 \u0644\u0640 I2P. \u064a\u0645\u0643\u0646 \u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0647 \u0643\u0640 <i>\u0622\u0648\u062a\u0628\u0631\u0648\u0643\u0633\u064a</i> \u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0625\u0630\u0627 \u062a\u0645 \u062a\u0647\u064a\u0626\u062a\u0647 \u0641\u064a \u0646\u0641\u0642 \u0639\u0645\u064a\u0644 SOCKS \u0623\u0648 HTTP \u0630\u064a \u0627\u0644\u0635\u0644\u0629 \u0641\u064a <i>\u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642</i>. \u0645\u062a\u0627\u062d \u0645\u0646 <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. \u0645\u0635\u062f\u0631 \u0627\u0644\u0643\u0648\u062f \u0645\u062a\u0627\u062d \u0639\u0644\u0649 <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "\u0639\u0646\u0627\u0648\u064a\u0646 IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "\u0647\u0630\u0627 \u0627\u0644\u0642\u0633\u0645 \u064a\u0628\u064a\u0646 \u0645\u062a\u0648\u0633\u0637 \u0633\u0631\u0639\u0627\u062a \u062d\u0631\u0643\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0648\u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0647\u0627 \u0627\u0644\u0625\u062c\u0645\u0627\u0644\u064a \u0644\u0644\u062c\u0644\u0633\u0629. \u062c\u0645\u064a\u0639 \u0627\u0644\u0642\u064a\u0645 \u0645\u0642\u0627\u0633\u0651\u0629 \u0628\u0627\u0644\u0628\u0627\u064a\u062a \u0641\u064a \u0627\u0644\u062b\u0627\u0646\u064a\u0629. \u064a\u0645\u0643\u0646\u0643 \u062a\u063a\u064a\u064a\u0631 \u062d\u062f\u0648\u062f \u062d\u0631\u0643\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href='/config'>\u062a\u0643\u0648\u064a\u0646 \u062d\u0631\u0643\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a</a>. \u0643\u0644\u0645\u0627 \u0642\u062f\u0645\u062a \u0627\u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642\u060c \u0632\u0627\u062f\u062a \u0645\u0633\u0627\u0647\u0645\u062a\u0643 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629 \u0648\u062a\u062d\u0633\u0646\u062a \u0633\u0631\u064a\u0629 \u0647\u0648\u064a\u062a\u0643\u060c \u0644\u0630\u0627 \u064a\u0631\u062c\u0649 \u0623\u062e\u0630 \u0627\u0644\u0648\u0642\u062a \u0644\u0645\u0631\u0627\u062c\u0639\u0629 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a. \u0625\u0630\u0627 \u0643\u0646\u062a \u063a\u064a\u0631 \u0645\u062a\u0623\u0643\u062f \u0645\u0646 \u0633\u0631\u0639\u0629 \u0634\u0628\u0643\u062a\u0643\u060c \u0641\u0627\u0633\u062a\u062e\u062f\u0645 \u062e\u062f\u0645\u0629 \u0645\u062b\u0644 <a href='http://speedtest.net/'>SpeedTest</a> \u0644\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0645\u0624\u0634\u0631 \u062c\u064a\u062f \u0639\u0646 \u0642\u062f\u0631\u062a\u0643 \u0639\u0644\u0649 \u062d\u0631\u0643\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a. \u0633\u064a\u062d\u062f\u062f \u0645\u0642\u062f\u0627\u0631 \u0645\u0634\u0627\u0631\u0643\u062a\u0643 \u0627\u0644\u0635\u0627\u062f\u0631\u0629 (\u0643\u064a\u0644\u0648\u0628\u0627\u064a\u062a \u062e\u0627\u0631\u062c) \u0645\u0633\u0627\u0647\u0645\u062a\u0643 \u0627\u0644\u0625\u062c\u0645\u0627\u0644\u064a\u0629 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629. \u064a\u062a\u0645 \u0631\u0633\u0645 \u062d\u0631\u0643\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a.";
