    t[7077] = "\u0645\u0639 \u0630\u0644\u0643\u060c \u0641\u064a \u062d\u0627\u0644\u0629 \u0641\u0634\u0644 \u0625\u062d\u062f\u0649 \u0627\u0644\u0623\u0646\u0641\u0627\u0642\u060c \u0633\u062a\u062e\u0631\u062c \u062c\u0645\u064a\u0639 \u062e\u062f\u0645\u0627\u062a\u0643 \u062f\u0641\u0639\u0629 \u0648\u0627\u062d\u062f\u0629 \u062e\u0627\u0631\u062c \u0627\u0644\u062e\u062f\u0645\u0629\u060c \u0644\u0630\u0627 \u0642\u062f \u062a\u0631\u063a\u0628 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0628\u062a\u0643\u0648\u064a\u0641 \u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0639\u0645\u064a\u0644 \u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0645\u062c\u0645\u0648\u0639\u0627\u062a \u0645\u0646\u0641\u0635\u0644\u0629 \u0645\u0646 \u0627\u0644\u0623\u0646\u0641\u0627\u0642.";
