    t[7139] = "\u0645\u0644\u0627\u062d\u0638\u0629: \u0627\u0644\u0623\u0628\u0639\u0627\u062f \u0645\u062e\u0635\u0635\u0629 \u0644\u0644\u0631\u0633\u0645 \u0627\u0644\u0628\u064a\u0627\u0646\u064a \u0641\u0642\u0637 (\u0628\u0627\u0633\u062a\u062b\u0646\u0627\u0621 \u0627\u0644\u0639\u0646\u0648\u0627\u0646 \u0648\u0627\u0644\u062a\u0633\u0645\u064a\u0627\u062a \u0648\u0648\u0633\u0627\u0626\u0644 \u0627\u0644\u0625\u064a\u0636\u0627\u062d).";
