    t[7158] = "I2P does not work well behind this type of firewall. You will probably not be able to accept inbound connections, which will limit your participation in the network.";
    t[7159] = "\u0644\u0646 \u064a\u0639\u0645\u0644 I2P \u0628\u0634\u0643\u0644 \u062c\u064a\u062f \u0648\u0631\u0627\u0621 \u0647\u0630\u0627 \u0627\u0644\u0646\u0648\u0639 \u0645\u0646 \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629. \u0645\u0646 \u0627\u0644\u0645\u062d\u062a\u0645\u0644 \u0639\u062f\u0645 \u0642\u062f\u0631\u062a\u0643 \u0639\u0644\u0649 \u0642\u0628\u0648\u0644 \u0627\u0644\u0627\u062a\u0635\u0627\u0644\u0627\u062a \u0627\u0644\u0648\u0627\u0631\u062f\u0629\u060c \u0645\u0627 \u0633\u064a\u062d\u062f \u0645\u0646 \u0645\u0634\u0627\u0631\u0643\u062a\u0643 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629.";
    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "\u064a\u0645\u0643\u0651\u0646 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u0639\u0645\u064a\u0644 I2P (I2CP) \u0627\u0644\u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0627\u0644\u062e\u0627\u0631\u062c\u064a\u0629 (\u0627\u0644\u0639\u0645\u0644\u0627\u0621) \u0645\u0646 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0640 I2P \u0639\u0628\u0631 \u0633\u0648\u0643\u064a\u062a TCP \u0648\u0627\u062d\u062f\u060c \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627 \u0639\u0628\u0631 \u0627\u0644\u0645\u0646\u0641\u0630 7654. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a\u060c \u0642\u0645 \u0628\u0632\u064a\u0627\u0631\u0629 \u0627\u0644\u0648\u062b\u0627\u0626\u0642 <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>\u0639\u0644\u0649 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "\u0625\u062c\u0645\u0627\u0644\u064a\u0627\u062a \u0642\u0627\u0626\u0645\u0629 \u0627\u0644\u0627\u0646\u062a\u0638\u0627\u0631";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u062d\u062f\u062f \u0623\u064a \u0648\u0633\u064a\u0644\u0629 \u0646\u0642\u0644 \u062a\u062d\u0638\u0649 \u0628\u0627\u0644\u0623\u0648\u0644\u0648\u064a\u0629 \u0639\u0646\u062f \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0645\u0639 \u0627\u0644\u0623\u0642\u0631\u0627\u0646. \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u060c \u064a\u062d\u0638\u0649 NTCP \u0628\u0627\u0644\u0623\u0648\u0644\u0648\u064a\u0629 \u0639\u0644\u0649 UDP (SSU). \u0628\u062a\u0639\u064a\u064a\u0646 \u0627\u0644\u0642\u064a\u0645\u0629 \u0639\u0644\u0649 \u0635\u062d\u064a\u062d\u060c \u0633\u064a\u062d\u0638\u0649 UDP \u0628\u0627\u0644\u0623\u0648\u0644\u0648\u064a\u0629 \u0645\u0627 \u0644\u0645 \u062a\u0648\u062c\u062f \u0627\u062a\u0635\u0627\u0644 \u0645\u0648\u062c\u0648\u062f \u0645\u0633\u0628\u0642\u0627\u064b \u0639\u0628\u0631 NTCP\u061b \u0639\u0646\u062f \u062a\u0639\u064a\u064a\u0646\u0647 \u0639\u0644\u0649 \u062f\u0627\u0626\u0645\u0627\u064b\u060c \u0633\u064a\u062a\u0645 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 UDP \u0628\u0634\u0643\u0644 \u062f\u0627\u0626\u0645 \u0628\u063a\u0636 \u0627\u0644\u0646\u0638\u0631 \u0639\u0646 \u0623\u064a \u0627\u062a\u0635\u0627\u0644 \u0645\u0648\u062c\u0648\u062f \u0645\u0633\u0628\u0642\u0627\u064b \u0639\u0628\u0631 NTCP. [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 \u062e\u0637\u0623]";
