    t[7195] = "\u0644\u0645 \u062a\u0642\u0645 \u0628\u062a\u0643\u0648\u064a\u0646 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u062a\u064a \u0633\u064a \u0628\u064a \u0627\u0644\u0648\u0627\u0631\u062f \u0645\u0639 \u0627\u0633\u0645 \u0645\u0636\u064a\u0641 \u0648\u0645\u0646\u0641\u0630 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0648\u0645\u0639 \u0630\u0644\u0643 \u0641\u0642\u062f \u062a\u0645 \u062a\u0639\u0637\u064a\u0644 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u064a\u0648 \u062f\u064a \u0628\u064a.";
