    t[7429] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f (\u0628\u0627\u0644\u0633\u0627\u0639\u0627\u062a) \u064a\u062d\u062f\u062f \u0645\u062f\u0629 \u062a\u0642\u0627\u062f\u0645 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0641\u064a \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u064a\u0629 (\u062a\u0627\u0631\u064a\u062e \u0627\u0644\u0646\u0634\u0631 \u0627\u0644\u0645\u0639\u0631\u0648\u0641 \u0627\u0644\u0623\u062e\u064a\u0631) \u0642\u0628\u0644 \u062a\u0635\u0646\u064a\u0641\u0647\u0627 \u0639\u0644\u0649 \u0623\u0646\u0647\u0627 \u0642\u062f\u064a\u0645\u0629 \u0648\u062d\u0630\u0641\u0647\u0627. [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a 28 \u0633\u0627\u0639\u0629 \u0645\u0627 \u0644\u0645 \u064a\u0643\u0646 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0645\u0646 \u0645\u0644\u0626\u0629 \u0627\u0644\u0641\u064a\u0636\u0627\u0646\u060c \u0648\u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u062d\u0627\u0644\u0629 \u064a\u0643\u0648\u0646 \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a 8 \u0633\u0627\u0639\u0627\u062a]";
