    t[7459] = "\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u062a\u062d\u062f\u062f \u0627\u0644\u0647\u0648\u064a\u0629 \u0627\u0644\u0641\u0631\u064a\u062f\u0629 \u0644\u0645\u0648\u062c\u0647 \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0648\u062a\u062a\u0636\u0645\u0646 \u0639\u0646\u0648\u0627\u0646 IP (\u0623\u0648 \u0639\u0646\u0627\u0648\u064a\u0646 IP \u0644\u0644\u0648\u0633\u0637\u0627\u0621) \u0648\u0627\u0644\u0645\u0646\u0641\u0630 \u0627\u0644\u0627\u0633\u062a\u0645\u0627\u0639\u064a\u060c \u0648\u0645\u0641\u0627\u062a\u064a\u062d \u0627\u0644\u062a\u0648\u0642\u064a\u0639 \u0648\u0627\u0644\u062a\u0634\u0641\u064a\u0631 \u0627\u0644\u0639\u0627\u0645\u0629. \u062a\u0631\u062a\u0628\u0637 \u0647\u0648\u064a\u0627\u062a \u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a \u0628\u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0641\u064a \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629. \u064a\u0634\u0627\u0631 \u0625\u0644\u064a\u0647\u0627 \u0623\u064a\u0636\u064b\u0627 \u0628\u0627\u0633\u0640\u0645 <i>RouterInfo</i>.";
