    t[7796] = "My IRC client keeps disconnecting from the network, is there anything I can do?";
    t[7797] = "\u064a\u062a\u0645 \u0641\u0635\u0644 \u0639\u0645\u064a\u0644 IRC \u0627\u0644\u062e\u0627\u0635 \u0628\u064a \u0645\u0646 \u0627\u0644\u0634\u0628\u0643\u0629 \u0628\u0627\u0633\u062a\u0645\u0631\u0627\u0631\u060c \u0647\u0644 \u0647\u0646\u0627\u0643 \u0634\u064a\u0621 \u064a\u0645\u0643\u0646\u0646\u064a \u0641\u0639\u0644\u0647\u061f";
