    t[7805] = "\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0634\u0628\u0643\u0629";
    t[7808] = "UPnP may be enabled or disabled on the Network Configuration page, but a change requires a router restart to take effect.";
    t[7809] = "\u064a\u0645\u0643\u0646 \u062a\u0645\u0643\u064a\u0646 UPnP \u0623\u0648 \u062a\u0639\u0637\u064a\u0644\u0647\u0627 \u0645\u0646 \u0635\u0641\u062d\u0629 \u062a\u0643\u0648\u064a\u0641 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0644\u0643\u0646 \u0623\u064a \u062a\u063a\u064a\u064a\u0631 \u064a\u062a\u0637\u0644\u0628 \u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0644\u064a\u062f\u062e\u0644 \u062d\u064a\u0632 \u0627\u0644\u062a\u0646\u0641\u064a\u0630.";
    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "\u064a\u062d\u062f\u062f \u0627\u0644\u062d\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0644\u0639\u062f\u062f <a href=/jobs>\u0627\u0644\u0648\u0638\u0627\u0626\u0641</a> \u0627\u0644\u0645\u062a\u0648\u0627\u0632\u064a\u0629 \u0627\u0644\u062a\u064a \u064a\u0645\u0643\u0646 \u062a\u0634\u063a\u064a\u0644\u0647\u0627. ";
