    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "\u0645\u0648\u062c\u0647 \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629 \u0645\u0643\u0644\u0641 \u0628\u062a\u0648\u0641\u064a\u0631 \u0648\u0627\u0633\u062a\u0642\u0628\u0627\u0644 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0639\u0646 \u0645\u0648\u062c\u0647\u0627\u062a \u0648\u062e\u062f\u0645\u0627\u062a \u0623\u062e\u0631\u0649 \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629. \u0627\u0644\u062d\u062f \u0627\u0644\u0623\u062f\u0646\u0649 \u0627\u0644\u062d\u0627\u0644\u064a \u0644\u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u062a\u0631\u062f\u062f\u064a \u0627\u0644\u0645\u0634\u062a\u0631\u0643 \u0644\u0643\u064a \u064a\u0639\u062a\u0628\u0631 \u0627\u0644\u0645\u0648\u062c\u0647 \u0642\u0627\u062f\u0631\u0627\u064b \u0639\u0644\u0649 \u0623\u062f\u0627\u0621 \u0645\u0647\u0627\u0645 \u0641\u064a\u0636 \u0627\u0644\u062a\u0643\u0631\u0627\u0631 \u0647\u0648 128 \u0643\u064a\u0644\u0648\u0628\u0627\u064a\u062a/\u062b\u0627\u0646\u064a\u0629\u060c \u0639\u0644\u0649 \u0627\u0644\u0631\u063a\u0645 \u0645\u0646 \u0625\u0645\u0643\u0627\u0646\u064a\u0629 \u062a\u062c\u0627\u0648\u0632 \u0647\u0630\u0647 \u0627\u0644\u0645\u062a\u0637\u0644\u0628\u0627\u062a \u0648\u0625\u062c\u0628\u0627\u0631 \u0645\u0648\u062c\u0647 \u0639\u0644\u0649 \u0623\u0646 \u064a\u0643\u0648\u0646 \u0641\u064a\u0636 \u062a\u0643\u0631\u0627\u0631 \u0639\u0628\u0631 <a href=/configadvanced>\u0635\u0641\u062d\u0629 \u0627\u0644\u062a\u0647\u064a\u0626\u0629 \u0627\u0644\u0645\u062a\u0642\u062f\u0645\u0629</a>. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a\u060c \u0627\u0644\u0631\u062c\u0627\u0621 \u0632\u064a\u0627\u0631\u0629 \u0627\u0644\u0648\u062b\u0627\u0626\u0642 <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>\u0639\u0644\u0649 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a</a>.";
