    t[8137] = "\u0646\u0641\u0642 \u0645\u0633\u062a\u0636\u0627\u0641 \u0645\u062d\u0644\u064a\u064b\u0627";
    t[8140] = "Any changes made here must also be configured in the external client.";
    t[8141] = "\u064a\u062c\u0628 \u0623\u064a\u0636\u064b\u0627 \u062a\u0643\u0648\u064a\u0646 \u0623\u064a \u062a\u063a\u064a\u064a\u0631\u0627\u062a \u064a\u062a\u0645 \u0625\u062c\u0631\u0627\u0624\u0647\u0627 \u0647\u0646\u0627 \u0641\u064a \u0627\u0644\u0639\u0645\u064a\u0644 \u0627\u0644\u062e\u0627\u0631\u062c\u064a.";
    t[8142] = "I2P detected that you are firewalled by a Symmetric NAT.";
    t[8143] = "\u0627\u0643\u062a\u0634\u0641 I2P \u0623\u0646\u0643 \u0645\u062d\u0645\u064a \u0628\u0648\u0627\u0633\u0637\u0629 \u062c\u062f\u0627\u0631 \u062d\u0645\u0627\u064a\u0629 \u0645\u062a\u0646\u0627\u0638\u0631.";
    t[8148] = "Graceful mode allows your router to honor its participating tunnel commitments before shutting down or restarting.";
    t[8149] = "\u064a\u062a\u064a\u062d \u0627\u0644\u0648\u0636\u0639 \u0627\u0644\u0631\u0634\u064a\u0642 \u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0627\u062d\u062a\u0631\u0627\u0645 \u0627\u0644\u062a\u0632\u0627\u0645\u0627\u062a \u0627\u0644\u0646\u0641\u0642 \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0642\u0628\u0644 \u0625\u064a\u0642\u0627\u0641 \u0627\u0644\u062a\u0634\u063a\u064a\u0644 \u0623\u0648 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0634\u063a\u064a\u0644.";
    t[8152] = "Router Clients";
    t[8153] = "\u0639\u0645\u0644\u0627\u0621 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647";
    t[8154] = "Routers close to Our IP";
    t[8155] = "\u0623\u062c\u0647\u0632\u0629 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0642\u0631\u064a\u0628\u0629 \u0645\u0646 \u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u062e\u0627\u0635 \u0628\u0646\u0627";
    t[8156] = "Reseed";
    t[8157] = "\u0627\u0639\u0627\u062f\u0629 \u062a\u0648\u0632\u064a\u0639";
    t[8158] = "is the peer banned, or unreachable, or failing tunnel tests?";
    t[8159] = "\u0647\u0644 \u0627\u0644\u0646\u0638\u064a\u0631 \u0645\u062d\u0638\u0648\u0631\u060c \u0623\u0648 \u063a\u064a\u0631 \u0642\u0627\u0628\u0644 \u0644\u0644\u0648\u0635\u0648\u0644\u060c \u0623\u0648 \u0641\u0627\u0634\u0644 \u0641\u064a \u0627\u062e\u062a\u0628\u0627\u0631\u0627\u062a \u0627\u0644\u0646\u0641\u0642\u061f";
    t[8162] = "Disable inbound (firewalled)";
    t[8163] = "\u062a\u0639\u0637\u064a\u0644 \u0627\u0644\u0648\u0627\u0631\u062f (\u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629)";
    t[8164] = "Launch I2P Router Console in web browser when I2P starts.";
    t[8165] = "\u0642\u0645 \u0628\u062a\u0634\u063a\u064a\u0644 \u0648\u062d\u062f\u0629 \u062a\u062d\u0643\u0645 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 I2P \u0641\u064a \u0645\u062a\u0635\u0641\u062d \u0627\u0644\u0648\u064a\u0628 \u0639\u0646\u062f \u0628\u062f\u0621 \u062a\u0634\u063a\u064a\u0644 I2P.";
    t[8174] = "Average job delay / maximum delay";
    t[8175] = "\u0645\u062a\u0648\u0633\u0637 \u200b\u200b\u062a\u0623\u062e\u064a\u0631 \u0627\u0644\u0645\u0647\u0645\u0629 / \u0627\u0644\u062d\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0644\u0644\u062a\u0623\u062e\u064a\u0631";
    t[8176] = "Tunnel Participant";
    t[8177] = "\u0645\u0634\u0627\u0631\u0643 \u0627\u0644\u0646\u0641\u0642";
    t[8178] = "Statistics";
    t[8179] = "\u0627\u0644\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a";
    t[8188] = "Use alternative display font in console and webapps";
    t[8189] = "\u0627\u0633\u062a\u062e\u062f\u0645 \u062e\u0637 \u0627\u0644\u0639\u0631\u0636 \u0627\u0644\u0628\u062f\u064a\u0644 \u0641\u064a \u0648\u062d\u062f\u0629 \u0627\u0644\u062a\u062d\u0643\u0645 \u0648\u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0627\u0644\u0648\u064a\u0628";
    t[8194] = "Reseeding Your Router";
    t[8195] = "\u0625\u0639\u0627\u062f\u0629 \u062a\u0628\u0630\u064a\u0631 \u0645\u0648\u062c\u0647\u0643";
    t[8206] = "Started";
    t[8207] = "\u0628\u062f\u0623\u062a";
    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "\u062d\u064a\u062b\u0645\u0627 \u0623\u0645\u0643\u0646 \u0630\u0644\u0643\u060c \u064a\u062c\u0628 \u062a\u062d\u0645\u064a\u0644 \u0627\u0644\u0623\u0635\u0648\u0644 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u0629 \u0628\u0627\u0633\u062a\u0645\u0631\u0627\u0631 \u0639\u0644\u0649 \u0645\u0648\u0642\u0639\u0643 \u0645\u0646 \u0645\u0644\u0641 \u062e\u0627\u0631\u062c\u064a \u0648\u0644\u064a\u0633 \u062f\u0627\u062e\u0644 \u0627\u0644\u0635\u0641\u062d\u0629. \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0633\u062a\u062e\u062f\u0645 \u0646\u0641\u0633 \u0623\u0633\u0644\u0648\u0628 \u062a\u0646\u0633\u064a\u0642 \u0627\u0644\u0635\u0641\u062d\u0627\u062a \u0628\u0635\u064a\u063a\u0629 \u0633\u064a \u0625\u0633 \u0625\u0633 \u0639\u0644\u0649 \u0639\u062f\u0629 \u0635\u0641\u062d\u0627\u062a\u060c \u0642\u0645 \u0628\u0625\u0646\u0634\u0627\u0621 \u0645\u0644\u0641 \u0633\u064a \u0625\u0633 \u0625\u0633 \u0645\u0646\u0641\u0635\u0644 \u0648\u062a\u062d\u0645\u064a\u0644\u0647 \u0641\u064a \u0642\u0633\u0645 <code>&lt;head&gt;</code> \u0644\u0635\u0641\u062d\u0627\u062a\u0643. \u0633\u064a\u062c\u0639\u0644 \u0647\u0630\u0627 \u0639\u0645\u0644\u064a\u0629 \u062a\u062d\u062f\u064a\u062b \u062a\u0646\u0633\u064a\u0642 \u0645\u0648\u0642\u0639\u0643 \u0623\u0633\u0647\u0644 \u0641\u064a \u0627\u0644\u0625\u062f\u0627\u0631\u0629\u060c \u0648\u0633\u064a\u0633\u0645\u062d \u0623\u064a\u0636\u064b\u0627 \u0628\u062a\u062e\u0632\u064a\u0646 \u0645\u0644\u0641 \u0627\u0644\u062a\u0646\u0633\u064a\u0642 \u0641\u064a \u0630\u0627\u0643\u0631\u0629 \u062a\u062e\u0632\u064a\u0646 \u0627\u0644\u0645\u062a\u0635\u0641\u062d \u0644\u062f\u0649 \u0627\u0644\u0632\u0627\u0626\u0631\u060c \u0645\u0645\u0627 \u064a\u0624\u062f\u064a \u0625\u0644\u0649 \u0637\u0644\u0628\u0627\u062a \u0623\u0642\u0644 \u0644\u0648\u062d\u062f\u0629 \u0627\u0644\u0645\u0639\u0627\u0644\u062c\u0629 \u0627\u0644\u0645\u0631\u0643\u0632\u064a\u0629 \u0639\u0644\u0649 \u062e\u0627\u062f\u0648\u0645\u0643 \u0627\u0644\u0648\u064a\u0628 \u0648\u062a\u062d\u0645\u064a\u0644 \u0635\u0641\u062d\u0627\u062a \u0623\u0633\u0631\u0639 \u0644\u0632\u0648\u0627\u0631\u0643.\"";
    t[8210] = "Job Stats";
    t[8211] = "\u0627\u062d\u0635\u0627\u0626\u064a\u0627\u062a \u0627\u0644\u0648\u0638\u064a\u0641\u0629";
    t[8212] = "Licensing Information";
    t[8213] = "\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u062a\u0631\u062e\u064a\u0635";
    t[8216] = "Add additional logging statements above (e.g. {0}).";
    t[8217] = "\u0623\u0636\u0641 \u0628\u064a\u0627\u0646\u0627\u062a \u062a\u0633\u062c\u064a\u0644 \u0625\u0636\u0627\u0641\u064a\u0629 \u0623\u0639\u0644\u0627\u0647 (\u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644 {0}).";
    t[8222] = "Create Family";
    t[8223] = "\u0625\u0646\u0634\u0627\u0621 \u0639\u0627\u0626\u0644\u0629";
    t[8224] = "Total session-only bans";
    t[8225] = "\u0625\u062c\u0645\u0627\u0644\u064a \u0627\u0644\u062d\u0638\u0631 \u0644\u0644\u062c\u0644\u0633\u0629 \u0641\u0642\u0637";
    t[8230] = "Save";
    t[8231] = "\u062d\u0641\u0638";
    t[8234] = "Floodfills Close to Our Destinations";
    t[8235] = "\u0645\u062f\u0627\u0641\u0646 \u0627\u0644\u0641\u064a\u0636\u0627\u0646\u0627\u062a \u0642\u0631\u064a\u0628\u0629 \u0645\u0646 \u0648\u062c\u0647\u0627\u062a\u0646\u0627";
    t[8236] = "Start";
    t[8237] = "\u0625\u0628\u062f\u0623";
    t[8240] = "Hide legend";
    t[8241] = "\u0625\u062e\u0641\u0627\u0621 \u0648\u0633\u064a\u0644\u0629 \u0627\u0644\u0625\u064a\u0636\u0627\u062d";
    t[8244] = "Details";
    t[8245] = "\u0627\u0644\u062a\u0641\u0627\u0635\u064a\u0644";
    t[8252] = "Help Section";
    t[8253] = "\u0642\u0633\u0645 \u0627\u0644\u0645\u0633\u0627\u0639\u062f\u0629";
    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "\u062a\u0643\u0648\u064a\u0646 I2P+: \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0641\u0627\u064a\u0631\u0641\u0648\u0643\u0633\u060c \u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "\u0625\u0630\u0627 \u0627\u0639\u062a\u0642\u062f\u062a \u0623\u0646\u0643 \u0642\u062f \u0641\u062a\u062d\u062a \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0648\u0644\u0627 \u064a\u0632\u0627\u0644 I2P \u064a\u0639\u062a\u0642\u062f \u0628\u0623\u0646\u0643 \u0645\u062d\u0645\u064a\u060c \u0641\u062a\u0630\u0643\u0631 \u0623\u0646\u0647 \u0642\u062f \u062a\u062a\u0648\u0641\u0631 \u0644\u062f\u064a\u0643 \u0623\u0643\u062b\u0631 \u0645\u0646 \u062c\u062f\u0627\u0631 \u062d\u0645\u0627\u064a\u0629\u060c \u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644 \u0643\u0644 \u0645\u0646 \u062d\u0632\u0645 \u0628\u0631\u0645\u062c\u064a\u0629 \u0648\u0645\u0648\u062c\u0647\u0627\u062a \u0623\u062c\u0647\u0632\u0629 \u062e\u0627\u0631\u062c\u064a\u0629.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "\u0627\u0644\u0643\u0644\u0645\u0629 \u0627\u0644\u0631\u0626\u064a\u0633\u064a\u0629 <i class=example>\u0631\u0641\u0636</i>. ";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "\u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u0632\u0648\u0627\u0631 \u0627\u0644\u0630\u064a\u0646 \u064a\u0642\u0648\u0645\u0648\u0646 \u0628\u0640 90 \u0627\u062a\u0635\u0627\u0644\u0627\u064b \u0623\u0648 \u0623\u0643\u062b\u0631 \u0641\u064a \u0627\u0644\u062f\u0642\u064a\u0642\u0629";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "\u0644\u0642\u062f \u0642\u0645\u062a \u0628\u062a\u0643\u0648\u064a\u0646 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u062a\u064a \u0633\u064a \u0628\u064a \u0627\u0644\u0648\u0627\u0631\u062f\u060c \u0648\u0644\u0643\u0646 \u0645\u0646\u0641\u0630 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u064a\u0648 \u062f\u064a \u0628\u064a \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0645\u062d\u0645\u064a\u060c \u0648\u0628\u0627\u0644\u062a\u0627\u0644\u064a \u0645\u0646 \u0627\u0644\u0645\u062d\u062a\u0645\u0644 \u0623\u0646 \u064a\u0643\u0648\u0646 \u0645\u0646\u0641\u0630 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u062a\u064a \u0633\u064a \u0628\u064a \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0645\u062d\u0645\u064a \u0623\u064a\u0636\u064b\u0627.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "\u0647\u0630\u0627 \u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u062a\u064a \u0633\u064a\u0633\u062a\u062e\u062f\u0645\u0647\u0627 \u0645\u0648\u062c\u0647\u0643 \u0644\u0644\u0627\u0633\u062a\u0641\u0633\u0627\u0631\u0627\u062a \u0639\u0646 \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629. \u0639\u0627\u062f\u0629\u064b \u0645\u0627 \u064a\u0643\u0648\u0646 \u0647\u0624\u0644\u0627\u0621 \u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a <i>floodfill</i> \u0627\u0644\u0645\u0633\u0624\u0648\u0644\u0629 \u0639\u0646 \u0627\u0644\u062d\u0641\u0627\u0638 \u0639\u0644\u0649 \u0633\u0644\u0627\u0645\u0629 \u0627\u0644\u0634\u0628\u0643\u0629. \u064a\u062a\u0645 \u0639\u0631\u0636 \u0623\u0642\u0631\u0627\u0646\u0643 \u062c\u064a\u062f\u0629 \u0627\u0644\u0627\u0646\u062f\u0645\u0627\u062c \u0641\u064a \u0623\u0633\u0641\u0644 <a href='/profiles'>\u0635\u0641\u062d\u0629 \u0627\u0644\u0645\u0644\u0641\u0627\u062a</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "\u0625\u062f\u0627\u0631\u0629 \u062a\u0637\u0628\u064a\u0642\u0627\u062a \u0627\u0644\u0648\u064a\u0628 \u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "\u0627\u0644\u0625\u0631\u0633\u0627\u0644 \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u0644\u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 TCP \u0645\u0646 \u0645\u0646\u0627\u0641\u0630 \u0639\u0627\u0644\u064a\u0629 \u0639\u0634\u0648\u0627\u0626\u064a\u0629 \u0625\u0644\u0649 \u0645\u0646\u0627\u0641\u0630 TCP \u0639\u0634\u0648\u0627\u0626\u064a\u0629 \u0639\u0646 \u0628\u0639\u062f.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "\u0639\u0646\u062f \u0628\u062f\u0621 \u062a\u0634\u063a\u064a\u0644 I2P\u060c \u0642\u062f \u064a\u0633\u062a\u063a\u0631\u0642 \u0627\u0644\u0623\u0645\u0631 \u0628\u0636\u0639 \u062f\u0642\u0627\u0626\u0642 \u0644\u0628\u062f\u0621 (\u062f\u0645\u062c) \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629 \u0648\u0627\u0644\u0639\u062b\u0648\u0631 \u0639\u0644\u0649 \u0623\u0642\u0631\u0627\u0646 \u0625\u0636\u0627\u0641\u064a\u064a\u0646\u060c \u0644\u0630\u0627 \u064a\u0631\u062c\u0649 \u0627\u0644\u062a\u062d\u0644\u064a \u0628\u0627\u0644\u0635\u0628\u0631.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "\u0644\u0645 \u064a\u062d\u062f\u062f \u0645\u0644\u0641. \u064a\u0631\u062c\u0649 \u062a\u062d\u062f\u064a\u062f \u0645\u0644\u0641 .zip \u0623\u0648 .su3 \u0635\u0627\u0644\u062d \u0645\u0646.";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
    t[8321] = "\u062a\u0645\u0643\u064a\u0646 \u0627\u0644\u0643\u0634\u0641 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a \u0644\u0644\u062e\u062f\u0645\u0627\u062a (UPnP)";
    t[8322] = "Unknown Wizard page";
    t[8323] = "\u0635\u0641\u062d\u0629 \u0645\u0639\u0627\u0644\u062c \u063a\u064a\u0631 \u0645\u0639\u0631\u0648\u0641\u0629";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "IPv6 \u0641\u0642\u0637 NTCP\u060c SSU\u060c \u0627\u0644\u0645\u064f\u0642\u062f\u0645\u064a\u0646";
    t[8332] = "Messages sent to peer";
    t[8333] = "\u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u0645\u0631\u0633\u0644\u0629 \u0625\u0644\u0649 \u0627\u0644\u0646\u0638\u064a\u0631";
    t[8334] = "Function";
    t[8335] = "\u062f\u0648\u0631";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "\u0639\u0644\u0649 \u0634\u0628\u0643\u0629 I2P\u060c \u064a\u0645\u0643\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0645\u0636\u064a\u0641\u0629 \u0639\u0646 \u0628\u064f\u0639\u062f \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0639\u0646\u0648\u0627\u0646 Base32 \u064a\u0646\u062a\u0647\u064a \u0628\u0640 \".b32.i2p\"\u060c \u0623\u0648 \u0648\u062c\u0647\u0629 \u062a\u0645 \u062a\u0645\u062b\u064a\u0644\u0647\u0627 \u0628\u0633\u0644\u0633\u0644\u0629 Base64 \u0637\u0648\u064a\u0644\u0629\u060c \u0623\u0648 \u0639\u0627\u062f\u0629 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0646\u0637\u0627\u0642 .i2p. \u0627\u0644\u0648\u062c\u0647\u0629 \u0647\u064a \u0645\u0627 \u064a\u0639\u0627\u062f\u0644 \u0639\u0646\u0648\u0627\u0646 IP \u0639\u0644\u0649 I2P\u060c \u0648\u064a\u062a\u0645 \u0639\u0631\u0636\u0647\u0627 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href='/i2ptunnel/edit?tunnel=3'>\u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642</a>. \u064a\u0645\u0643\u0646\u0643 \u0645\u0634\u0627\u0631\u0643\u0629 \u0639\u0646\u0648\u0627\u0646 b32.i2p \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0644\u0644\u0633\u0645\u0627\u062d \u0644\u0644\u0622\u062e\u0631\u064a\u0646 \u0628\u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0645\u0648\u0642\u0639\u0643 \u062d\u062a\u0649 \u064a\u062a\u0645 \u062a\u0633\u062c\u064a\u0644 \u0646\u0637\u0627\u0642 .i2p \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.";
    t[8340] = "Computing-related tutorials";
    t[8341] = "\u0627\u0644\u062f\u0631\u0648\u0633 \u0627\u0644\u0645\u062a\u0639\u0644\u0642\u0629 \u0628\u0627\u0644\u062d\u0648\u0633\u0628\u0629";
    t[8342] = "Error {0}";
    t[8343] = "\u062e\u0637\u0623 {0}";
    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "\u0623\u062f\u062e\u0644 \u0627\u0644\u0627\u0633\u0645 \u0648\u0642\u0645 \u0628\u0644\u0635\u0642 \u0627\u0644\u0648\u062c\u0647\u0629 \u0641\u064a <a href='/dns?book=router&amp;filter=none'>\u062f\u0644\u064a\u0644 \u0627\u0644\u0639\u0646\u0627\u0648\u064a\u0646</a> \u0627\u0644\u062e\u0627\u0635 \u0628\u0643. \u0627\u0646\u0642\u0631 \u0641\u0648\u0642 <i>\u0625\u0636\u0627\u0641\u0629</i> \u0644\u062d\u0641\u0638 \u0627\u0644\u0625\u062f\u062e\u0627\u0644 \u0627\u0644\u062c\u062f\u064a\u062f.";
    t[8358] = "Stats";
    t[8359] = "\u0627\u062d\u0635\u0627\u0626\u0627\u062a";
    t[8360] = "Maximum number of concurrent messages to send";
    t[8361] = "\u0627\u0644\u062d\u062f \u0627\u0644\u0623\u0642\u0635\u0649 \u0644\u0639\u062f\u062f \u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u0645\u062a\u0632\u0627\u0645\u0646\u0629 \u0644\u0644\u0625\u0631\u0633\u0627\u0644";
    t[8364] = "Recorders keep track of connection attempts made by a remote destination, and if that breaches the defined threshold, the destination gets logged in the specified file. Multiple recorders can be specified:";
    t[8365] = "\u062a\u0642\u0648\u0645 \u0627\u0644\u0645\u0633\u062c\u0644\u0627\u062a \u0628\u0645\u062a\u0627\u0628\u0639\u0629 \u0645\u062d\u0627\u0648\u0644\u0627\u062a \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u062a\u064a \u064a\u0642\u0648\u0645 \u0628\u0647\u0627 \u0648\u062c\u0647\u0629 \u0639\u0646 \u0628\u0639\u062f\u060c \u0648\u0641\u064a \u062d\u0627\u0644\u0629 \u0645\u062e\u0627\u0644\u0641\u062a\u0647\u0627 \u0644\u0644\u0639\u062a\u0628\u0629 \u0627\u0644\u0645\u062d\u062f\u062f\u0629\u060c \u064a\u062a\u0645 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u0648\u062c\u0647\u0629 \u0641\u064a \u0627\u0644\u0645\u0644\u0641 \u0627\u0644\u0645\u062d\u062f\u062f. \u064a\u0645\u0643\u0646 \u062a\u062d\u062f\u064a\u062f \u0645\u0633\u062c\u0644\u0627\u062a \u0645\u062a\u0639\u062f\u062f\u0629:";
    t[8368] = "(the symbol '@' will be replaced during log rotation)";
    t[8369] = "(\u0633\u064a\u062a\u0645 \u0627\u0633\u062a\u0628\u062f\u0627\u0644 \u0627\u0644\u0631\u0645\u0632 @ \u0623\u062b\u0646\u0627\u0621 \u062a\u062f\u0648\u064a\u0631 \u0627\u0644\u0633\u062c\u0644)";
    t[8376] = "Updated settings for all pools.";
    t[8377] = "\u062a\u062d\u062f\u064a\u062b \u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0644\u0644\u062c\u0645\u064a\u0639.";
    t[8382] = "Capabilities in the NetDb, not used to determine profiles";
    t[8383] = "\u0627\u0644\u0642\u062f\u0631\u0627\u062a \u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a NetDb\u060c \u0644\u0627 \u062a\u0633\u062a\u062e\u062f\u0645 \u0644\u062a\u062d\u062f\u064a\u062f \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0627\u0644\u0634\u062e\u0635\u064a\u0629";
    t[8384] = "Configure peer";
    t[8385] = "\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0646\u0638\u064a\u0631";
    t[8388] = "How long ago connection was established";
    t[8389] = "\u0645\u0646\u0630 \u0645\u062a\u0649 \u062a\u0645 \u0625\u0646\u0634\u0627\u0621 \u0627\u0644\u0627\u062a\u0635\u0627\u0644";
    t[8396] = "Local SSL Certificates";
    t[8397] = "\u0634\u0647\u0627\u062f\u0627\u062a SSL \u0627\u0644\u0645\u062d\u0644\u064a\u0629";
    t[8408] = "Delete Sybil Blocklist";
    t[8409] = "\u062d\u0630\u0641 \u0642\u0627\u0626\u0645\u0629 \u062d\u0638\u0631 Sybil";
    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "\u0644\u062a\u0639\u0637\u064a\u0644 \u0642\u0648\u0627\u0626\u0645 \u0627\u0644\u062f\u0644\u0627\u0626\u0644\u060c \u0627\u0628\u062d\u062b \u0639\u0646 \u0625\u062f\u062e\u0627\u0644 <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> \u0641\u064a \u0645\u0644\u0641 <code>base-context.xml</code> \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0645\u062c\u0644\u062f <code>eepsite/contexts</code> (\u0645\u0628\u0627\u0634\u0631\u0629 \u0641\u0648\u0642 \u0645\u062c\u0644\u062f docroot)\u060c \u0648\u0642\u0645 \u0628\u062a\u063a\u064a\u064a\u0631 'true' \u0625\u0644\u0649 'false' \u062a\u062d\u062a\u0647 \u0645\u0628\u0627\u0634\u0631\u0629\u064b. \u0644\u062a\u0637\u0628\u064a\u0642 \u0627\u0644\u062a\u063a\u064a\u064a\u0631 \u0641\u0648\u0631\u064b\u0627\u060c \u062a\u0648\u0642\u0641 \u0648\u0623\u0639\u062f \u062a\u0634\u063a\u064a\u0644 \u0639\u0645\u064a\u0644 <i>\u062e\u0627\u062f\u0648\u0645 I2P</i> \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 <a href=/configclients>\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0639\u0645\u0644\u0627\u0621</a>. \u0643\u0645\u0627 \u064a\u0645\u0643\u0646\u0643 \u0623\u064a\u0636\u064b\u0627 \u0625\u0633\u0642\u0627\u0637 \u0645\u0644\u0641 <code>index.html</code> \u0641\u0627\u0631\u063a \u0641\u064a \u0623\u064a \u062f\u0644\u064a\u0644 \u0645\u0639\u0631\u0636 \u0644\u0642\u0645\u0639 \u0642\u0648\u0627\u0626\u0645 \u0627\u0644\u062f\u0644\u0627\u0626\u0644 \u0644\u062a\u0644\u0643 \u0627\u0644\u0645\u0648\u0627\u0642\u0639.";
    t[8414] = "Same IPv6 /64 as us";
    t[8415] = "\u0646\u0641\u0633 IPv6 /64 \u0645\u062b\u0644\u0646\u0627";
