    t[8423] = "\u0627\u0644\u063a\u0627\u0621 \u0627\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0634\u063a\u064a\u0644";
    t[8424] = "Messages received from peer";
    t[8425] = "\u0627\u0644\u0631\u0633\u0627\u0626\u0644 \u0627\u0644\u0648\u0627\u0631\u062f\u0629 \u0645\u0646 \u0627\u0644\u0623\u0642\u0631\u0627\u0646";
    t[8426] = "peer profiles";
    t[8427] = "\u0628\u0631\u0648\u0641\u0627\u064a\u0644 \u0627\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646";
    t[8428] = "Update with unsigned development builds";
    t[8429] = "\u0627\u0644\u062a\u062d\u062f\u064a\u062b \u0645\u0639 \u0628\u0646\u064a\u0627\u062a \u0627\u0644\u062a\u0637\u0648\u064a\u0631 \u063a\u064a\u0631 \u0627\u0644\u0645\u0648\u0642\u0639\u0629";
    t[8438] = "Configure I2P Stat Collection";
    t[8439] = "\u062a\u0643\u0648\u064a\u0646 \u0645\u062c\u0645\u0648\u0639\u0629 \u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a I2P";
    t[8444] = "Moderate";
    t[8445] = "\u0645\u062a\u0648\u0633\u0637";
    t[8448] = "Update available, click button on left to download";
    t[8449] = "\u062a\u0648\u062c\u062f \u062a\u062d\u062f\u064a\u062b\u0627\u062a\u060c \u0627\u0646\u0642\u0631 \u0632\u0631 \u0639\u0644\u0649 \u0627\u0644\u064a\u0633\u0627\u0631 \u0644\u0644\u062a\u062d\u0645\u064a\u0644";
    t[8458] = "High Capacity";
    t[8459] = "\u0642\u062f\u0631\u0629 \u0639\u0627\u0644\u064a\u0629";
    t[8460] = "by default there are no limits";
    t[8461] = "\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0627 \u0644\u0627 \u062a\u0648\u062c\u062f \u062d\u062f\u0648\u062f";
    t[8462] = "System Tray Integration";
    t[8463] = "\u062a\u0643\u0627\u0645\u0644 \u0639\u0644\u0628\u0629 \u0627\u0644\u0646\u0638\u0627\u0645";
    t[8466] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[8467] = "\u064a\u0645\u0643\u0646 \u062a\u0639\u0637\u064a\u0644\u0647 \u0641\u064a \u0645\u0644\u0641 <code>clients.config</code>. \u0643\u0645\u0627 \u064a\u0645\u0643\u0646 \u062a\u0643\u0648\u064a\u0646\u0647 \u0644\u0644\u0627\u0631\u062a\u0628\u0627\u0637 \u0628\u0648\u0627\u062c\u0647\u0629 \u0645\u062d\u062f\u062f\u0629 \u0623\u0648 \u0643\u0644 \u0627\u0644\u0648\u0627\u062c\u0647\u0627\u062a. \u0625\u0630\u0627 \u0642\u0645\u062a \u0628\u062c\u0639\u0644 \u0648\u0627\u062c\u0647\u0629 \u0627\u0644\u0645\u0648\u062c\u0647 \u0645\u062a\u0627\u062d\u0629 \u0639\u0628\u0631 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0642\u062f \u062a\u0631\u063a\u0628 \u0641\u064a <a href=/configui#passwordheading>\u0641\u0631\u0636 \u0643\u0644\u0645\u0629 \u0645\u0631\u0648\u0631 \u0644\u0644\u0648\u0635\u0648\u0644</a> \u0644\u0645\u0646\u0639 \u0627\u0644\u0648\u0635\u0648\u0644 \u063a\u064a\u0631 \u0627\u0644\u0645\u0635\u0631\u062d \u0628\u0647.";
    t[8470] = "Show Legend";
    t[8471] = "\u0639\u0631\u0636 \u0627\u0644\u062a\u0641\u0633\u064a\u0631";
    t[8474] = "Profile";
    t[8475] = "\u062d\u0633\u0627\u0628 \u062a\u0639\u0631\u064a\u0641\u064a";
    t[8490] = "A group of tunnel entry points (leases) for a <i>destination</i>. Note: A 0-hop server tunnel will only have one lease, regardless of the number of tunnels configured.";
    t[8491] = "\u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u0646 \u0646\u0642\u0627\u0637 \u062f\u062e\u0648\u0644 \u0627\u0644\u0646\u0641\u0642 (\u0627\u0644\u0627\u064a\u062c\u0627\u0631\u0627\u062a) \u0644\u0640<i>\u0648\u062c\u0647\u0629</i>. \u0645\u0644\u0627\u062d\u0638\u0629: \u0646\u0641\u0642 \u062e\u0627\u062f\u0645 \u0628\u062f\u0648\u0646 \u0642\u0641\u0632\u0627\u062a \u0633\u064a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0625\u064a\u062c\u0627\u0631 \u0648\u0627\u062d\u062f \u0641\u0642\u0637 \u0628\u063a\u0636 \u0627\u0644\u0646\u0638\u0631 \u0639\u0646 \u0639\u062f\u062f \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0645\u0647\u064a\u0626\u0629.";
