    t[8720] = "The sybil detection routine can be configured to scan the Network Database on a regular interval, with the option to block peers meeting the configured threshold. Blocking peers prevents your router from building tunnels with them for the duration configured, or until the router is restarted.";
    t[8721] = "\u064a\u0645\u0643\u0646 \u062a\u0643\u0648\u064a\u0646 \u0631\u0648\u062a\u064a\u0646 \u0627\u0644\u0643\u0634\u0641 \u0639\u0646 SYBIL \u0644\u0645\u0633\u062d \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629 \u0639\u0644\u0649 \u0641\u0627\u0635\u0644 \u0645\u0646\u062a\u0638\u0645 \u060c \u0645\u0639 \u062e\u064a\u0627\u0631 \u0645\u0646\u0639 \u0623\u0642\u0631\u0627\u0646\u0647\u0645 \u0627\u0644\u0639\u062a\u0628\u0629 \u0627\u0644\u062a\u064a \u062a\u0645 \u062a\u0643\u0648\u064a\u0646\u0647\u0627. \u064a\u0645\u0646\u0639 \u0623\u0642\u0631\u0627\u0646 \u062d\u0638\u0631 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0645\u0646 \u0628\u0646\u0627\u0621 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0645\u0639\u0647\u0645 \u0644\u0644\u0645\u062f\u0629 \u0627\u0644\u062a\u064a \u062a\u0645 \u062a\u0643\u0648\u064a\u0646\u0647\u0627 \u060c \u0623\u0648 \u062d\u062a\u0649 \u064a\u062a\u0645 \u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647.";
