    t[9052] = "Ready";
    t[9053] = "\u0645\u0633\u062a\u0639\u062f";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "\u0647\u0630\u0647 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0645\u062d\u0644\u064a\u0629 \u0627\u0644\u0645\u0642\u062f\u0645\u0629 \u0645\u0646 \u0645\u0648\u062c\u0647\u0643. \u0642\u062f \u062a\u0643\u0648\u0646 \u0639\u0645\u0644\u0627\u0621 \u062a\u0645 \u0628\u062f\u0624\u0647\u0627 \u0639\u0628\u0631 <a href='/i2ptunnelmgr'>\u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642</a> \u0623\u0648 \u0628\u0631\u0627\u0645\u062c \u062e\u0627\u0631\u062c\u064a\u0629 \u062a\u062a\u0635\u0644 \u0639\u0628\u0631 SAM \u0623\u0648 BOB \u0623\u0648 \u0645\u0628\u0627\u0634\u0631\u0629 \u0639\u0628\u0631 I2CP. \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627\u060c \u0633\u062a\u0634\u062a\u0631\u0643 \u0623\u063a\u0644\u0628 \u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0639\u0645\u0644\u0627\u0621 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643 (\u0627\u0644\u0628\u0631\u064a\u062f\u060c \u0645\u062d\u0648\u0644 HTTP \u060cIRC) \u0641\u064a \u0646\u0641\u0633 \u0645\u062c\u0645\u0648\u0639\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0648\u064a\u062a\u0645 \u062a\u0635\u0646\u064a\u0641\u0647\u0627 \u062a\u062d\u062a <i>\u0639\u0645\u0644\u0627\u0621 \u0645\u0634\u062a\u0631\u0643\u0648\u0646</i> \u0648 <i>\u0639\u0645\u0644\u0627\u0621 \u0645\u0634\u062a\u0631\u0643\u0648\u0646(DSA)</i>\u060c \u0645\u0645\u0627 \u064a\u062d\u0633\u0651\u0646 \u0627\u0644\u0633\u0631\u064a\u0629 \u0645\u0646 \u062e\u0644\u0627\u0644 \u062f\u0645\u062c \u062d\u0631\u0643\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0645\u0646 \u0643\u0627\u0641\u0629 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0645\u0634\u062a\u0631\u0643\u0629\u060c \u0648\u064a\u0642\u0644\u0644 \u0645\u0646 \u0627\u0644\u0623\u0639\u0628\u0627\u0621 \u0627\u0644\u0644\u0627\u0632\u0645\u0629 \u0644\u0628\u0646\u0627\u0621 \u0648\u0635\u064a\u0627\u0646\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642. \u0648\u0645\u0639 \u0630\u0644\u0643\u060c \u0625\u0630\u0627 \u0648\u0627\u062c\u0647\u062a \u0645\u0634\u0643\u0644\u0629 \u0641\u064a \u0627\u0644\u0623\u0646\u0641\u0627\u0642\u060c \u0633\u062a\u062a\u0648\u0642\u0641 \u0643\u0627\u0641\u0629 \u062e\u062f\u0645\u0627\u062a\u0643 \u0641\u064a \u0648\u0642\u062a \u0648\u0627\u062d\u062f\u060c \u0644\u0630\u0627 \u0642\u062f \u062a\u0631\u063a\u0628 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0633\u064a\u0646\u0627\u0631\u064a\u0648\u0647\u0627\u062a \u0628\u062a\u0643\u0648\u064a\u0646 \u062e\u062f\u0645\u0627\u062a \u0627\u0644\u0639\u0645\u0644\u0627\u0621 \u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0645\u062c\u0645\u0648\u0639\u0629 \u0623\u0646\u0641\u0627\u0642 \u062e\u0627\u0635\u0629 \u0628\u0647\u0627. \u0648\u064a\u0645\u0643\u0646 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0630\u0644\u0643 \u0639\u0628\u0631 \u0625\u0644\u063a\u0627\u0621 \u062a\u062d\u062f\u064a\u062f \u062e\u064a\u0627\u0631 <i>\u0645\u0634\u0627\u0631\u0643\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0645\u0639 \u0639\u0645\u0644\u0627\u0621 \u0622\u062e\u0631\u064a\u0646\u2026</i> \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u062a\u062d\u062a <i>\u0639\u0645\u0644\u0627\u0621 \u0645\u0634\u062a\u0631\u0643\u0648\u0646</i> \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 \u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0627\u0644\u062e\u062f\u0645\u0629 \u0630\u0627\u062a \u0627\u0644\u0635\u0644\u0629 \u0641\u064a \u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642\u060c \u062b\u0645 \u0633\u064a\u062a\u0639\u064a\u0646 \u0625\u0639\u0627\u062f\u0629 \u0628\u062f\u0621 \u0627\u0644\u062e\u062f\u0645\u0629 \u0645\u0646 \u0635\u0641\u062d\u0629 <a href='/i2ptunnelmgr'>\u0627\u0644\u0631\u0626\u064a\u0633\u064a\u0629 \u0644\u0645\u062f\u064a\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642</a>.";
