    t[9139] = "\u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0631\u063a\u0628 \u0641\u064a \u0627\u0644\u0625\u0628\u0644\u0627\u063a \u0639\u0646 \u062e\u0637\u0623\u060c \u064a\u0631\u062c\u0649 \u062a\u0642\u062f\u064a\u0645 \u0637\u0644\u0628 \u062a\u0630\u0643\u0631\u0629 \u0639\u0644\u0649 <a href=https://github.com/I2PPlus/i2pplus/issues target=_blank rel=noreferrer class=sitelink>github.com/I2PPlus/i2pplus/issues</a>. \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0644\u0645\u0646\u0627\u0642\u0634\u0627\u062a \u0630\u0627\u062a \u0627\u0644\u0635\u0644\u0629 \u0628\u0627\u0644\u0645\u0637\u0648\u0631\u064a\u0646\u060c \u064a\u0631\u062c\u0649 \u0632\u064a\u0627\u0631\u0629 <a href=http://zzz.i2p/ target=_blank rel=noreferrer class=sitelink>\u0645\u0646\u062a\u062f\u064a\u0627\u062a \u0627\u0644\u0645\u0637\u0648\u0631\u064a\u0646 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0640 zzz</a> \u0623\u0648 \u062a\u0627\u0628\u0639\u0648\u0627 \u0642\u0646\u0627\u0629 <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>\u0627\u0644\u0645\u0637\u0648\u0631\u064a\u0646</a> \u0639\u0644\u0649 \u0634\u0628\u0643\u0629 IRC \u0644\u0640 I2P.";
