    t[9200] = "The themes directory is located in the I2P application directory under <code>docs/themes</code>. There are example override files in the console and I2PSnark theme sub-directories.";
    t[9201] = "\u062f\u0644\u064a\u0644 \u0627\u0644\u0633\u0645\u0627\u062a \u0645\u0648\u062c\u0648\u062f \u0641\u064a \u062f\u0644\u064a\u0644 \u062a\u0637\u0628\u064a\u0642 I2P \u062a\u062d\u062a <code>docs/themes</code>. \u0647\u0646\u0627\u0643 \u0645\u0644\u0641\u0627\u062a \u062a\u062c\u0627\u0648\u0632 \u0646\u0645\u0648\u0630\u062c\u064a\u0629 \u0641\u064a \u0645\u062c\u0644\u062f\u0627\u062a \u0633\u0645\u0629 \u0641\u0631\u0639\u064a\u0629 \u0644\u0644\u0643\u0648\u0646\u0633\u0648\u0644 \u0648 I2PSnark.";
    t[9202] = "Note: Most of the options in the Tunnel Manager have tooltips; be sure to check those before you change settings you don't fully understand!";
