    t[9323] = "\u0627\u062e\u062a\u0628\u0627\u0631 \u0627\u0644\u062a\u0643\u0648\u064a\u0646 \u0648\u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u062a\u0631\u062f\u062f\u064a";
    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "\u064a\u0633\u0645\u062d \u0627\u0644\u0645\u0646\u0641\u0630 \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u0644\u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0628\u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0623\u062c\u0647\u0632\u0629 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u0623\u062e\u0631\u0649. \u064a\u0648\u0635\u0649 \u0628\u062a\u0643\u0648\u064a\u0646 \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0644\u0644\u0633\u0645\u0627\u062d \u0628\u062d\u0631\u0643\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u0648\u0627\u0631\u062f\u0629 \u0648\u0627\u0644\u0635\u0627\u062f\u0631\u0629 \u0639\u0644\u0649 \u0647\u0630\u0627 \u0627\u0644\u0645\u0646\u0641\u0630 \u0644\u062a\u062d\u0633\u064a\u0646 \u0623\u062f\u0627\u0621 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629.";
    t[9328] = "Bulk Thresholds";
    t[9329] = "\u0639\u062a\u0628\u0627\u062a \u062a\u062c\u0645\u064a\u0639\u0629";
