    t[9351] = "\u0639\u0645\u0644\u064a\u0627\u062a \u0628\u062d\u062b \u062c\u064a\u062f\u0629";
    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0628\u0630\u064a\u0631 \u0647\u064a \u0639\u0645\u0644\u064a\u0629 \u0641\u0631\u063a \u0627\u0644\u0643\u0641 \u0644\u0644\u0639\u062b\u0648\u0631 \u0639\u0644\u0649 \u0645\u0648\u062c\u0647\u0627\u062a \u0623\u062e\u0631\u0649 \u0639\u0646\u062f \u062a\u062b\u0628\u064a\u062a I2P \u0644\u0623\u0648\u0644 \u0645\u0631\u0629\u060c \u0623\u0648 \u0639\u0646\u062f\u0645\u0627 \u064a\u062a\u0628\u0642\u0649 \u0644\u0645\u0648\u062c\u0647\u0643 \u0639\u062f\u062f \u063a\u064a\u0631 \u0643\u0627\u0641 \u0645\u0646 \u0645\u0631\u0627\u062c\u0639 \u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a. \u0633\u062a\u0639\u0645\u0644 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629 \u0628\u0634\u0643\u0644 \u062c\u064a\u062f \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633. \u063a\u064a\u0631 \u0647\u0630\u0647 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u0627\u062a \u0641\u0642\u0637 \u0625\u0630\u0627 \u062a\u0645 \u062d\u0638\u0631 HTTPS \u0628\u0648\u0627\u0633\u0637\u0629 \u062f\u0631\u0639 \u0646\u0627\u0631\u064a \u0642\u0627\u0633 \u0648\u0641\u0634\u0644\u062a \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0628\u0630\u064a\u0631.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f\u060c \u0639\u0646\u062f \u062a\u0645\u0643\u064a\u0646\u0647\u060c \u064a\u0639\u062f\u0644 \u0623\u0642\u0635\u0649 \u062a\u0623\u062e\u064a\u0631 \u0625\u0636\u0627\u0641\u064a \u0639\u0634\u0648\u0627\u0626\u064a \u0644\u0644\u0627\u0633\u062a\u062c\u0627\u0628\u0629 \u0627\u0644\u0645\u0636\u0627\u0641 \u0644\u0644\u062e\u0648\u0627\u062f\u0645 \u0627\u0644\u0645\u0645\u0643\u0651\u0646\u0629 \u0644\u0644\u0627\u0633\u062a\u0641\u0633\u0627\u0631\u0627\u062a\u060c \u0625\u0630\u0627 \u062a\u0645 \u062a\u0645\u0643\u064a\u0646 <code>i2p.streaming.enablePongDelay</code> \u0623\u064a\u0636\u0627\u064b. \u0645\u0627 \u0644\u0645 \u064a\u062a\u0645 \u062a\u0639\u064a\u064a\u0646\u0647 \u0628\u0634\u0643\u0644 \u0635\u0631\u064a\u062d\u060c \u0633\u064a\u062a\u0645 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0642\u064a\u0645\u0629 \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629 \u0627\u0644\u0628\u0627\u0644\u063a\u0629 50 \u0645\u064a\u0644\u064a \u062b\u0627\u0646\u064a\u0629.";
