    t[9489] = "\u0644\u0627\u062d\u0638 \u0623\u0646 \u0645\u0646\u0634\u0626 \u0645\u0644\u0641\u0627\u062a \u0627\u0644\u062a\u0639\u0631\u064a\u0641 \u064a\u0639\u062a\u0645\u062f \u0639\u0644\u0649 \u0627\u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0645\u0633\u062a\u062f\u0627\u0645 \u0644\u0646\u0641\u0642 \u0627\u0644\u0639\u0645\u064a\u0644 \u0644\u062a\u0643\u0648\u064a\u0646 \u0645\u0644\u0641 \u062a\u0639\u0631\u064a\u0641 \u062f\u0642\u064a\u0642 \u0644\u0644\u0623\u0642\u0631\u0627\u0646.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "\u0625\u0630\u0627 \u0643\u0646\u062a \u0641\u064a \u0639\u062c\u0644\u0629 \u0648\u0644\u0627 \u062a\u0633\u062a\u0637\u064a\u0639 \u0627\u0644\u0627\u0646\u062a\u0638\u0627\u0631 \u0628\u0636\u0639 \u0633\u0627\u0639\u0627\u062a\u060c \u064a\u0645\u0643\u0646\u0643 \u0625\u062e\u0628\u0627\u0631 \u0627\u0644\u0646\u0627\u0633 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u062e\u062f\u0645\u0629 \u062a\u062d\u0648\u064a\u0644 \u0639\u0646\u0627\u0648\u064a\u0646 \u0627\u0644\u0645\u0633\u0627\u0639\u062f \"jump\" . \u0639\u0627\u062f\u0629\u064b \u0645\u0627 \u064a\u0639\u0645\u0644 \u0647\u0630\u0627 \u062e\u0644\u0627\u0644 \u0628\u0636\u0639 \u062f\u0642\u0627\u0626\u0642 \u0645\u0646 \u062a\u0633\u062c\u064a\u0644 \u0627\u0633\u0645 \u0627\u0644\u0645\u0636\u064a\u0641 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0639\u0644\u0649 \u0646\u0641\u0633 \u0627\u0644\u0645\u0648\u0642\u0639. \u0627\u062e\u062a\u0628\u0631 \u0630\u0644\u0643 \u0628\u0646\u0641\u0633\u0643 \u0623\u0648\u0644\u0627\u064b \u0639\u0646 \u0637\u0631\u064a\u0642 \u0625\u062f\u062e\u0627\u0644 <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> \u0641\u064a \u0645\u062a\u0635\u0641\u062d\u0643. \u0645\u0631\u0629 \u0648\u0627\u062d\u062f\u0629 \u064a\u0639\u0645\u0644\u060c \u064a\u0645\u0643\u0646\u0643 \u0625\u062e\u0628\u0627\u0631 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0647.";
