    t[10045] = "IRC \u0628\u0631\u0648\u0643\u0633\u064a";
    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "\u0639\u0627\u062f\u0629\u064b \u0645\u0627 \u064a\u062d\u062a\u0627\u062c \u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 I2P \u0625\u0644\u0649 \u0632\u0631\u0639\u0647 \u0645\u0631\u0629 \u0648\u0627\u062d\u062f\u0629 \u0641\u0642\u0637\u060c \u0644\u0644\u0627\u0646\u0636\u0645\u0627\u0645 \u0625\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629 \u0644\u0644\u0645\u0631\u0629 \u0627\u0644\u0623\u0648\u0644\u0649. \u0648\u0645\u0639 \u0630\u0644\u0643\u060c \u0625\u0630\u0627 \u0643\u0627\u0646 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u064a\u0639\u0645\u0644 \u0644\u0641\u062a\u0631\u0629 \u0637\u0648\u064a\u0644\u0629 \u062f\u0648\u0646 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0641\u0642\u062f \u064a\u062d\u062a\u0627\u062c \u0623\u064a\u0636\u064b\u0627 \u0625\u0644\u0649 \u0625\u0639\u0627\u062f\u0629 \u0632\u0631\u0639\u0647. \u062a\u062a\u0636\u0645\u0646 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0632\u0631\u0639 \u062c\u0644\u0628 \u0639\u062f\u0629 \u0645\u0644\u0641\u0627\u062a \"RouterInfo\" (\u0645\u062c\u0645\u0639\u0629 \u0641\u064a \u0645\u0644\u0641 \u0645\u0636\u063a\u0648\u0637 \u0645\u0648\u0642\u0651\u0639) \u0645\u0646 \u0639\u0646\u0648\u0627\u0646\u064a URL \u0645\u062d\u062f\u062f\u064a\u0646 \u0645\u0633\u0628\u0642\u064b\u0627 \u0644\u0644\u062e\u0627\u062f\u0645 \u0639\u0644\u0649 \u0627\u0644\u0623\u0642\u0644 \u062a\u0645 \u0627\u062e\u062a\u064a\u0627\u0631\u0647\u0645\u0627 \u0645\u0646 \u0645\u062c\u0645\u0648\u0639\u0629 \u064a\u062f\u064a\u0631\u0647\u0627 \u0645\u062a\u0637\u0648\u0639\u0648\u0646 \u0645\u0646 \u062e\u0648\u0627\u062f\u0645 Clearnet HTTPS.";
    t[10050] = "Are you sure you want to delete {0}?";
    t[10051] = "\u0647\u0644 \u0627\u0646\u062a \u0645\u062a\u0623\u0643\u062f \u0623\u0646\u0643 \u062a\u0631\u063a\u0628 \u0641\u064a \u062d\u0630\u0641 {0}\u061f";
    t[10054] = "Review recent updates to I2P";
    t[10055] = "\u0645\u0631\u0627\u062c\u0639\u0629 \u0627\u0644\u062a\u062d\u062f\u064a\u062b\u0627\u062a \u0627\u0644\u0623\u062e\u064a\u0631\u0629 \u0644\u0640 I2P";
    t[10062] = "This setting determines the delay between peer test jobs, configured in milliseconds. [Default is 5000]";
    t[10063] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u062d\u062f\u062f \u0627\u0644\u062a\u0623\u062e\u064a\u0631 \u0628\u064a\u0646 \u0645\u0647\u0627\u0645 \u0627\u062e\u062a\u0628\u0627\u0631 \u0627\u0644\u0623\u0642\u0631\u0627\u0646\u060c \u0648\u0627\u0644\u0645\u0643\u0648\u0651\u0646 \u0628\u0627\u0644\u0645\u0644\u064a \u062b\u0648\u0627\u0646. [\u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a \u0647\u0648 5000]";
    t[10072] = "A guide to reseeding the router";
    t[10073] = "\u062f\u0644\u064a\u0644 \u0644\u0625\u0639\u0627\u062f\u0629 \u0632\u0631\u0639 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647";
    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "\u0642\u0627\u0626\u0645\u0629 \u0628\u0627\u0644\u062f\u0648\u0644 \u0645\u0623\u062e\u0648\u0630\u0629 \u0645\u0646 \u062a\u0642\u0631\u064a\u0631 <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>\u062d\u0631\u064a\u0627\u062a \u0627\u0644\u0639\u0627\u0644\u0645</a> \u062a\u062a\u0645\u064a\u0632 \u0628\u0633\u0645\u0639\u0629 \u0633\u064a\u0626\u0629 \u0644\u0644\u062d\u0631\u064a\u0627\u062a \u0627\u0644\u0645\u062f\u0646\u064a\u0629. \u062a\u0633\u062a\u062e\u062f\u0645 \u0647\u0630\u0647 \u0627\u0644\u0642\u0627\u0626\u0645\u0629 \u0644\u0648\u0636\u0639 \u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0639\u0645\u0644 \u0641\u064a \u0627\u0644\u062f\u0648\u0644 \u0627\u0644\u0645\u062d\u062f\u062f\u0629 \u0628\u0648\u0636\u0639 <i>\u0627\u0644\u0646\u0645\u0637 \u0627\u0644\u0645\u062e\u0641\u064a</i> \u0644\u062a\u0648\u0641\u064a\u0631 \u0623\u0645\u0646 \u0645\u0639\u0632\u0632 \u0644\u0644\u0645\u0633\u062a\u062e\u062f\u0645\u064a\u0646. \u062a\u0645 \u062a\u0635\u0646\u064a\u0641 \u0627\u0644\u062f\u0648\u0644 \u0627\u0644\u062a\u0627\u0644\u064a\u0629 \u0639\u0644\u0649 \u0623\u0646\u0647\u0627 \u0635\u0627\u0631\u0645\u0629: \u0623\u0641\u063a\u0627\u0646\u0633\u062a\u0627\u0646 \u0648\u0623\u0630\u0631\u0628\u064a\u062c\u0627\u0646 \u0648\u0627\u0644\u0628\u062d\u0631\u064a\u0646 \u0648\u0628\u064a\u0644\u0627\u0631\u0648\u0633 \u0648\u0628\u0631\u0648\u0646\u0627\u064a \u0648\u0628\u0648\u0631\u0648\u0646\u062f\u064a \u0648\u0627\u0644\u0643\u0627\u0645\u064a\u0631\u0648\u0646 \u0648\u062c\u0645\u0647\u0648\u0631\u064a\u0629 \u0623\u0641\u0631\u064a\u0642\u064a\u0627 \u0627\u0644\u0648\u0633\u0637\u0649 \u0648\u062a\u0634\u0627\u062f \u0648\u0627\u0644\u0635\u064a\u0646 \u0648\u0643\u0648\u0628\u0627 \u0648\u062c\u0645\u0647\u0648\u0631\u064a\u0629 \u0627\u0644\u0643\u0648\u0646\u063a\u0648 \u0627\u0644\u062f\u064a\u0645\u0642\u0631\u0627\u0637\u064a\u0629 \u0648\u0645\u0635\u0631 \u0648\u063a\u064a\u0646\u064a\u0627 \u0627\u0644\u0627\u0633\u062a\u0648\u0627\u0626\u064a\u0629 \u0648\u0625\u0631\u064a\u062a\u0631\u064a\u0627 \u0648\u0625\u062b\u064a\u0648\u0628\u064a\u0627 \u0648\u0625\u064a\u0631\u0627\u0646 \u0648\u0643\u0627\u0632\u0627\u062e\u0633\u062a\u0627\u0646 \u0648\u0644\u0627\u0648\u0633 \u0648\u0644\u064a\u0628\u064a\u0627 \u0648\u0645\u064a\u0627\u0646\u0645\u0627\u0631 \u0648\u0643\u0648\u0631\u064a\u0627 \u0627\u0644\u0634\u0645\u0627\u0644\u064a\u0629 \u0648\u0627\u0644\u0623\u0631\u0627\u0636\u064a \u0627\u0644\u0641\u0644\u0633\u0637\u064a\u0646\u064a\u0629 \u0648\u0631\u0648\u0627\u0646\u062f\u0627 \u0648\u0627\u0644\u0645\u0645\u0644\u0643\u0629 \u0627\u0644\u0639\u0631\u0628\u064a\u0629 \u0627\u0644\u0633\u0639\u0648\u062f\u064a\u0629 \u0648\u0627\u0644\u0635\u0648\u0645\u0627\u0644 \u0648\u062c\u0646\u0648\u0628 \u0627\u0644\u0633\u0648\u062f\u0627\u0646 \u0648\u0627\u0644\u0633\u0648\u062f\u0627\u0646 \u0648\u0625\u0633\u0648\u0627\u062a\u064a\u0646\u064a \u0648\u0633\u0648\u0631\u064a\u0627 \u0648\u0637\u0627\u062c\u064a\u0643\u0633\u062a\u0627\u0646 \u0648\u062a\u0627\u064a\u0644\u0627\u0646\u062f \u0648\u062a\u0631\u0643\u064a\u0627 \u0648\u062a\u0631\u0643\u0645\u0627\u0646\u0633\u062a\u0627\u0646 \u0648\u0641\u0646\u0632\u0648\u064a\u0644\u0627 \u0648\u0627\u0644\u0625\u0645\u0627\u0631\u0627\u062a \u0627\u0644\u0639\u0631\u0628\u064a\u0629 \u0627\u0644\u0645\u062a\u062d\u062f\u0629 \u0648\u0623\u0648\u0632\u0628\u0627\u0643\u0633\u062a\u0627\u0646 \u0648\u0627\u0644\u0635\u062d\u0631\u0627\u0621 \u0627\u0644\u063a\u0631\u0628\u064a\u0629 \u0648\u0627\u0644\u064a\u0645\u0646.";
