    t[10295] = "\u064a\u062a\u0645 \u062a\u0645\u0643\u064a\u0646 \u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u062d\u062f\u0648\u062f\u0629 \u0645\u0646 \u0627\u0644\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u060c \u0648\u0647\u064a \u0645\u0637\u0644\u0648\u0628\u0629 \u0644\u0645\u0631\u0627\u0642\u0628\u0629 \u0623\u062f\u0627\u0621 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647. \u064a\u062a\u0645 \u0647\u0646\u0627 \u0625\u062f\u0631\u0627\u062c \u0627\u0644\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0631\u0633\u0645 \u0628\u064a\u0627\u0646\u064a \u0627\u062e\u062a\u064a\u0627\u0631\u064a \u0641\u0642\u0637\u061b \u0644\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0642\u0627\u0626\u0645\u0629 \u0643\u0627\u0645\u0644\u0629 \u0628\u0627\u0644\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a \u0627\u0644\u0645\u0645\u0643\u0651\u0646\u0629\u060c \u0642\u0645 \u0628\u0639\u0631\u0636 <a href=\"/stats\">\u0635\u0641\u062d\u0629 \u0627\u0644\u0625\u062d\u0635\u0627\u0626\u064a\u0627\u062a</a>.";
