    t[10313] = new java.lang.String[] { "\u064a\u0631\u062c\u0649 \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u0644\u062a\u0632\u0627\u0645\u0627\u062a \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0644\u062a\u0646\u062a\u0647\u064a \u0635\u0644\u0627\u062d\u064a\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 {0}", "\u064a\u0631\u062c\u0649 \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u0644\u062a\u0632\u0627\u0645\u0627\u062a \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0644\u062a\u0646\u062a\u0647\u064a \u0635\u0644\u0627\u062d\u064a\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 {0}", "\u064a\u0631\u062c\u0649 \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u0644\u062a\u0632\u0627\u0645\u0627\u062a \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0644\u062a\u0646\u062a\u0647\u064a \u0635\u0644\u0627\u062d\u064a\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 {0}", "\u064a\u0631\u062c\u0649 \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u0644\u062a\u0632\u0627\u0645\u0627\u062a \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0644\u062a\u0646\u062a\u0647\u064a \u0635\u0644\u0627\u062d\u064a\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 {0}", "\u064a\u0631\u062c\u0649 \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u0644\u062a\u0632\u0627\u0645\u0627\u062a \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0644\u062a\u0646\u062a\u0647\u064a \u0635\u0644\u0627\u062d\u064a\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 {0}", "\u064a\u0631\u062c\u0649 \u0627\u0646\u062a\u0638\u0627\u0631 \u0627\u0644\u062a\u0632\u0627\u0645\u0627\u062a \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0644\u062a\u0646\u062a\u0647\u064a \u0635\u0644\u0627\u062d\u064a\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 {0}" };
    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "\u062d\u064a\u062b\u0645\u0627 \u0623\u0645\u0643\u0646\u060c \u064a\u0631\u062c\u0649 \u0627\u0644\u062a\u0623\u0643\u062f \u0645\u0646 \u0627\u0644\u0633\u0645\u0627\u062d \u0644\u0640 I2P+ / Java \u0628\u0627\u0644\u0648\u0635\u0648\u0644 \u0627\u0644\u0645\u062a\u0628\u0627\u062f\u0644 \u0644\u0644\u0645\u0646\u0627\u0641\u0630 \u0645\u0646 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a \u0639\u0646 \u0637\u0631\u064a\u0642 \u062a\u0643\u0648\u064a\u0646 \u0645\u0648\u062f\u0645\u0643/\u0645\u0648\u062c\u0647\u0643/\u062f\u0631\u0639 \u0646\u0627\u0631\u0643 \u0628\u0634\u0643\u0644 \u0645\u0646\u0627\u0633\u0628. \u0625\u0630\u0627 \u0643\u0646\u062a \u0648\u0631\u0627\u0621 \u062f\u0631\u0639 \u0646\u0627\u0631\u064a \u0645\u0642\u064a\u062f \u0648\u0644\u0643\u0646 \u0644\u062f\u064a\u0643 \u0648\u0635\u0648\u0644 \u062e\u0627\u0631\u062c\u064a \u063a\u064a\u0631 \u0645\u0642\u064a\u062f\u060c \u064a\u0645\u0643\u0646 \u0644\u0640 I2P+ \u0627\u0644\u0627\u0633\u062a\u0645\u0631\u0627\u0631 \u0641\u064a \u0627\u0644\u0639\u0645\u0644\u061b \u064a\u0645\u0643\u0646\u0643 \u0625\u064a\u0642\u0627\u0641 \u0627\u0644\u0648\u0635\u0648\u0644 \u0627\u0644\u062f\u0627\u062e\u0644\u064a \u0648\u0627\u0644\u0627\u0639\u062a\u0645\u0627\u062f \u0639\u0644\u0649 <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>\u0643\u0634\u0641 \u0639\u0646\u0648\u0627\u0646 IP \u0645\u0646 SSU </a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>\u062b\u0642\u0628 \u0627\u0644\u0646\u0627\u0631\u064a </a>) \u0644\u0631\u0628\u0637\u0643 \u0628\u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0648\u0633\u064a\u0634\u064a\u0631 \u062d\u0627\u0644\u0629 \u0627\u0644\u0634\u0628\u0643\u0629 \u0641\u064a \u0627\u0644\u0644\u0648\u062d\u0629 \u0627\u0644\u062c\u0627\u0646\u0628\u064a\u0629 \u0625\u0644\u0649 \"\u0627\u0644\u062d\u0627\u0644\u0629: \u0645\u062d\u0645\u064a \u0628\u062f\u0631\u0639 \u0646\u0627\u0631\u064a\". \u0644\u0623\u0642\u0635\u0649 \u0623\u062f\u0627\u0621\u060c \u064a\u0631\u062c\u0649 \u0627\u0644\u062a\u0623\u0643\u062f \u0645\u0646 \u0623\u0646 \u0627\u0644\u0645\u0646\u0641\u0630 \u0627\u0644\u062e\u0627\u0631\u062c\u064a \u0644\u0640 I2P <a href=/confignet#udpconfig> \u0645\u0631\u0626\u064a \u0645\u0646 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a</a> (\u0627\u0646\u0638\u0631 \u0623\u062f\u0646\u0627\u0647 \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a).";
