    t[10710] = "The process of acquiring router identities, normally via <i>clearnet</i> servers, to ensure your router can communicate and build tunnels with other routers on the network. When a router has no router identities for other peers (usually immediately after installation), the process of reseeding is also referred to as <i>bootstrapping</i>.";
    t[10711] = "\u0639\u0645\u0644\u064a\u0629 \u0627\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0647\u0648\u064a\u0627\u062a \u0645\u0648\u062c\u0647\u0627\u062a\u060c \u0639\u0627\u062f\u0629 \u0639\u0628\u0631 \u062e\u0648\u0627\u062f\u0645 <i>\u0627\u0644\u0634\u0628\u0643\u0629 \u0627\u0644\u0639\u0627\u062f\u064a\u0629</i>\u060c \u0644\u0644\u062a\u0623\u0643\u062f \u0645\u0646 \u0642\u062f\u0631\u0629 \u0645\u0648\u062c\u0647\u0643 \u0639\u0644\u0649 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0648\u0628\u0646\u0627\u0621 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0645\u0639 \u0645\u0648\u062c\u0647\u0627\u062a \u0623\u062e\u0631\u0649 \u0639\u0644\u0649 \u0627\u0644\u0634\u0628\u0643\u0629. \u0639\u0646\u062f\u0645\u0627 \u0644\u0627 \u064a\u0645\u062a\u0644\u0643 \u0627\u0644\u0645\u0648\u062c\u0647 \u0647\u0648\u064a\u0627\u062a \u0644\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 (\u0639\u0627\u062f\u0629 \u0641\u0648\u0631 \u0627\u0644\u062a\u062b\u0628\u064a\u062a)\u060c \u064a\u0634\u0627\u0631 \u0625\u0644\u0649 \u0639\u0645\u0644\u064a\u0629 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0628\u0630\u064a\u0631 \u0623\u064a\u0636\u064b\u0627 \u0628\u0627\u0633\u0645 <i>\u0627\u0644\u062a\u0645\u0647\u064a\u062f</i>.";
