    t[10747] = "\u0646\u0641\u0642 \u064a\u0633\u062a\u062e\u062f\u0645\u0647 \u0627\u0644\u0645\u0648\u062c\u0647 \u0644\u0644\u062a\u0648\u0627\u0635\u0644 \u0645\u0639 \u0645\u0648\u062c\u0647\u0627\u062a \u0623\u062e\u0631\u0649 \u0644\u0623\u062f\u0627\u0621 \u0645\u062e\u062a\u0644\u0641 \u0648\u0638\u0627\u0626\u0641 \"\u0627\u0644\u0635\u064a\u0627\u0646\u0629\" \u0645\u062b\u0644 \u062a\u0639\u0644\u0645 \u0648\u0646\u0634\u0631 <i>leasesets</i>\u060c \u0627\u062e\u062a\u0628\u0627\u0631 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0639\u0645\u064a\u0644\u064a\u0629\u060c \u0648\u062a\u0639\u0644\u0645 \u0648\u0627\u0644\u062a\u062d\u0642\u0642 \u0645\u0646 \u0645\u0648\u062c\u0647\u0627\u062a \u0623\u062e\u0631\u0649 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629. \u062a\u0643\u0648\u0646 \u0647\u0630\u0647 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0639\u0627\u062f\u0629 \u0630\u0627\u062a \u0639\u0631\u0636 \u0628\u0627\u0646\u062f\u0648\u064a\u062b \u0645\u0646\u062e\u0641\u0636.";
    t[10752] = "Debug";
    t[10753] = "\u0627\u0644\u062a\u0635\u062d\u064a\u062d";
