    t[10791] = "\u062a\u062e\u0635\u064a\u0635 \u0627\u0644\u0635\u0641\u062d\u0629 \u0627\u0644\u0631\u0626\u064a\u0633\u064a\u0629";
    t[10798] = "UPnP is used to communicate with Internet Gateway Devices (IGDs) to detect the external IP address and forward ports.";
