    t[10810] = "(use 'd' = date, 'c' = class, 't' = thread, 'p' = priority, 'm' = message)";
    t[10811] = "(\u0627\u0633\u062a\u062e\u062f\u0645 'd' = \u0627\u0644\u062a\u0627\u0631\u064a\u062e\u060c 'c' = \u0627\u0644\u0641\u0626\u0629\u060c 't' = \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u060c 'p' = \u0627\u0644\u0623\u0648\u0644\u0648\u064a\u0629\u060c 'm' = \u0627\u0644\u0631\u0633\u0627\u0644\u0629)";
