    t[10818] = "As the firewall detection methods are not 100% reliable, this may occasionally be displayed in error.";
    t[10819] = "\u0646\u0638\u0631\u064b\u0627 \u0644\u0623\u0646 \u0637\u0631\u0642 \u0627\u0644\u0643\u0634\u0641 \u0639\u0646 \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0644\u064a\u0633\u062a \u0645\u0648\u062b\u0648\u0642\u0629 \u0628\u0646\u0633\u0628\u0629 100%\u060c \u0641\u0642\u062f \u064a\u062a\u0645 \u0639\u0631\u0636 \u0630\u0644\u0643 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u062e\u0637\u0623 \u0623\u062d\u064a\u0627\u0646\u064b\u0627.";
