    t[11003] = "\u0627\u0644\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0645\u062a\u0642\u062f\u0645";
    t[11006] = "Set password required to access this service";
    t[11007] = "\u062a\u0639\u064a\u064a\u0646 \u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u0645\u0637\u0644\u0648\u0628\u0629 \u0644\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0647\u0630\u0647 \u0627\u0644\u062e\u062f\u0645\u0629";
    t[11008] = "Numeric definition of the number of connection attempts in the period specified (in seconds) e.g. <i class=example>15/5</i>, <i class=example>60/60</i> etc.";
    t[11009] = "\u062a\u0639\u0631\u064a\u0641 \u0631\u0642\u0645\u064a \u0644\u0639\u062f\u062f \u0645\u062d\u0627\u0648\u0644\u0627\u062a \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0641\u064a \u0627\u0644\u0641\u062a\u0631\u0629 \u0627\u0644\u0645\u062d\u062f\u062f\u0629 (\u0628\u0627\u0644\u062b\u0648\u0627\u0646\u064a) \u0645\u062b\u0644\u0627. ";
    t[11018] = "32bit host OS running with less than 4 detected cores";
