    t[11079] = "\u0627\u0644\u0645\u0646\u0632\u0644";
    t[11092] = "Retransmitted packets";
    t[11093] = "\u0627\u0644\u062d\u0632\u0645 \u0627\u0644\u0645\u0639\u0627\u062f \u0625\u0631\u0633\u0627\u0644\u0647\u0627";
    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f (\u0628\u0627\u0644\u0633\u0627\u0639\u0627\u062a) \u064a\u062a\u064a\u062d \u0644\u0643 \u062a\u0643\u0648\u064a\u0641 \u0639\u0645\u0631 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u064a\u062f\u0648\u064a\u0627\u064b \u062d\u062a\u0649 \u064a\u062a\u0645 \u0641\u062d\u0635\u0647\u0627 \u0645\u0646 \u0642\u0628\u0644 \u0645\u0647\u0645\u0629 \u062a\u062d\u062f\u064a\u062b \u0627\u0644\u0631\u0648\u0627\u062a\u0631. \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0627\u064b\u060c \u064a\u062a\u0646\u0627\u0633\u0628 \u0639\u0645\u0631 \u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0642\u0628\u0644 \u0628\u062f\u0621 \u0627\u0644\u062a\u062d\u062f\u064a\u062b \u0645\u0639 \u062d\u062c\u0645 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u064a\u0629\u060c \u062d\u064a\u062b \u064a\u0632\u064a\u062f \u0643\u0644\u0645\u0627 \u0643\u0628\u0631 \u062d\u062c\u0645 \u0627\u0644\u0642\u0627\u0639\u062f\u0629. \u0627\u0644\u0642\u064a\u0645\u0629 0 \u0633\u062a\u062c\u0628\u0631 \u0645\u0647\u0645\u0629 \u062a\u062d\u062f\u064a\u062b \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0639\u0644\u0649 \u0641\u062d\u0635 \u0643\u0644 \u0631\u0627\u0648\u062a\u0631 \u0641\u064a \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0628\u0635\u0631\u0641 \u0627\u0644\u0646\u0638\u0631 \u0639\u0646 \u0639\u0645\u0631\u0647.";
    t[11112] = "Show all members of the {0} family in NetDb";
    t[11113] = "\u0625\u0638\u0647\u0627\u0631 \u062c\u0645\u064a\u0639 \u0623\u0641\u0631\u0627\u062f \u0639\u0627\u0626\u0644\u0629 {0} \u0641\u064a NetDb";
    t[11120] = "Failed to install plugin in {0}";
    t[11121] = "\u0641\u0634\u0644 \u0641\u064a \u062a\u062b\u0628\u064a\u062a \u0627\u0644\u0645\u0644\u062d\u0642 {0}";
    t[11124] = "Install from file failed";
    t[11125] = "\u0641\u0634\u0644 \u0627\u0644\u062a\u062b\u0628\u064a\u062a \u0645\u0646 \u0627\u0644\u0645\u0644\u0641";
    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "\u062a\u0637\u0628\u064a\u0642 \u0648\u064a\u0628 I2P \u064a\u062f\u064a\u0631 \u0648\u062c\u0647\u0627\u062a \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0644\u0644\u0634\u0628\u0643\u0629\u060c \u0645\u0646 \u062e\u0644\u0627\u0644 \u0631\u0628\u0637 \u0647\u0627\u0634\u0627\u062a B64 \u0628\u0623\u0633\u0645\u0627\u0621 \u0642\u0627\u0628\u0644\u0629 \u0644\u0644\u0642\u0631\u0627\u0621\u0629 \u0628\u0634\u0631\u064a\u064b\u0627. \u064a\u0645\u0643\u0646 \u0625\u0636\u0627\u0641\u0629 \u0627\u0644\u0648\u062c\u0647\u0627\u062a \u064a\u062f\u0648\u064a\u064b\u0627 \u0623\u0648 \u0639\u0628\u0631 \u0627\u0644\u0627\u0634\u062a\u0631\u0627\u0643\u0627\u062a \u0641\u064a \u0645\u0644\u0641\u0627\u062a hosts.txt. \u064a\u064f\u0634\u0627\u0631 \u0625\u0644\u064a\u0647 \u0623\u064a\u0636\u064b\u0627 \u0628\u0627\u0633\u0645 SusiDNS. \u0644\u0645\u0632\u064a\u062f \u0645\u0646 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a\u060c \u0627\u0644\u0631\u062c\u0627\u0621 \u0632\u064a\u0627\u0631\u0629 \u0627\u0644\u0648\u062b\u0627\u0626\u0642 <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>\u0639\u0644\u0649 \u0627\u0644\u0625\u0646\u062a\u0631\u0646\u062a</a>.";
    t[11130] = "Events per period";
    t[11131] = "\u0639\u062f\u062f \u0627\u0644\u0623\u062d\u062f\u0627\u062b \u0641\u064a \u0627\u0644\u0645\u062f\u0629";
