    t[11135] = "\u0643\u0645 \u0645\u0646 \u0627\u0644\u0648\u0642\u062a \u0642\u0628\u0644 \u0623\u0646 \u064a\u062a\u062e\u0644\u0649 \u0627\u0644\u0646\u0638\u064a\u0631 \u0639\u0646 \u0625\u0639\u0627\u062f\u0629 \u0625\u0631\u0633\u0627\u0644 \u0627\u0644\u062d\u0632\u0645\u0629 \u0627\u0644\u0645\u0641\u0642\u0648\u062f\u0629";
