    t[11142] = "Banning will prevent the participation of this peer in tunnels you create.";
    t[11143] = "\u0633\u064a\u0624\u062f\u064a \u0627\u0644\u062d\u0638\u0631 \u0625\u0644\u0649 \u0645\u0646\u0639 \u0645\u0634\u0627\u0631\u0643\u0629 \u0647\u0630\u0627 \u0627\u0644\u0646\u0638\u064a\u0631 \u0641\u064a \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u062a\u064a \u062a\u0642\u0648\u0645 \u0628\u0625\u0646\u0634\u0627\u0626\u0647\u0627.";
    t[11148] = "UDP Port In Use";
