    t[11186] = "Open the Preferences page in Firefox and scroll to the bottom of the General section.";
    t[11187] = "\u0627\u0641\u062a\u062d \u0635\u0641\u062d\u0629 \u0627\u0644\u062a\u0641\u0636\u064a\u0644\u0627\u062a \u0641\u064a \u0641\u0627\u064a\u0631\u0641\u0648\u0643\u0633 \u0648\u062a\u062d\u0631\u0643 \u0625\u0644\u0649 \u0623\u0633\u0641\u0644 \u0627\u0644\u0642\u0633\u0645 \u0627\u0644\u0639\u0627\u0645.";
    t[11190] = "Web technology reference and learning site";
