    t[11200] = "Please configure a TCP host and port on the Network Configuration page or enable UDP.";
    t[11201] = "\u0627\u0644\u0631\u062c\u0627\u0621 \u062a\u0643\u0648\u064a\u0646 \u0645\u0636\u064a\u0641 \u062a\u064a \u0633\u064a \u0628\u064a \u0648\u0645\u0646\u0641\u0630 \u0639\u0644\u0649 \u0635\u0641\u062d\u0629 \u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0634\u0628\u0643\u0629 \u0623\u0648 \u062a\u0645\u0643\u064a\u0646 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u064a\u0648 \u062f\u064a \u0628\u064a.";
    t[11212] = "Outbound Endpoint";
    t[11213] = "\u0646\u0642\u0637\u0629 \u0627\u0644\u062e\u0631\u0648\u062c";
    t[11216] = "Download and verify only";
    t[11217] = "\u062d\u0645\u0644 \u0641\u0642\u0637";
    t[11218] = "Manual Reseed";
    t[11219] = "\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631 \u0627\u0644\u064a\u062f\u0648\u064a";
    t[11226] = "peers";
    t[11227] = "\u0623\u0642\u0631\u0627\u0646\u0647\u0645";
    t[11230] = "Can be enabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If both http and https are enabled, automatic redirection to https is enabled by default. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[11231] = "\u064a\u0645\u0643\u0646 \u062a\u0645\u0643\u064a\u0646\u0647 \u0641\u064a \u0645\u0644\u0641 <code>clients.config</code>. \u0643\u0645\u0627 \u064a\u0645\u0643\u0646 \u062a\u0643\u0648\u064a\u0646\u0647 \u0644\u0644\u0627\u0631\u062a\u0628\u0627\u0637 \u0628\u0648\u0627\u062c\u0647\u0629 \u0645\u062d\u062f\u062f\u0629 \u0623\u0648 \u0643\u0644 \u0627\u0644\u0648\u0627\u062c\u0647\u0627\u062a. \u0625\u0630\u0627 \u062a\u0645 \u062a\u0645\u0643\u064a\u0646 \u0643\u0644 \u0645\u0646 http \u0648 https\u060c \u0641\u0633\u064a\u062a\u0645 \u062a\u0645\u0643\u064a\u0646 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u062a\u0644\u0642\u0627\u0626\u064a\u0629 \u0625\u0644\u0649 https \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627. \u0625\u0630\u0627 \u0642\u0645\u062a \u0628\u062c\u0639\u0644 \u0648\u0627\u062c\u0647\u0629 \u0627\u0644\u0645\u0648\u062c\u0647 \u0645\u062a\u0627\u062d\u0629 \u0639\u0628\u0631 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0642\u062f \u062a\u0631\u063a\u0628 \u0641\u064a <a href=/configui#passwordheading>\u0641\u0631\u0636 \u0643\u0644\u0645\u0629 \u0645\u0631\u0648\u0631 \u0644\u0644\u0648\u0635\u0648\u0644</a> \u0644\u0645\u0646\u0639 \u0627\u0644\u0648\u0635\u0648\u0644 \u063a\u064a\u0631 \u0627\u0644\u0645\u0635\u0631\u062d \u0628\u0647.";
    t[11236] = "Tunnel identity";
    t[11237] = "\u0647\u0648\u064a\u0629 \u0627\u0644\u0646\u0641\u0642";
    t[11242] = "Most of the options on the Network Configuration page are for special situations, for example where UPnP does not work correctly, or a firewall not under your control is doing harm.";
    t[11243] = "\u063a\u0627\u0644\u0628\u064a\u0629 \u062e\u064a\u0627\u0631\u0627\u062a \u0635\u0641\u062d\u0629 \u062a\u0643\u0648\u064a\u0641 \u0627\u0644\u0634\u0628\u0643\u0629 \u0645\u062e\u0635\u0635\u0629 \u0644\u062d\u0627\u0644\u0627\u062a \u062e\u0627\u0635\u0629 \u0645\u062b\u0644 \u0639\u062f\u0645 \u0639\u0645\u0644 UPnP \u0628\u0634\u0643\u0644 \u0635\u062d\u064a\u062d \u0623\u0648 \u062c\u062f\u0627\u0631 \u0646\u0627\u0631\u064a \u063a\u064a\u0631 \u062e\u0627\u0636\u0639 \u0644\u0633\u064a\u0637\u0631\u062a\u0643 \u064a\u0633\u0628\u0628 \u0623\u0636\u0631\u0627\u0631\u0627.";
