    t[11384] = "Click the <i>Start</i> button for your webserver tunnel on the <a href=/i2ptunnelmgr/>main Tunnel Manager page</a>. You should now see it listed under <i>Service Tunnels</i> on the <a href=/>Router Console</a> sidebar. A green star displayed next to the tunnel name (<i>I2P Webserver</i> by default) indicates that your website is active on the I2P network.";
    t[11385] = "\u0627\u0646\u0642\u0631 \u0639\u0644\u0649 \u0632\u0631 <i>\u0628\u062f\u0621</i> \u0644\u0627\u0646\u0641\u0627\u0642 \u062e\u0627\u062f\u0648\u0645\u0643 \u0627\u0644\u0648\u064a\u0628 \u0639\u0644\u0649 <a href=/i2ptunnelmgr/>\u0635\u0641\u062d\u0629 \u0625\u062f\u0627\u0631\u0629 \u0627\u0644\u0627\u0646\u0641\u0627\u0642 \u0627\u0644\u0631\u0626\u064a\u0633\u064a\u0629</a>. \u064a\u062c\u0628 \u0623\u0646 \u062a\u0631\u0627\u0647 \u0627\u0644\u0622\u0646 \u0645\u062f\u0631\u062c\u064b\u0627 \u062a\u062d\u062a <i>\u0627\u0646\u0641\u0627\u0642 \u0627\u0644\u062e\u062f\u0645\u0627\u062a</i> \u0639\u0644\u0649 \u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a \u0644\u0640 <a href=/>\u0644\u0648\u062d\u0629 \u0627\u0644\u062a\u062d\u0643\u0645 \u0641\u064a \u0627\u0644\u0645\u0648\u062c\u0647</a>. \u064a\u0634\u064a\u0631 \u0627\u0644\u0646\u062c\u0645\u0629 \u0627\u0644\u062e\u0636\u0631\u0627\u0621 \u0627\u0644\u0645\u0639\u0631\u0648\u0636\u0629 \u0628\u062c\u0627\u0646\u0628 \u0627\u0633\u0645 \u0627\u0644\u0627\u0646\u0641\u0627\u0642 (<i>\u062e\u0627\u062f\u0648\u0645 I2P</i> \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a) \u0625\u0644\u0649 \u0623\u0646 \u0645\u0648\u0642\u0639\u0643 \u0646\u0634\u0637 \u0639\u0644\u0649 \u0634\u0628\u0643\u0629 I2P.";
