    t[11982] = "If your TCP port is firewalled with inbound TCP enabled, routers will not be able to contact you via TCP, which will hurt the network.";
    t[11983] = "\u0625\u0630\u0627 \u062a\u0645 \u062d\u062c\u0628 \u0645\u0646\u0641\u0630 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644 \u062a\u064a \u0633\u064a \u0628\u064a \u0628\u064a\u0646\u0645\u0627 \u062a\u064a \u0633\u064a \u0628\u064a \u0627\u0644\u0648\u0627\u0631\u062f \u0645\u0641\u0639\u064e\u0651\u0644\u060c \u0644\u0646 \u064a\u062a\u0645\u0643\u0646 \u0627\u0644\u0645\u0648\u062c\u0647\u0627\u062a \u0645\u0646 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0643 \u0639\u0628\u0631 \u062a\u064a \u0633\u064a \u0628\u064a\u060c \u0645\u0645\u0627 \u0633\u064a\u0644\u062d\u0642 \u0627\u0644\u0636\u0631\u0631 \u0628\u0627\u0644\u0634\u0628\u0643\u0629.";
