    t[11985] = "\u0627\u0644\u0647\u0648\u064a\u0629 \u0627\u0644\u0645\u062d\u0644\u064a\u0629";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "\u0639\u0644\u0649 \u0627\u0644\u0631\u063a\u0645 \u0645\u0646 \u0623\u0646 I2P \u0633\u064a\u0639\u0645\u0644 \u0628\u0634\u0643\u0644 \u062c\u064a\u062f \u0648\u0631\u0627\u0621 \u0645\u0639\u0638\u0645 \u0623\u0646\u0638\u0645\u0629 \u0627\u0644\u062d\u0645\u0627\u064a\u0629 \u0627\u0644\u0646\u0627\u0631\u064a\u0629 \u0625\u0644\u0627 \u0623\u0646 \u0633\u0631\u0639\u062a\u0643 \u0648\u062f\u0645\u062c\u0643 \u0641\u064a \u0627\u0644\u0634\u0628\u0643\u0629 \u0639\u0645\u0648\u0645\u0627 \u0633\u062a\u062a\u062d\u0633\u0646 \u0625\u0630\u0627 \u062a\u0645 \u062a\u0648\u062c\u064a\u0647 \u0645\u0646\u0641\u0630 I2P \u0644\u0643\u0644 \u0645\u0646 \u0628\u0631\u0648\u062a\u0648\u0643\u0648\u0644\u064a UDP \u0648 TCP.";
