    t[12019] = "\u0641\u0631\u0636 \u062d\u0638\u0631 \u062f\u0627\u0626\u0645";
    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "\u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0623\u0637\u0648\u0644 \u0645\u0646 3 \u0642\u0641\u0632\u0627\u062a (\u0639\u0644\u0649 \u0633\u0628\u064a\u0644 \u0627\u0644\u0645\u062b\u0627\u0644 2 \u0642\u0641\u0632\u0627\u062a 0-2 \u0642\u0641\u0632\u0627\u062a\u060c 3 \u0642\u0641\u0632\u0627\u062a 0-1 \u0642\u0641\u0632\u0627\u062a\u060c 3 \u0642\u0641\u0632\u0627\u062a 0-2 \u0642\u0641\u0632\u0627\u062a)\u060c \u0623\u0648 \u0643\u0645\u064a\u0629 \u0627\u062d\u062a\u064a\u0627\u0637\u064a\u0629 \u0639\u0627\u0644\u064a\u0629 \u0627\u0644\u0643\u0645\u064a\u0629\u060c \u0642\u062f \u062a\u0642\u0644\u0644 \u0628\u0634\u0643\u0644 \u0643\u0628\u064a\u0631 \u0645\u0646 \u0627\u0644\u0623\u062f\u0627\u0621 \u0623\u0648 \u0627\u0644\u0645\u0648\u062b\u0648\u0642\u064a\u0629.";
    t[12022] = "Sidebar";
    t[12023] = "\u0627\u0644\u0634\u0631\u064a\u0637 \u0627\u0644\u062c\u0627\u0646\u0628\u064a";
