    t[12025] = "\u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 \u064a\u0633\u0647\u0644 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0628\u0634\u0628\u0643\u0629 \u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 \u0622\u062e\u0631 \u0645\u0648\u062c\u0648\u062f \u062e\u0644\u0641 \u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629.";
    t[12026] = "I2P FAQ";
    t[12027] = "\u0627\u0644\u0623\u0633\u0626\u0644\u0629 \u0627\u0644\u0634\u0627\u0626\u0639\u0629 \u062d\u0648\u0644 I2P";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "\u0625\u0630\u0627 \u0645\u0631\u0631\u062a \u0628\u0627\u0644\u0625\u0634\u0627\u0631\u0629 \u0641\u0648\u0642 \u0639\u0646\u0648\u0627\u0646 <i>\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0645\u0648\u062c\u0647</i>\u060c \u0633\u064a\u062a\u0645 \u0639\u0631\u0636 \u0647\u0648\u064a\u0629 \u0627\u0644\u0645\u0648\u062c\u0647 \u0627\u0644\u0645\u062e\u062a\u0635\u0631\u0629 \u0644\u062f\u064a\u0643 (\u0627\u0644\u0623\u0631\u0628\u0639\u0629 \u0627\u0644\u0623\u062d\u0631\u0641 \u0627\u0644\u0623\u0648\u0644\u0649 (24 \u0628\u062a) \u0645\u0646 \u0647\u0627\u0634 \u0627\u0644\u0645\u0648\u062c\u0647 \u0627\u0644\u0642\u0627\u0639\u062f\u064a 44 \u062d\u0631\u0641\u064b\u0627 (256 \u0628\u062a)). \u064a\u062a\u0645 \u0639\u0631\u0636 \u0627\u0644\u0647\u0627\u0634 \u0627\u0644\u0643\u0627\u0645\u0644 \u0641\u064a <a href='netdb?r=.'>\u0633\u062c\u0644 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0634\u0628\u0643\u0629</a> \u0627\u0644\u062e\u0627\u0635 \u0628\u0643. \u0644\u0627 \u062a\u0643\u0634\u0641 \u0623\u0628\u062f\u064b\u0627 \u0639\u0646 \u0647\u0630\u0627 \u0644\u0623\u064a \u0634\u062e\u0635\u060c \u0644\u0623\u0646 \u0647\u0648\u064a\u0629 \u0627\u0644\u0645\u0648\u062c\u0647 \u0644\u062f\u064a\u0643 \u0645\u0631\u062a\u0628\u0637\u0629 \u0628\u0634\u0643\u0644 \u0641\u0631\u064a\u062f \u0628\u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0641\u064a \u0642\u0627\u0639\u062f\u0629 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u0629.";
