    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "\u0642\u0648\u0627\u0626\u0645 \u0627\u0644\u062f\u0644\u0627\u0626\u0644 \u0645\u0641\u0639\u0644\u0629 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u064b\u0627 (\u0648\u0627\u0644\u062a\u064a \u062a\u064f\u0634\u0627\u0631 \u0625\u0644\u064a\u0647\u0627 \u0623\u062d\u064a\u0627\u0646\u064b\u0627 \u0628\u0627\u0633\u0645 \u0627\u0644\u062f\u0644\u0627\u0626\u0644 \u0627\u0644\u0627\u0641\u062a\u0631\u0627\u0636\u064a\u0629)\u060c \u0628\u062d\u064a\u062b \u064a\u0645\u0643\u0646\u0643 \u0627\u0633\u062a\u0636\u0627\u0641\u0629 \u0627\u0644\u0645\u0644\u0641\u0627\u062a \u0645\u0646 \u062f\u0644\u064a\u0644 \u0641\u0631\u0639\u064a \u0644\u0640 <code>docroot</code> \u062f\u0648\u0646 \u062a\u0642\u062f\u064a\u0645 \u0635\u0641\u062d\u0629 \u062a\u062d\u062a\u0648\u064a \u0639\u0644\u0649 \u0631\u0648\u0627\u0628\u0637 \u0644\u0644\u0645\u0644\u0641\u0627\u062a. \u0643\u0645\u0627 \u064a\u0645\u0643\u0646\u0643 \u0623\u064a\u0636\u064b\u0627 \u062a\u0642\u062f\u064a\u0645 \u0627\u0644\u0645\u062d\u062a\u0648\u0649 \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u062e\u0627\u0631\u062c <code>docroot</code> \u0639\u0628\u0631 \u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0631\u0627\u0628\u0637 \u0631\u0645\u0632\u064a <a href=https://en.wikpedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>\u0631\u0645\u0632\u064a</a> \u0644\u0644\u062f\u0644\u064a\u0644 \u0627\u0644\u0645\u0637\u0644\u0648\u0628.";
