    t[12185] = "\u0647\u0630\u0627 \u0627\u0644\u0625\u0639\u062f\u0627\u062f \u064a\u062d\u062f\u062f \u0639\u062f\u062f \u0633\u0644\u0627\u0644 \u0645\u0642\u0627\u0631\u0646\u0629 \u0642\u0627\u0639\u062f\u0629 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0634\u0628\u0643\u064a\u0629 \u0627\u0644\u062a\u064a \u0633\u062a\u0633\u062a\u0634\u0647\u062f \u0628\u0647\u0627 \u0645\u0647\u0645\u0629 \u0627\u0633\u062a\u0643\u0634\u0627\u0641 \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0639\u0646\u062f \u062a\u0634\u063a\u064a\u0644\u0647\u0627. \u0628\u0634\u0643\u0644 \u0627\u0641\u062a\u0631\u0627\u0636\u064a\u060c \u0633\u064a\u062e\u062a\u0644\u0641 \u0639\u062f\u062f \u0627\u0644\u0633\u0644\u0627\u0644 \u0627\u0644\u0645\u0633\u062a\u0643\u0634\u0641\u0629 \u062d\u0633\u0628 \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0642\u062f \u062a\u0645 \u062a\u0634\u063a\u064a\u0644\u0647 \u0644\u0623\u0643\u062b\u0631 \u0645\u0646 \u0633\u0627\u0639\u0629 \u0648\u0627\u062d\u062f\u0629\u060c \u0648\u062d\u0633\u0628 \u0645\u0627 \u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0631\u0627\u0648\u062a\u0631 \u0645\u062e\u0641\u064a \u0623\u0648 \u064a\u0646\u062a\u0645\u064a \u0644\u0641\u0626\u0629 'K' \u0645\u0646 \u062d\u064a\u062b \u0639\u0631\u0636 \u0627\u0644\u0646\u0637\u0627\u0642\u060c \u0648\u062d\u0633\u0628 \u0639\u062f\u062f \u0627\u0644\u0631\u0648\u0627\u062a\u0631 \u0627\u0644\u0645\u0639\u0631\u0648\u0641\u0629.";
