    t[12199] = "\u062a\u0633\u062c\u064a\u0644 \u0627\u0633\u0645 \u0627\u0644\u0645\u0636\u064a\u0641";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "\u0625\u0630\u0627 \u0627\u0646\u062e\u0641\u0636 \u0639\u062f\u062f \u0627\u0644\u0623\u0642\u0631\u0627\u0646 \u0627\u0644\u0645\u0639\u0631\u0648\u0641\u0629 \u0625\u0644\u0649 \u0623\u0642\u0644 \u0645\u0646 50\u060c \u0641\u0633\u0648\u0641 \u062a\u0642\u0648\u0645 I2P \u0628\u0645\u062d\u0627\u0648\u0644\u0629 \u0627\u0644\u062a\u0639\u0630\u064a\u0628 \u062a\u0644\u0642\u0627\u0626\u064a\u064b\u0627. \u0625\u0630\u0627 \u0641\u0634\u0644\u062a \u0645\u062d\u0627\u0648\u0644\u0629 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631\u060c \u0633\u062a\u0638\u0647\u0631 \u0625\u0634\u0639\u0627\u0631 \u0641\u064a \u0627\u0644\u0644\u0648\u062d\u0629 \u0627\u0644\u062c\u0627\u0646\u0628\u064a\u0629 \u0645\u0639 \u062e\u064a\u0627\u0631 \u0644\u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631 \u064a\u062f\u0648\u064a\u064b\u0627. \u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u062d\u062f\u062b \u0641\u0634\u0644 \u0645\u062d\u0627\u0648\u0644\u0629 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631 \u0625\u0630\u0627 \u062d\u062f\u062a \u062f\u0631\u0639\u0643 \u0627\u0644\u0645\u062d\u0644\u064a\u0629 \u062d\u0631\u0643\u0629 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u0635\u0627\u062f\u0631\u0629 \u0623\u0648 \u0643\u0646\u062a \u062a\u0648\u0627\u062c\u0647 \u0645\u0634\u0643\u0644\u0627\u062a \u0627\u062a\u0635\u0627\u0644 \u0628\u0627\u0644\u0634\u0628\u0643\u0629 \u0623\u0648 \u0625\u0630\u0627 \u062a\u0645 \u0645\u0646\u0639 \u0637\u0644\u0628 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0631 \u0628\u0627\u0644\u0643\u0627\u0645\u0644.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "\u0648\u0627\u062c\u0647\u0629 \u0623\u0645\u0627\u0645\u064a\u0629 \u0628\u062f\u064a\u0644\u0629 \u062a\u0631\u0643\u0632 \u0639\u0644\u0649 \u0627\u0644\u062e\u0635\u0648\u0635\u064a\u0629 \u0644\u0640 Reddit";
    t[12224] = "Toggle Tunnels";
    t[12225] = "\u062a\u0628\u062f\u064a\u0644 \u0627\u0644\u0623\u0646\u0641\u0627\u0642";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "\u064a\u0645\u0643\u0646 \u062a\u0639\u0637\u064a\u0644\u0647 \u0641\u064a \u0645\u0644\u0641 <code>clients.config</code>. \u0643\u0645\u0627 \u064a\u0645\u0643\u0646 \u062a\u0643\u0648\u064a\u0646\u0647 \u0644\u0644\u0627\u0631\u062a\u0628\u0627\u0637 \u0628\u0648\u0627\u062c\u0647\u0629 \u0645\u062d\u062f\u062f\u0629 \u0623\u0648 \u0643\u0644 \u0627\u0644\u0648\u0627\u062c\u0647\u0627\u062a \u0641\u064a \u0645\u0644\u0641 <code>jetty.xml</code>.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "\u064a\u0645\u0643\u0646\u0643 \u062a\u062d\u062f\u064a\u062f \u0623\u064a \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0633\u062a\u0628\u062f\u0623 \u062a\u0644\u0642\u0627\u0626\u064a\u064b\u0627 \u0639\u0646\u062f \u0625\u0639\u0627\u062f\u0629 \u062a\u0634\u063a\u064a\u0644 \u0627\u0644\u0645\u0648\u062c\u0647\u060c \u0648\u0625\u062f\u0627\u0631\u0629 \u062a\u062e\u0635\u064a\u0635 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0644\u062a\u062d\u0633\u064a\u0646 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0630\u0627\u062a \u0627\u0644\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u0643\u062b\u064a\u0641 \u0623\u0648 \u0644\u0644\u062d\u062f\u0651 \u0645\u0646 \u0627\u0644\u0636\u063a\u0637 \u0639\u0644\u0649 \u0648\u062d\u062f\u0629 \u0627\u0644\u0645\u0639\u0627\u0644\u062c\u0629 \u0627\u0644\u0645\u0631\u0643\u0632\u064a\u0629 \u0648\u0627\u0644\u0630\u0627\u0643\u0631\u0629\u060c \u0648\u0625\u0636\u0627\u0641\u0629 \u0623\u0646\u0641\u0627\u0642 \u062e\u0627\u062f\u0645 \u0648\u0639\u0645\u064a\u0644 \u0644\u062a\u0636\u064a\u064a\u0641 \u0623\u0648 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u062e\u062f\u0645\u0627\u062a \u0639\u0628\u0631 \u0627\u0644\u0634\u0628\u0643\u0629\u060c \u0648\u062a\u0639\u062f\u064a\u0644 \u062d\u062f\u0648\u062f \u0627\u0644\u0645\u0639\u062f\u0644 \u0623\u0648 \u062a\u0635\u0641\u064a\u0629 \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0644\u0645\u062f\u0627\u062e\u0644\u0643\u060c \u0648\u0627\u0644\u0645\u0632\u064a\u062f.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "\u064a\u0631\u0628\u0637 \u0628\u0639\u0646\u0648\u0627\u0646 LAN. \u064a\u0645\u0643\u0646 \u062a\u063a\u064a\u064a\u0631\u0647 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0627\u0644\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0645\u062a\u0642\u062f\u0645 <code>i2np.upnp.HTTPPort=nnnn</code>. \u064a\u0645\u0643\u0646 \u062a\u0639\u0637\u064a\u0644\u0647 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0635\u0641\u062d\u0629 <a href=/confignet>\u062a\u0643\u0648\u064a\u0646 \u0627\u0644\u0634\u0628\u0643\u0629</a>.";
    t[12234] = "Data transferred";
    t[12235] = "\u0646\u0642\u0644 \u0627\u0644\u0628\u064a\u0627\u0646\u0627\u062a";
    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "\u0641\u064a \u0627\u0644\u062e\u0627\u0646\u0629 \u0627\u0644\u0645\u062d\u062f\u062f\u0629 \u0628\u0640<i>\u0628\u062f\u0648\u0646 \u0648\u0643\u064a\u0644 \u0645\u0646 \u0623\u062c\u0644</i> \u0623\u0636\u0641 \u0627\u0644\u0633\u0637\u0631 <code>127.0.0.1,localhost</code> \u0644\u0636\u0645\u0627\u0646 \u062a\u0648\u0641\u0631 \u0645\u062d\u0637\u0629 I2P \u0648\u0627\u0644\u0645\u0648\u0627\u0642\u0639 \u0627\u0644\u0645\u0636\u064a\u0641\u0629 \u0645\u062d\u0644\u064a\u0627 \u0628\u0634\u0643\u0644 \u0645\u0633\u062a\u0645\u0631.";
    t[12250] = "Sort by idle outbound";
    t[12251] = "\u062d\u0633\u0628 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u062e\u0627\u0631\u062c";
