    t[12258] = "UDP Disabled &amp; Inbound TCP host/port not set";
    t[12259] = "\u0644\u0645 \u064a\u062a\u0645 \u062a\u0639\u064a\u064a\u0646 UDP \u062a\u0639\u0637\u064a\u0644 \u0645\u0636\u064a\u0641/\u0645\u0646\u0641\u0630 TCP \u0627\u0644\u0648\u0627\u0631\u062f\u0629";
