    t[12278] = "Always use auto-detected IP address (not firewalled)";
    t[12279] = "\u0627\u0633\u062a\u062e\u062f\u0645 \u062f\u0627\u0626\u0645\u064b\u0627 \u0639\u0646\u0648\u0627\u0646 IP \u0627\u0644\u0630\u064a \u062a\u0645 \u0627\u0643\u062a\u0634\u0627\u0641\u0647 \u062a\u0644\u0642\u0627\u0626\u064a\u064b\u0627 (\u063a\u064a\u0631 \u0645\u062d\u0645\u064a \u0628\u062c\u062f\u0627\u0631 \u0627\u0644\u062d\u0645\u0627\u064a\u0629)";
    t[12282] = "where we will store our LS";
    t[12283] = "\u062d\u064a\u062b \u0633\u0646\u0642\u0648\u0645 \u0628\u062a\u062e\u0632\u064a\u0646 LS \u0627\u0644\u062e\u0627\u0635 \u0628\u0646\u0627";
    t[12284] = "Your Local Identity [{0}] is your unique I2P router identity, similar to an IP address but tailored to I2P. ";
    t[12285] = "\u0627\u0644\u0647\u0648\u064a\u0629 \u0627\u0644\u0645\u062d\u0644\u064a\u0629 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643 [{0}] \u0647\u064a \u0647\u0648\u064a\u0629 \u062c\u0647\u0627\u0632 \u062a\u0648\u062c\u064a\u0647 I2P \u0627\u0644\u0641\u0631\u064a\u062f\u0629 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643\u060c \u0648\u0647\u064a \u062a\u0634\u0628\u0647 \u0639\u0646\u0648\u0627\u0646 IP \u0648\u0644\u0643\u0646\u0647\u0627 \u0645\u0635\u0645\u0645\u0629 \u062e\u0635\u064a\u0635\u064b\u0627 \u0644\u0640 I2P.";
