    t[12294] = "Declining transit tunnel requests as we are shutting down";
    t[12295] = "\u0631\u0641\u0636 \u0637\u0644\u0628\u0627\u062a \u0627\u0644\u0623\u0646\u0641\u0627\u0642 \u0627\u0644\u0645\u0634\u0627\u0631\u0643\u0629 \u0623\u062b\u0646\u0627\u0621 \u0625\u063a\u0644\u0627\u0642\u0646\u0627";
    t[12298] = "No name entered";
    t[12299] = "\u0644\u0645 \u064a\u062a\u0645 \u0625\u062f\u062e\u0627\u0644 \u0627\u0644\u0627\u0633\u0645";
    t[12306] = "Your transport connection limits are automatically set based on your configured bandwidth.";
    t[12307] = "\u064a\u062a\u0645 \u062a\u0639\u064a\u064a\u0646 \u062d\u062f\u0648\u062f \u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u0646\u0642\u0644 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643 \u062a\u0644\u0642\u0627\u0626\u064a\u064b\u0627 \u0628\u0646\u0627\u0621\u064b \u0639\u0644\u0649 \u0627\u0644\u0646\u0637\u0627\u0642 \u0627\u0644\u062a\u0631\u062f\u062f\u064a \u0627\u0644\u0630\u064a \u062a\u0645 \u062a\u0643\u0648\u064a\u0646\u0647.";
    t[12310] = "Move to top";
    t[12311] = "\u0627\u0646\u062a\u0642\u0644 \u0625\u0644\u0649 \u0627\u0644\u0623\u0639\u0644\u0649";
    t[12318] = "A declaration will contain a directive (keyword) with parameters to define the scope of the declaration, and can represent one of the following:";
    t[12319] = "\u0633\u064a\u062d\u062a\u0648\u064a \u0627\u0644\u0625\u0639\u0644\u0627\u0646 \u0639\u0644\u0649 \u062a\u0648\u062c\u064a\u0647 (\u0643\u0644\u0645\u0629 \u0631\u0626\u064a\u0633\u064a\u0629) \u0645\u0639 \u0645\u0639\u0644\u0645\u0627\u062a \u0644\u062a\u062d\u062f\u064a\u062f \u0646\u0637\u0627\u0642 \u0627\u0644\u0625\u0639\u0644\u0627\u0646\u060c \u0648\u064a\u0645\u0643\u0646 \u0623\u0646 \u064a\u0645\u062b\u0644 \u0648\u0627\u062d\u062f\u064b\u0627 \u0645\u0645\u0627 \u064a\u0644\u064a:";
    t[12320] = "n/a";
    t[12321] = "\u063a\u064a\u0631 \u0645\u062a\u0648\u0641\u0631";
    t[12330] = "Under <i>Create Reseed File</i> click the <i>Create reseed file</i> button";
    t[12331] = "\u062a\u062d\u062a <i>\u0625\u0646\u0634\u0627\u0621 \u0645\u0644\u0641 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0648\u0631</i> \u0627\u0646\u0642\u0631 \u0641\u0648\u0642 \u0627\u0644\u0632\u0631 <i>\u0625\u0646\u0634\u0627\u0621 \u0645\u0644\u0641 \u0625\u0639\u0627\u062f\u0629 \u0627\u0644\u0628\u0630\u0648\u0631</i>";
    t[12342] = "I2P+ Bug Reports";
    t[12343] = "\u062a\u0642\u0627\u0631\u064a\u0631 \u0623\u062e\u0637\u0627\u0621 I2P";
    t[12348] = "The unique cryptographic identity of the inbound endpoint of a tunnel providing access to a service on the I2P network, represented as a Base32 or Base64 hash of the public key. Equivalent to an IP address and port.";
    t[12349] = "\u0627\u0644\u0647\u0648\u064a\u0629 \u0627\u0644\u062a\u0634\u0641\u064a\u0631\u064a\u0629 \u0627\u0644\u0641\u0631\u064a\u062f\u0629 \u0644\u0646\u0642\u0637\u0629 \u0627\u0644\u062f\u062e\u0648\u0644 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0627\u0644\u0646\u0641\u0642 \u0627\u0644\u0630\u064a \u064a\u0648\u0641\u0631 \u0627\u0644\u0648\u0635\u0648\u0644 \u0625\u0644\u0649 \u062e\u062f\u0645\u0629 \u0639\u0644\u0649 \u0634\u0628\u0643\u0629 I2P\u060c \u0648\u0627\u0644\u0645\u0645\u062b\u0644\u0629 \u0639\u0644\u0649 \u0634\u0643\u0644 \u0647\u0627\u0634 \u0644\u0644\u0645\u0641\u062a\u0627\u062d \u0627\u0644\u0639\u0627\u0645 \u0628\u0627\u0633\u062a\u062e\u062f\u0627\u0645 \u0642\u0627\u0639\u062f\u0629 32 \u0623\u0648 64. \u062a\u0639\u0627\u062f\u0644 \u0639\u0646\u0648\u0627\u0646 IP \u0648\u0645\u0646\u0641\u0630.";
    t[12352] = "FAQ";
    t[12353] = "\u0623\u0633\u0626\u0644\u0629 \u0645\u062a\u0643\u0631\u0631\u0629";
