    t[12365] = "\u062e\u0637\u0623 \u0641\u064a \u0646\u0641\u0627\u062f \u0627\u0644\u0630\u0627\u0643\u0631\u0629";
    t[12366] = "Plugin from {0} has invalid name or version";
    t[12367] = "\u0627\u0644\u0645\u0644\u062d\u0642 {0} \u0644\u0647 \u0627\u0635\u062f\u0627\u0631 \u0627\u0648 \u0627\u0633\u0645 \u063a\u064a\u0631 \u0645\u0642\u0628\u0648\u0644";
    t[12368] = "Package/repository installation";
    t[12369] = "\u062a\u062b\u0628\u064a\u062a \u0627\u0644\u062d\u0632\u0645/\u0627\u0644\u0645\u0633\u062a\u0648\u062f\u0639";
    t[12370] = "Certain firewalls such as symmetric NATs may not work well with I2P.";
